(6, 'Điện thoại Samsung Galaxy A10s (32GB/2GB) - Hãng cung cấp chính thức 58 58', '<p>V1W<br />\r\nLRU<br />\r\nBộ sản phẩm bao gồm điện thoại Samsung Galaxy A10s, bộ d&acirc;y sạc điện thoại v&agrave; giấy HDSD.&nbsp;<br />\r\n&nbsp;<br />\r\ntham số c&ocirc;ng nghệ Samsung Galaxy A10s:&nbsp;<br />\r\nM&agrave;n h&igrave;nh: m&agrave;n h&igrave;nh v&ocirc; cực Infinity-V 6.2&rdquo; HD+ (720 x 1520 pixels)&nbsp;<br />\r\nTỷ lệ sườn h&igrave;nh: 19:9&nbsp;<br />\r\nCamera:&nbsp;<br />\r\nhai camera sau&nbsp;<br />\r\n&ndash; Camera ch&iacute;nh: 13 MP, f/một.8&nbsp;<br />\r\n&ndash; Camera x&oacute;a ph&ocirc;ng: 2 MP, f/2.4, cảm biến đo độ s&acirc;u trường ảnh&nbsp;<br />\r\nCamera trước: 8MP, f/2.0&nbsp;<br />\r\nTh&acirc;n m&aacute;y: 156.9 x 75.8 x 7.8 mm, bề ngo&agrave;i nguy&ecirc;n khối&nbsp;<br />\r\nVi xử l&yacute;: Octa Core 2.0GHz&nbsp;<br />\r\nBộ nhớ: 32 GB, 2 GB RAM + Khe cắm MicroSD tối đa 512GB&nbsp;<br />\r\nPin: 4,000mAh&nbsp;<br />\r\nKh&aacute;c:&nbsp;<br />\r\n&bull; Cảm biến v&acirc;n tay 1 chạm mặt lưng&nbsp;<br />\r\n&bull; khoa học nhận diện khu&ocirc;n mặt&nbsp;<br />\r\n&bull; &Acirc;m thanh v&ograve;m cao cấp chuẩn Dolby Atmo&nbsp;<br />\r\nBảo h&agrave;nh:&nbsp;<br />\r\nthời gian bảo h&agrave;nh: 12 th&aacute;ng&nbsp;<br />\r\ntrọng điểm bảo h&agrave;nh:https://www.samsung.com/vn/support/service-center/&nbsp;<br />\r\nHotline: 1800-588-855<br />\r\n22<br />\r\n65</p>', 'samsung_galaxy_a10s.png', 3990000, 40, 40, 0, 0, 8, 3, NULL, 1, '2021-03-01 09:40:47', '2021-03-04 09:17:38', NULL),
(7, 'Điện thoại Siêu Nhỏ B3310 02 sim 02 sóng gắn được thẻ nhớ', '<p>H&agrave;ng mới 100% Fullbox - Bảo h&agrave;nh 12 th&aacute;ng Điện thoại si&ecirc;u nhỏ, chỉ b&eacute; bằng c&aacute;i bật lửa qu&aacute; y&ecirc;u lu&ocirc;n.</p>\r\n\r\n<p>M&agrave;u sắc : đỏ, cam, v&agrave;ng, xanh, x&aacute;m, đen XANH NGỌC v&agrave; HỒNG cute V&agrave;ng v&agrave; hồng l&agrave; 2 m&agrave;u độc lạ bắt mắt pin 350mA d&ugrave;ng nghe gọi tr&ecirc;n dưới 40 tiếng ( tuỳ mức độ sử dụng của c&aacute;c bạn )</p>\r\n\r\n<p>&bull; full box nguy&ecirc;n hộp gồm m&aacute;y k&egrave;m bộ sạc</p>\r\n\r\n<p>&bull; chức năng ch&iacute;nh :lắp được 2 sim nghe gọi, nhắn tin, kết nối blutooth để nghe nhạc hay nghe điện thoại đều rất tiện lợi. Ngo&agrave;i ra m&aacute;y c&oacute; th&ecirc;m chức năng đổi giọng n&oacute;i Nam Nữ rất th&uacute; vị. Thực sự l&agrave; 1 si&ecirc;u phẩm đ&aacute;ng để trải nghiệm</p>\r\n\r\n<p>&bull; ng&ocirc;n ngữ : TIẾNG VIỆT , tiếng anh v&agrave; c&aacute;c ng&ocirc;n ngữ kh&aacute;c</p>\r\n\r\n<p>&bull; cam kết h&agrave;ng y h&igrave;nh. lỗi 1 đổi 1. cảm ơn sự ủng hộ của qu&yacute; kh&aacute;ch.</p>\r\n\r\n<p>❤️❤️❤️ ĐC: 304/4a Trường Chinh- Phường 13 -Qu&acirc;n T&acirc;n b&igrave;nh - tp Hồ Ch&iacute; Minh Số điện thoại 0938.559.505 từ 8H-19H )Thứ 2 - thứ 6 ) 8h -17h ng&agrave;y thứ 7 . (Chủ Nhật nghỉ ) #điệnthoạimini #BM10 #dienthoaimini</p>', 'mini_nokia_1.jpg', 175, 40, 38, 0, 3, 8, 8, NULL, 1, '2021-03-01 09:57:43', '2021-03-06 08:39:37', NULL),
(8, 'ĐIỆN THOẠI OPPO A3S 2/16G-3/32G CHIẾN PUBG FREE FIRE LIÊN QUÂN MƯỢT MÀ', '<p>M&agrave;n h&igrave;nh:IPS LCD, 6.2&quot;,HD+<br />\r\nHệ điều h&agrave;nh:Android 8.1 (Oreo)<br />\r\nCamera sau:Ch&iacute;nh 13 MP &amp;amp; Phụ 2 MP<br />\r\nCamera trước:8 MP<br />\r\nCPU:Qualcomm Snapdragon 450 8 nh&acirc;n 64-bit<br />\r\nRAM:2 GB - 3GB<br />\r\nBộ nhớ trong:16 GB - 32GB&nbsp;<br />\r\nThẻ nhớ:MicroSD, hỗ trợ tối đa 256 GB<br />\r\nThẻ SIM:2 Nano SIM,Hỗ trợ 4G<br />\r\nDung lượng pin:4230 mAh</p>', 'oppo_a3s_1.jpg', 2299000, 10, 10, 0, 0, 8, 4, NULL, 1, '2021-03-01 09:59:03', '2021-03-01 09:59:03', NULL),
(9, 'ĐIÊN THOẠI SAMSUNG GALAXY S8 1sim ram 4G/64G mới Full GEME PUBG _ LIÊN QUÂN MƯỢT', '<p>SAMSUNG GALAXY S8 2sim:<br />\r\nM&agrave;n h&igrave;nh 5.8 inch 2K AMOLED (2560 x 1440 pixel)<br />\r\nPhi&ecirc;n bản 2 sim &ndash; 1SIM<br />\r\nCPU Qualcomm Snapdragon 835 hoặc Samsung Exynos 8895<br />\r\nTốc độ CPU 4 nh&acirc;n 2.45 GHz Kryo &amp;amp; 4 nh&acirc;n 1.9 GHz Kryo<br />\r\nCamera Ch&iacute;nh: 12.0 MP, Phụ: 8.0 MP (X&oacute;a ph&ocirc;ng, focus chủ thể)<br />\r\nRAM 4GB<br />\r\nBộ nhớ trong 64GB<br />\r\nHệ điều h&agrave;nh Android 7.1.1 (Nougat)<br />\r\nKhả năng chống nước IP68 - chống bụi / chống nước hơn 1,5 m&eacute;t v&agrave; 30 ph&uacute;t<br />\r\nDung lượng pin 3000mAh (5.8 inch)Cam kết chất lượng: Sản phẩm l&agrave; M&aacute;y Ch&iacute;nh h&atilde;ng Sản Xuất. (shop kh&ocirc;ng b&aacute;n h&agrave;ng Nh&aacute;i, Fake, h&agrave;ng Copy, k&eacute;m chất lượng.<br />\r\nSHOPEE &nbsp;C&oacute; ch&iacute;nh s&aacute;ch Bảo Vệ Qu&yacute; kh&aacute;ch h&agrave;ng. Qu&yacute; kh&aacute;ch nhận m&aacute;y xong kh&ocirc;ng Ưng &yacute; th&igrave; c&oacute; quyền đổi trả trong 7 ng&agrave;y ạ. N&ecirc;n Qu&yacute; kh&aacute;ch y&ecirc;n t&acirc;m nhận Sản phẩm. Tr&acirc;n trọng !<br />\r\nQU&Yacute; KH&Aacute;CH &nbsp;LI&Ecirc;N HỆ SHOP 0968.234.179 GẶP A THUẬN&nbsp;<br />\r\nĐC 362/2 L&Ecirc; ĐỨC THỌ PHƯỜNG 6 QUẬN G&Ograve; VẤP ( NGAY ỦY BAN PHƯỜNG 6 GẦN CHỢ AN &nbsp;NHƠN )</p>', 'galaxy_s8.jpg', 3099000, 10, 8, 0, 0, 8, 3, NULL, 1, '2021-03-01 10:00:11', '2021-03-06 08:38:18', NULL),
(10, 'Điện thoại 3 sim Kechaoda K888, pin khủng, giá rẻ', '<p>Kechaoda K888 l&agrave; mẫu điện thoại độc lạ c&oacute; thế kế cực kỳ ấn tượng. Bề ngo&agrave;i tr&ocirc;ng như một chiếc bộ đ&agrave;m với b&agrave;n ph&iacute;m số to, r&otilde; r&agrave;ng, rất th&iacute;ch hợp cho người lớn tuổi d&ugrave;ng ở nh&agrave;, hoặc l&agrave;m số hotline cho c&ocirc;ng ty.<br />\r\nK&iacute;ch thước của Kechaoda 888 kh&aacute; lớn 19.6 x 7.45 x 1.0 cm (d&agrave;i x rộng x độ d&agrave;y). Ph&iacute;a tr&ecirc;n được trang bị một ăng ten cho ph&eacute;p thu s&oacute;ng cực tốt. Kechaoda K888 được thiết kế l&agrave; chiếc điện thoại 3 sim, vẻ ngo&agrave;i m&agrave;u đen mạnh mẽ. Dung lượng pin cực khủng l&ecirc;n tới 4000 mAh, cho ph&eacute;p bạn sử dụng từ 4-7 ng&agrave;y, kh&ocirc;ng những thế m&aacute;y c&ograve;n c&oacute; thể hỗ trợ sạc cho c&aacute;c m&aacute;y điện thoại kh&aacute;c. Ngo&agrave;i ra chiếc Kechaoda K888 c&ograve;n được trang bị dải loa khủng hai b&ecirc;n th&acirc;n m&aacute;y với Bass cực chuẩn, cho ph&eacute;p bạn sử dụng n&oacute; để nghe nhạc, FM..vvv. như một chiếc loa thực thụ.<br />\r\nĐặc biệt ở chiếc Kechaoda K888 c&ograve;n được trang bị t&iacute;nh năng Bluetooth Partner, cho ph&eacute;p người d&ugrave;ng c&oacute; thể kết nối với Smartphone để thoải m&aacute;i nghe gọi, giải tr&iacute; mp3..v.vv.. Ph&iacute;a tr&ecirc;n của m&aacute;y c&ograve;n được trang bị một đ&egrave;n pin si&ecirc;u khủng, cho ph&eacute;p bạn sử dụng n&oacute; như một chiếc đ&egrave;n pin trong những l&uacute;c cần thiết.</p>\r\n\r\n<p>Đ/C (ngay ng&atilde; 3 thống nhất giao nguyễn văn lượng) - hẻm 269/3 đường Thống Nhất Phường 11 G&ograve; vấp tp.Hcm<br />\r\nLh : 0868959747 - 0909809928<br />\r\nweb : 2tekvn.net - loakeodidong.net</p>', 'giant_phone_1.jpg', 450000, 20, 20, 0, 0, 8, 12, NULL, 1, '2021-03-01 10:01:59', '2021-03-01 10:01:59', NULL),
(11, 'Điện thoại Vsmart Live 4 (6GB/64GB) - Hàng chính hãng', '<p>✅ M&agrave;n h&igrave;nh: IPS LCD 6.5&quot;, Full HD+<br />\r\n✅ Hệ điều h&agrave;nh: Android 10<br />\r\n✅ Chipset: Qualcomm Snapdragon 675 - RAM: 6GB<br />\r\n✅ Bộ nhớ trong: 64GB<br />\r\n✅ Camera trước: 13MP<br />\r\n✅ Camera ch&iacute;nh: 48MP + 8MP + 5MP + 2MP<br />\r\n✅ C&ocirc;̉ng sạc: USB Type-C<br />\r\n✅ Dung lượng pin: 5000 mAh<br />\r\n✅ Bộ sản phẩm gồm: Th&acirc;n m&aacute;y, sạc, c&aacute;p, s&aacute;ch hướng dẫn, tai nghe, ốp lưng,...</p>\r\n\r\n<p>LƯU &Yacute; KHI MUA H&Agrave;NG: Cảm ơn qu&yacute; kh&aacute;ch đ&atilde; quan t&acirc;m đến sản phẩm b&ecirc;n shop, qu&yacute; kh&aacute;ch vui l&ograve;ng d&agrave;nh &iacute;t thời gian đọc kĩ ch&iacute;nh s&aacute;ch bảo h&agrave;nh đổi trả:<br />\r\n&Aacute;p dụng sản phẩm Mobile/Tablet/Laptop<br />\r\n✔️ Sản phẩm được bao test 7 ng&agrave;y kể từ ng&agrave;y nhận được sản phẩm v&agrave; sẽ được đổi m&aacute;y mới c&ugrave;ng model hoặc gi&aacute; trị tương đương sau khi được thẩm định lỗi kĩ thuật.<br />\r\n✔️ Sản phẩm lỗi kĩ thuật được x&aacute;c nhận bởi trung t&acirc;m bảo h&agrave;nh ủy quyền ch&iacute;nh h&atilde;ng (bằng văn bản); kh&aacute;ch h&agrave;ng c&oacute; thể gửi lại shop để x&aacute;c nhận lỗi hoặc tới trung t&acirc;m bảo h&agrave;nh ủy quyền gần nhất để thẩm định lỗi.<br />\r\n✔️ Sản phẩm đổi-trả phải c&ograve;n nguy&ecirc;n hiện trạng m&aacute;y kh&ocirc;ng trầy xước, kh&ocirc;ng bể vỡ, v&ocirc; nước, g&atilde;y ch&acirc;n sim, khung thẻ nhớ&hellip; (tất cả c&aacute;c t&aacute;c động ngoại lực từ ph&iacute;a kh&aacute;ch h&agrave;ng đều TỪ CHỐI BẢO H&Agrave;NH)<br />\r\n✔️ Sản phẩm đổi trả phải c&ograve;n nguy&ecirc;n hộp tr&ugrave;ng imei, phụ kiện k&egrave;m theo m&aacute;y kh&ocirc;ng trầy xước, ch&aacute;y nổ, đứt d&acirc;y (nếu trầy xước shop kh&ocirc;ng đổi phụ kiện mới)<br />\r\n✔️ Sau 7 ng&agrave;y bao test, sản phẩm vẫn nhận ch&iacute;nh s&aacute;ch bảo h&agrave;nh theo quy định của nh&agrave; sản xuất kể từ ng&agrave;y mua (kh&aacute;ch chịu ph&iacute; vận chuyển tới shop bảo h&agrave;nh hộ hoặc tự đến trung t&acirc;m bảo h&agrave;nh gần nhất).<br />\r\n✔️ Trong một số trường hợp sản phẩm đ&atilde; được k&iacute;ch hoạt bảo h&agrave;nh tham gia chương tr&igrave;nh khuyến m&atilde;i c&oacute; gi&aacute; tốt nhất cho kh&aacute;ch h&agrave;ng. Vui l&ograve;ng chat với shop để được hỗ trợ th&ecirc;m th&ocirc;ng tin.</p>\r\n\r\n<p>❌ Sản phẩm bị TỪ CHỐI BẢO H&Agrave;NH khi ch&aacute;y nổ, bể vỡ, t&aacute;c động ngoại lực v&agrave;o th&acirc;n v&agrave; b&ecirc;n trong m&aacute;y, c&oacute; thay đổi sửa chữa b&ecirc;n ngo&agrave;i.<br />\r\n❌ C&aacute;c sản phẩm bị kh&oacute;a t&agrave;i khoản như Gmail, Samsung account&hellip; Kh&aacute;ch tự chịu ph&iacute; mở kh&oacute;a nếu kh&ocirc;ng nhớ mật khẩu.<br />\r\n❌ V&igrave; lượng h&agrave;ng ho&aacute; nhiều shop kh&ocirc;ng nhận đổi trả trong trường hợp kh&aacute;ch kh&ocirc;ng th&iacute;ch, kh&ocirc;ng ưng m&agrave;u, chất liệu; qu&yacute; kh&aacute;ch vui l&ograve;ng đọc kĩ m&ocirc; tả v&agrave; xem h&igrave;nh ảnh cụ thể; nếu cần h&atilde;y chat với shop để được tư vấn.</p>', 'vsmart_1.jpg', 3496000, 10, 10, 0, 0, 8, 10, NULL, 1, '2021-03-01 10:03:22', '2021-03-01 10:03:22', NULL),
(12, 'Điện thoại Xiaomi Redmi Note 8 Pro 6/64 GB có Tiếng Việt', '<p>TH&Ocirc;NG SỐ KĨ THUẬT:&nbsp;</p>\r\n\r\n<p>&bull; M&agrave;n h&igrave;nh: IPS LCD 6.53&quot; Full HD+ (1080 x 2340 Pixels)<br />\r\n&bull; CPU: MediaTek Helio G90T 8 nh&acirc;n<br />\r\n&bull; Hệ điều h&agrave;nh: Android 10.0<br />\r\n&bull; Camera sau: Ch&iacute;nh 64MP &amp;amp; Phụ 8MP, 2MP, 2MP<br />\r\n&bull; Camera trước: 20MP<br />\r\n&bull; RAM/ROM: 6/64GB<br />\r\n&bull; Pin: 4500 mAh<br />\r\n&bull; Hỗ trợ 4G d&ugrave;ng 1 sim 1 thẻ hoặc 2 sim</p>\r\n\r\n<p>Sản phẩm Nội địa Trung Quốc FullBox đ&atilde; được Up ROM Quốc Tế MIUI 12 chạy ổn định.</p>\r\n\r\n<p>Chiến ngon c&aacute;c tựa Game HOT như: PUBG, Li&ecirc;n minh Tốc Chiến, Li&ecirc;n Qu&acirc;n,...</p>', 'xiao.jpg', 3999000, 12, 12, 0, 0, 8, 9, NULL, 1, '2021-03-01 10:07:00', '2021-03-01 10:07:00', NULL),
(13, 'Điện thoại Nokia 105 Dual SIM (2 sim) - Hàng Chính hãng', '<p>C&ocirc;ng ty TNHH Đại Đo&agrave;n Gia</p>\r\n\r\n<p>M&Ocirc; TẢ SẢN PHẨM</p>\r\n\r\n<p>Nokia 105 Dual Sim &nbsp;&ndash; sản phẩm đến từ thương hiệu Nokia tiếng tăm, sở hữu một mức gi&aacute; rẻ, đi k&egrave;m c&aacute;c chức năng cơ bản của một chiếc điện thoại phổ th&ocirc;ng. Một sự lựa chọn ph&ugrave; hợp với t&uacute;i tiền, d&agrave;nh cho những bạn chỉ cần một chiếc điện thoại đ&aacute;p ứng đủ c&aacute;c nhu cầu nghe, gọi cơ bản.</p>\r\n\r\n<p>Thiết kế nhỏ gọn.</p>\r\n\r\n<p>Kh&aacute; tương đồng với phi&ecirc;n bản 2015, Nokia 105 &nbsp;được thiết kế với vẻ ngo&agrave;i kh&aacute; thanh mảnh, mềm mại. C&oacute; lớp vỏ nhựa bền bỉ, rất hợp thời trang, gọn g&agrave;ng v&agrave; tinh tế. C&aacute;c cạch m&agrave;y đều được bo cong tr&ograve;n gi&uacute;p tạo cho người d&ugrave;ng th&ecirc;m cảm gi&aacute;c chắc tay khi cầm nắm. Trọng lượng của m&aacute;y chỉ vỏn vẹn 73 g, cực k&igrave; gọn nhẹ, v&agrave; dễ d&agrave;ng mang theo.</p>\r\n\r\n<p>&nbsp;B&agrave;n ph&iacute;m th&acirc;n thiện.<br />\r\n&nbsp;<br />\r\nNokia 105 được thiết kế b&agrave;n ph&iacute;m với c&aacute;c k&yacute; tự được in to r&otilde; r&agrave;ng, c&oacute; bố tr&iacute; vị tr&iacute; rất hợp l&iacute;, n&uacute;t bấm với phần đệm cao su to, c&oacute; độ nảy cao, kh&aacute; nhạy v&agrave; &ecirc;m, gi&uacute;p người d&ugrave;ng dễ d&agrave;ng thực hiện c&aacute;c thao t&aacute;c cơ bản.</p>\r\n\r\n<p>M&agrave;n h&igrave;nh TFT 1.8 inch.</p>\r\n\r\n<p>Nokia 105 được trang bị m&agrave;n h&igrave;nh TFT với k&iacute;ch thước 1.8 inch, c&oacute; độ ph&acirc;n giải 120 x 160 pixels, cung cấp cho người sử dụng một h&igrave;nh ảnh r&otilde; r&agrave;ng, chất lượng hiển thị kh&aacute; tốt, đem tới sự trải nghiệm tốt nhất cho người d&ugrave;ng.</p>\r\n\r\n<p>T&iacute;nh năng đa dạng.</p>\r\n\r\n<p>Điện thoại Nokia 105 Dual Sim được hỗ trợ danh bạ lưu đến 500 số với 2 sim 2 s&oacute;ng, c&oacute; jack tai nghe 3.5 mm để hỗ trợ nghe FM, c&ugrave;ng 1 đ&egrave;n LED c&oacute; t&aacute;c dụng như một chiếc đ&egrave;n pin tiện lợi. Ngo&agrave;i ra m&aacute;y c&ograve;n c&oacute; c&aacute;c t&iacute;nh năng như b&aacute;o thức, xem lịch v&agrave; giải tr&iacute;.</p>\r\n\r\n<p>Thời lượng pin tốt.</p>\r\n\r\n<p>Được trang bị pin Li-ion dung lượng 800 mAh, Nokia 105 c&oacute; thể cung cấp cho người d&ugrave;ng thời gian đ&agrave;m thoại l&ecirc;n đến 15 giờ li&ecirc;n tục, đ&aacute;p ứng tốt cho nhu cầu sử dụng l&acirc;u d&agrave;i của người sử dụng.</p>\r\n\r\n<p>M&agrave;n h&igrave;nh<br />\r\n-C&ocirc;ng nghệ m&agrave;n h&igrave;nh&nbsp;&nbsp; &nbsp;TFT<br />\r\n- Độ ph&acirc;n giải&nbsp;&nbsp; &nbsp;QQVGA (120 x 160 pixels)<br />\r\n- M&agrave;n h&igrave;nh rộng&nbsp;&nbsp; &nbsp;1.8&quot;<br />\r\n- Mặt k&iacute;nh cảm ứng&nbsp;&nbsp; &nbsp;Kh&ocirc;ng có cảm ứng<br />\r\n- Camera sau<br />\r\n- Độ ph&acirc;n giải&nbsp;&nbsp; &nbsp;Kh&ocirc;ng c&oacute;<br />\r\n- Quay phim&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n- Đ&egrave;n Flash&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n- Chụp ảnh n&acirc;ng cao&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n- Camera trước<br />\r\n- Độ ph&acirc;n giải&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n- Videocall&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n- Th&ocirc;ng tin kh&aacute;c&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n- Hệ điều h&agrave;nh - CPU<br />\r\n- Hệ điều h&agrave;nh&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n- Chipset (h&atilde;ng SX CPU)&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n- Tốc độ CPU&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n- Chip đồ họa (GPU)&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n- Bộ nhớ &amp;amp; Lưu trữ<br />\r\n- RAM&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n- Bộ nhớ trong&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n- Bộ nhớ c&ograve;n lại (khả dụng)&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n- Thẻ nhớ ngo&agrave;i&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n- Kết nối<br />\r\n- Mạng di động&nbsp;&nbsp; &nbsp;2G, Kh&ocirc;ng kết nối internet<br />\r\n- SIM&nbsp;&nbsp; &nbsp;2 SIM thường<br />\r\n- Wifi&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n- GPS&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n- Bluetooth&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n- C&ocirc;̉ng k&ecirc;́t n&ocirc;́i/sạc&nbsp;&nbsp; &nbsp;Micro USB<br />\r\n- Jack tai nghe&nbsp;&nbsp; &nbsp;3.5 mm<br />\r\n- Kết nối kh&aacute;c&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n- Thiết kế &amp;amp; Trọng lượng<br />\r\n- Thiết kế&nbsp;&nbsp; &nbsp;Pin rời<br />\r\n- Chất liệu&nbsp;&nbsp; &nbsp;Nhựa<br />\r\n- K&iacute;ch thước&nbsp;&nbsp; &nbsp;D&agrave;i 112 mm - Ngang 49.5 mm - D&agrave;y 14.4 mm<br />\r\n- Trọng lượng&nbsp;&nbsp; &nbsp;73 g<br />\r\n- Th&ocirc;ng tin pin &amp;amp; Sạc<br />\r\n- Dung lượng pin&nbsp;&nbsp; &nbsp;800 mAh<br />\r\n- Loại pin&nbsp;&nbsp; &nbsp;Pin chuẩn Li-Ion<br />\r\n- C&ocirc;ng nghệ pin&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n- Tiện &iacute;ch<br />\r\n- Bảo mật n&acirc;ng cao&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n- T&iacute;nh năng đặc biệt&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n- Ghi &acirc;m&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n- Radio&nbsp;&nbsp; &nbsp;C&oacute;<br />\r\n- Xem phim&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n- Nghe nhạc&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n- Bộ sản phẩm bao gồm: 1 th&acirc;n m&aacute;y x 1 sạc x &nbsp;1 s&aacute;ch hdsd<br />\r\n- Thời gian bảo h&agrave;nh : 12 th&aacute;ng</p>\r\n\r\n<p>#nokia #nokia105 #nokia105dualsim #daidoangia #banphim #dienthoai #mobilephone #dualsim</p>', 'nokia_dual_sim_1.jpg', 350000, 19, 19, 0, 0, 8, 8, NULL, 1, '2021-03-01 10:08:05', '2021-03-01 10:08:05', NULL),
(14, '[TAS9] Điện thoại Xiaomi Redmi Note 4X - MIUI 11 tiếng Việt', '<p>LƯU &Yacute; :&nbsp;<br />\r\n- M&Aacute;Y Đ&Atilde; ĐƯỢC C&Agrave;I ROM TIẾNG VIỆT HO&Agrave;N CHỈNH (M&Aacute;Y B&Aacute;N RA SAU 30/9/2019 Đ&Atilde; ĐƯỢC C&Agrave;I TIẾNG VIỆT SẴN)<br />\r\n- M&Aacute;Y L&Agrave; H&Agrave;NG CHUẨN XIAOMI, Đ&Atilde; QUA SƯ DỤNG, T&Igrave;NH TRẠNG M&Aacute;Y ĐẠT TẦM 95% (TRẦY XƯỚC RẤT NHẸ)<br />\r\n- H&Igrave;NH ẢNH SẢN PHẨM ĐỀU L&Agrave; H&Igrave;NH THẬT DO SHOP TỰ CHỤP<br />\r\n- M&Aacute;Y L&Agrave; BẢN QUỐC TẾ CHẠY 2 SIM 2 S&Oacute;NG ( D&Ugrave;NG MỌI SIM Ở VIỆT NAM, 3G, 4G KHỎE ) .<br />\r\n- BỘ SẢN PHẨM B&Aacute;N RA GỒM C&Oacute; : M&Aacute;Y, SẠC C&Aacute;P , TAI NGHE , TẶNG ỐP CƯỜNG LỰC<br />\r\n- SHIP COD TO&Agrave;N QUỐC, QU&Yacute; KH&Aacute;CH ĐƯỢC KIỂM H&Agrave;NG TRƯỚC RỒI MỚI THANH TO&Aacute;N ( KHI MUỐN KIỂM H&Agrave;NG TH&Igrave; QU&Yacute; KH&Aacute;CH VUI L&Ograve;NG CHỌN VIETTELPOST V&Agrave; Y&Ecirc;U CẦU NH&Acirc;N VI&Ecirc;N GIAO H&Agrave;NG GỌI ĐIỆN CHO SHOP XIN PH&Eacute;P L&Agrave; SẼ ĐƯỢC KIỂM H&Agrave;NG )<br />\r\n- SẢN PHẨM ĐƯỢC BẢO H&Agrave;NH 3 TH&Aacute;NG, ĐỔI TRẢ 7 NG&Agrave;Y NẾU C&Oacute; LỖI . C&Oacute; K&Egrave;M THEO THẺ BẢO H&Agrave;NH V&Agrave; TEM BẢO H&Agrave;NH TR&Ecirc;N SẢN PHẨM</p>\r\n\r\n<p><br />\r\n&nbsp; &nbsp;TH&Ocirc;NG SỐ CHI TIẾT : Xiaomi Redmi Note 4x 2 Sim</p>\r\n\r\n<p>- M&aacute;y sử dụng 2 sim , hỗ trợ mạng 4G<br />\r\n- M&agrave;n h&igrave;nh:Full HD, 5.5&quot;, 1080 x 1920 pixels<br />\r\n- Hệ điều h&agrave;nh: Android 7.0 tr&ecirc;n n&ecirc;n MIUI 11 mới nhất , c&oacute; tiếng Việt đầy đủ , c&oacute; CH PLAY<br />\r\n- CPU: Snapdragon 625, 8 nh&acirc;n, Octa-core 2.0 GHz Cortex-A53<br />\r\n- RAM / Bộ nhớ trong : 3G/32G hoặc 4G/64G<br />\r\n- Camera sau: 13 MP<br />\r\n- Camera trước: 5 MP<br />\r\n- Thẻ SIM: 2 SIM - 2 S&oacute;ng, Nano SIM, Micro SIM<br />\r\n- Dung lượng pin: 4100 mAh<br />\r\n- Hỗ trợ bảo mật V&acirc;n tay</p>', 'note_4x_1.jpg', 1688000, 8, 8, 0, 0, 8, 6, NULL, 1, '2021-03-01 10:09:23', '2021-03-01 10:09:23', NULL),
(15, '[Quà Kèm] Máy Đọc Sách Kindle Paperwhite Máy Cũ Nhập Nhật Mỹ', '<p>- Khuyến m&atilde;i tặng 01 Sling Grip chống mỏi tay khi đọc s&aacute;ch hoặc 01 bao da theo m&aacute;y (Qu&yacute; kh&aacute;ch vui l&ograve;ng chọn 1 phần qu&agrave; khi đặt m&aacute;y v&agrave; note l&ecirc;n đơn h&agrave;ng).</p>\r\n\r\n<p>Sản phẩm c&oacute; 2 phi&ecirc;n bản:<br />\r\n- M&aacute;y đẹp: M&agrave;n h&igrave;nh kh&ocirc;ng trầy xước. Đ&egrave;n nền s&aacute;ng đẹp r&otilde;. &nbsp;Viền m&aacute;y v&agrave; mặt sau kh&ocirc;ng xước hoặc xước nhẹ.<br />\r\n- M&aacute;y xước: M&agrave;n h&igrave;nh c&oacute; xước hoặc kh&ocirc;ng c&oacute; xước. Đ&egrave;n nền s&aacute;ng đẹp r&otilde;. Viền m&aacute;y c&oacute; xước tương đối. Mặt sau c&oacute; hoặc kh&ocirc;ng xước. Nếu bạn cần m&aacute;y bền, đọc s&aacute;ch được hiển thị tốt m&agrave; kh&ocirc;ng quan t&acirc;m vẻ ngo&agrave;i th&igrave; n&ecirc;n mua phi&ecirc;n bản n&agrave;y.&nbsp;<br />\r\n- PPW3 c&oacute; 2 m&agrave;u đen v&agrave; trắng. Bạn nếu muốn lấy m&agrave;u trắng th&igrave; chat confirm trước với shop nh&eacute;. Mặc định sẽ l&agrave; m&agrave;u đen.&nbsp;<br />\r\n- Phụ kiện c&aacute;p sạc usb.<br />\r\n- C&aacute;c n&uacute;t bấm chắc chắn, kh&ocirc;ng bị l&uacute;n sụp.<br />\r\n- Pin 2-3 tuần t&ugrave;y cường độ sử dụng.<br />\r\n- Bảo h&agrave;nh 3 th&aacute;ng 1 đổi 1 hoặc ho&agrave;n tiền.</p>\r\n\r\n<p>Chức năng:<br />\r\n- M&agrave;n h&igrave;nh chống ch&oacute;i, hiển thị như tr&ecirc;n giấy kh&ocirc;ng hại mắt<br />\r\n- Bộ nhớ trong: PPW1: 2g. PPW2: 2-4g. PPW3: 4g. PPW4: 8gb<br />\r\n- Đọc s&aacute;ch, truyện tranh, kết nối wifi duyệt web, tra từ điển trực tiếp khi đọc.<br />\r\n- M&aacute;y kết nối account send to kindle dễ d&agrave;ng, kh&ocirc;ng bị Blacklist.<br />\r\n- PPW4 hỗ trợ kết nối tai nghe blutooth d&ugrave;ng để nghe s&aacute;ch n&oacute;i tiếng anh.<br />\r\nCam kết:<br />\r\n- M&aacute;y nguy&ecirc;n Zin, kh&ocirc;ng dựng, kh&ocirc;ng sửa, kh&ocirc;ng refurbished.<br />\r\n- M&aacute;y mua trực tiếp tại Nhật Mỹ kh&ocirc;ng th&ocirc;ng qua l&aacute;i bu&ocirc;n, kh&ocirc;ng nhập Trung Quốc , kh&ocirc;ng nhập h&agrave;ng đ&atilde; sửa chữa, đ&atilde; dựng, đ&atilde; mua ở Trung Quốc hay tại Việt Nam.&nbsp;<br />\r\n- Hỗ trợ c&agrave;i đặt từ điển, đăng k&yacute; t&agrave;i khoản v&agrave; hướng dẫn sử dụng.</p>', 'reading_book.jpg', 1390000, 12, 12, 0, 0, 8, 9, NULL, 1, '2021-03-01 10:11:22', '2021-03-01 10:11:22', NULL),
(16, 'Máy tính bảng Xiaomi Mipad 1 + cường lực, ốp lưng', '<p>M&aacute;y mới 99% k&egrave;m ốp, cường lực, sạc, c&aacute;p.<br />\r\nBảo h&agrave;nh mọi lỗi trong 3 th&aacute;ng, đổi mới 15 ng&agrave;y nh&eacute; anh em :D<br />\r\n-----<br />\r\nM&aacute;y c&oacute; 2 bản rom Android, nếu bạn muốn c&agrave;i h&atilde;y nhắn tin cho shop khi đặt mua.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &bull; Rom 1: MIUI 9.2 Android mặc định c&agrave;i sẵn theo c&aacute;c m&aacute;y Xiaomi.<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &bull; Rom 2: Android 7.1.2 thuần Google (mượt hơn, chơi game tốt hơn, pin tốt hơn, nhưng sẽ bị lỗi kh&ocirc;ng d&ugrave;ng dc camera)<br />\r\n-----<br />\r\nXiaomi Mipad 1<br />\r\nL&agrave; chiếc m&aacute;y t&iacute;nh bảng đầu ti&ecirc;n của Xiaomi, Mipad sở hữu m&agrave;n h&igrave;nh 7.9 inches độ ph&acirc;n giải 2K, ram 2GB c&ugrave;ng vi xử l&yacute; Nvidia Tegra K1 phi&ecirc;n bản 4 l&otilde;i 32 bit cho hiệu năng rất tốt - Antutu 131K, điểm đồ họa đạt 64k. Nếu anh em đang cần 1 chiếc m&aacute;y t&iacute;nh bảng gi&aacute; tốt, hiệu năng ổn để đọc s&aacute;ch, chơi games th&igrave; Mipad l&agrave; lựa chọn rất tốt!<br />\r\n-----<br />\r\n#anhtutablets<br />\r\n#mipad1<br />\r\n#Xiaomi</p>', 'tablet_xiao_1.jpg', 2090000, 12, 12, 0, 9, 8, 6, NULL, 1, '2021-03-01 10:13:25', '2021-03-03 01:00:23', NULL),
