(18, 'Máy tính bảng Huawei MediaPad T3 10 (2017) | Bộ nhớ trong 16GB/ Ram 2GB | Pin khủng | Thiết kế trang nhã 4.8', '<p>Trả g&oacute;p 0%: https://shopee.vn/m/tra-gop-0-lai-suat<br />\r\n------------------------------------------------------------------<br />\r\nHuawei MediaPad T3 10 (2017) l&agrave; chiếc m&aacute;y t&iacute;nh bảng với m&agrave;n h&igrave;nh k&iacute;ch thước lớn c&ugrave;ng khe cắm sim tiện lợi gi&uacute;p người d&ugrave;ng c&oacute; thể nghe gọi như một chiếc smartphone.</p>\r\n\r\n<p>Thiết kế mỏng, đẹp<br />\r\nVề tổng thể, m&aacute;y nổi bật với phần khung viền kim loại sang trọng, kết hợp m&agrave;u sắc hiện đại cho cảm gi&aacute;c kh&aacute; thanh lịch, nhẹ nh&agrave;ng.</p>\r\n\r\n<p><br />\r\nNgo&agrave;i ra, với trọng lượng kh&aacute; nhẹ c&ugrave;ng với 4 g&oacute;c bo tr&ograve;n gi&uacute;p m&aacute;y c&oacute; trải nghiệm cầm nắm kh&aacute; thoải m&aacute;i.</p>\r\n\r\n<p>M&agrave;n h&igrave;nh hiển thị tốt<br />\r\nSở hữu m&agrave;n h&igrave;nh k&iacute;ch thước 10 inch kh&ocirc;ng qu&aacute; lớn, c&oacute; thể nh&eacute;t vừa một chiếc balo dạng nhỏ, Huawei MediaPad T3 10 (2017) Spen sử dụng tấm nền PLS LCD cho khả năng hiển thị tốt.</p>\r\n\r\n<p>Độ ph&acirc;n giải 1280 x 800 pixels cho chất lượng h&igrave;nh ảnh sắc n&eacute;t, sử dụng tốt khi đi ngo&agrave;i trời.</p>\r\n\r\n<p>Cấu h&igrave;nh ổn định<br />\r\nCung cấp sức mạnh cho m&aacute;y l&agrave; con chip Qualcomm MSM8917 và RAM 2 GB ho&agrave;n to&agrave;n đ&aacute;p ứng tốt c&aacute;c nhu cầu thường ng&agrave;y của bạn, từ đọc b&aacute;o online, lướt facebook hay xem phim đến chơi game.</p>\r\n\r\n<p>Khả năng chơi game nặng của m&aacute;y sẽ c&oacute; phần hạn chế, d&ugrave; vậy so với tầm gi&aacute; th&igrave; trải nghiệm tr&ecirc;n MediaPad T3 10 (2017) vẫn kh&aacute; ấn tượng.</p>\r\n\r\n<p>MediaPad T3 10 (2017) hoạt đ&ocirc;̣ng tr&ecirc;n n&ecirc;̀n tảng Android 7 mới mẻ n&ecirc;n sở hữu cho m&igrave;nh khả năng chia đ&ocirc;i màn hình đ&ecirc;̉ sử dụng hai ứng dụng cùng m&ocirc;̣t lúc. K&ecirc;́t hợp với màn hình k&iacute;ch thước lớn thì đ&acirc;y quả là m&ocirc;̣t lợi th&ecirc;́ r&acirc;́t lớn cho những người thích làm vi&ecirc;̣c đa nhi&ecirc;̣m.</p>\r\n\r\n<p>Camera đủ d&ugrave;ng<br />\r\nViệc chụp ảnh bằng một chiếc m&aacute;y t&iacute;nh bảng chưa bao giờ được người d&ugrave;ng đ&aacute;nh gi&aacute; cao v&agrave; Huawei cũng chỉ trang bị cho MediaPad T3 10 (2017) bộ đ&ocirc;i camera đủ đ&aacute;p ứng c&aacute;c nhu cầu cơ bản.</p>\r\n\r\n<p>M&aacute;y sở hữu camera sau độ ph&acirc;n giải 5 MP, ảnh chụp ở điều kiện ban ng&agrave;y ở mức chấp nhận được mặc d&ugrave; m&agrave;u sắc c&oacute; phần hơi nhợt nhạt so với thực tế.</p>\r\n\r\n<p>Còn camera trước cũng có đ&ocirc;̣ ph&acirc;n giải chỉ dừng lại ở mức 2 MP nhưng cũng đủ đ&ecirc;̉ chúng ta thực hi&ecirc;̣n các cu&ocirc;̣c gọi video.</p>\r\n\r\n<p>Hỗ trợ kết nối 3G/4G<br />\r\nM&aacute;y cũng hỗ trợ khe cắm thẻ nhớ mở rộng tối đa l&ecirc;n tới 16 GB c&ugrave;ng 1 khe cắm Nano Sim v&agrave; kết nối 4G tốc độ cao gi&uacute;p bạn truy cập internet với tốc độ nhanh ch&oacute;ng<br />\r\nBộ sản phẩm bao gồm: M&aacute;y, sạc, cốc sạc, ốp lưng Da</p>\r\n\r\n<p>*Đối với điện thoại th&ocirc;ng minh, m&aacute;y t&iacute;nh bảng, laptop, đồng hồ, v&ograve;ng đeo th&ocirc;ng minh, tai nghe freebuds, SoundX:&nbsp;<br />\r\nBảo h&agrave;nh 12 th&aacute;ng&nbsp;<br />\r\nĐổi m&aacute;y trong 30 ng&agrave;y đầu&nbsp;<br />\r\nHỗ trợ vận chuyển miễn ph&iacute; hai chiều đối với sản phẩm đủ điều kiện bảo h&agrave;nh&nbsp;<br />\r\nĐịa điểm trung t&acirc;m bảo h&agrave;nh, vui l&ograve;ng truy cập trang web của Huawei hoặc ứng dụng Hỗ Trợ (Support) tr&ecirc;n điện thoại&nbsp;<br />\r\nMọi chi tiết vui l&ograve;ng li&ecirc;n hệ hotline 1800 1085&nbsp;<br />\r\n&nbsp;</p>', 'tablet_huawei_4.jpg', 3990000, 10, 10, 0, 0, 8, 5, NULL, 1, '2021-03-01 19:59:14', '2021-03-01 19:59:14', NULL),
