UAWEI MatePad Pro sử dụng dịch vụ Huawei Mobile Service (HMS), dịch vụ Google sẽ kh&ocirc;ng c&agrave;i đặt sẵn tr&ecirc;n thiết bị.<br />\r\nĐể biết th&ecirc;m th&ocirc;ng tin chi tiết, vui l&ograve;ng li&ecirc;n hệ nh&acirc;n vi&ecirc;n để được hỗ trợ<br />\r\nXin cảm ơn qu&yacute; kh&aacute;ch</p>\r\n\r\n<p>*Đối với điện thoại th&ocirc;ng minh, m&aacute;y t&iacute;nh bảng, laptop, đồng hồ, v&ograve;ng đeo th&ocirc;ng minh, tai nghe freebuds, SoundX:&nbsp;<br />\r\nBảo h&agrave;nh 12 th&aacute;ng&nbsp;<br />\r\nĐổi m&aacute;y trong 30 ng&agrave;y đầu&nbsp;<br />\r\nHỗ trợ vận chuyển miễn ph&iacute; hai chiều đối với sản phẩm đủ điều kiện bảo h&agrave;nh&nbsp;<br />\r\nĐịa điểm trung t&acirc;m bảo h&agrave;nh, vui l&ograve;ng truy cập trang web của Huawei hoặc ứng dụng Hỗ Trợ (Support) tr&ecirc;n điện thoại&nbsp;<br />\r\nMọi chi tiết vui l&ograve;ng li&ecirc;n hệ hotline 1800 1085&nbsp;</p>', 'tablet_huawei_8.jpg', 16990000, 10, 10, 0, 0, 8, 5, NULL, 1, '2021-03-01 20:02:16', '2021-03-01 20:02:16', NULL),
(21, 'Sạc dự phòng Hoco J42 10000mAh/20000mAh/30000mAh 🌟Hỗ Trợ Nhiều Cổng Sạc in/out - Bảo Hành Chính Hãnh', '<p>Sạc Dự Ph&ograve;ng 10000mAh/20000mAh 2 cổng sạc in/out -Hoco J42 High power - Bảo H&agrave;nh Ch&iacute;nh H&atilde;ng 12 Th&aacute;ng</p>\r\n\r\n<p>TH&Ocirc;NG TIN SẢN PHẨM:<br />\r\n1. Dung lượng: 10000mAh, 37Wh. Dung lượng định mức: 5900mAh, (5V TYP 2A).&nbsp;<br />\r\n2. Đầu v&agrave;o: Micro-USB / Type-C: 5V / 2A Max.&nbsp;<br />\r\n3. Đầu ra: USB 1/2: DC5V / 2A Max.&nbsp;<br />\r\nTổng sản lượng: DC5V / 2A Max.&nbsp;<br />\r\n4. M&agrave;n h&igrave;nh kỹ thuật số LED của mức năng lượng (k&iacute;ch hoạt n&uacute;t).&nbsp;<br />\r\n5. Pin lithium A + polymer tiết kiệm năng lượng.&nbsp;<br />\r\n6. Chất liệu: Vật liệu chống ch&aacute;y ABS + PC.&nbsp;<br />\r\n7. Bảo vệ nhiều mạch.&nbsp;<br />\r\n8. K&iacute;ch thước: 140 * 68 * 19mm. Trọng lượng: 239g.<br />\r\n-------------------------------------------------------------<br />\r\n&diams;Phụ Kiện Cao Cấp JOYNESS chuy&ecirc;n cung cấp c&aacute;c sản phẩm phụ kiện điện thoại, đồ chơi c&ocirc;ng nghệ - tai nghe, củ c&aacute;p sạc, pin sạc dự ph&ograve;ng, loa, ốp điện thoại v...v...&nbsp;<br />\r\n&diams;C&oacute; thể những sản phẩm của JOYNESS kh&ocirc;ng phải l&agrave; những sản phẩm cao cấp nhất tr&ecirc;n thị trường, nhưng bảo đảm nguồn cung cấp sản phẩm từ c&aacute;c nh&agrave; cung cấp trong v&agrave; ngo&agrave;i nước được nhiều kh&aacute;ch h&agrave;ng ưa d&ugrave;ng với chất lượng ho&agrave;n to&agrave;n đạt ti&ecirc;u chuẩn<br />\r\n&diams;JOYNESS cam kết t&iacute;nh trung thực tuyệt đối, cạnh tranh về gi&aacute; th&agrave;nh nhờ c&aacute;c ch&iacute;nh s&aacute;ch giảm thiểu chi ph&iacute; đầu v&agrave;o (mặt bằng, nh&acirc;n c&ocirc;ng, gi&aacute; vốn,...)<br />\r\n&diams;Do số lượng đơn h&agrave;ng đ&ocirc;i l&uacute;c qu&aacute; tải n&ecirc;n c&oacute; thể xảy ra sơ suất trong qu&aacute; tr&igrave;nh đ&oacute;ng g&oacute;i, mong qu&yacute; kh&aacute;ch th&ocirc;ng cảm v&agrave; nhắn tin trực tiếp cho shop trước khi đ&aacute;nh gi&aacute; để shop c&oacute; thể hỗ trợ nhanh nhất nh&eacute;<br />\r\n&diams;Hotline: 0927.26.1991<br />\r\n---------------------------------------------------------<br />\r\n#sac_du_phong #sac_du_phong_xiaomi #sac_du_phong_20000mah #sac_du_phong_anker #sac_du_phong<br />\r\n#sac_du_phong_mini #sac_du_phong_khong_day #sac_du_phong_samsung #sac_du_phong_hoco #sac_du_phong_10000_20000mah #hoco #j42 #j42a<br />\r\n&nbsp;</p>', 'charger_1.jpg', 332000, 11, 11, 0, 0, 8, 10, NULL, 1, '2021-03-01 20:04:05', '2021-03-01 20:04:05', NULL),
(22, 'Sạc dự phòng Xiaomi Gen 3 chính hãng 10.000 mAh (2 cổng usb,sạc nhanh 18w)', '<p>Tương tự những sản phẩm trước,&amp;nbsp;sạc dự ph&ograve;ng Xiaomi&amp;nbsp;10000mAh Gen 3 Type C 2019 được trang bị l&otilde;i pin&amp;nbsp;Li-Po&amp;nbsp;(Lithium Polymer) đến từ nh&agrave; sản xuất h&agrave;ng đầu như LG/Panasonic. V&igrave; thế bạn c&oacute; thể an t&acirc;m về chất lượng cũng như tuổi thọ của sản phẩm.<br />\r\nSong song với đ&oacute;, sạc dự ph&ograve;ng n&agrave;y cũng c&oacute; dung lượng l&ecirc;n đến 10000mAh. Đ&acirc;y l&agrave; mức dung lượng pin rất ổn cho một thiết bị pin dự ph&ograve;ng, cho ph&eacute;p bạn c&oacute; thể d&ugrave;ng để sạc cho iPhone 8 3,5 lần, sạc cho iPhone X 2.5 lần, v&agrave; Galaxy Note 9 2 lần hơn. Với một thiết bị sạc như thế th&igrave; bạn chỉ cần sạc đầy qua đ&ecirc;m l&agrave; đ&atilde; c&oacute; thể sử dụng thoải m&aacute;i trong một ng&agrave;y l&agrave;m việc sau đ&oacute;.<br />\r\nMột trong những điểm khiến&amp;nbsp;Xiaomi 10000mAh Gen 3 Type C 2019&amp;nbsp;nổi bật hơn những thiết bị sạc kh&aacute;c, ch&iacute;nh l&agrave; ở khả năng sạc nhanh tối đa 18W th&ocirc;ng qua cổng USB. Với 2 cổng sạc v&agrave;o USB Type C v&agrave; Micro USB với cường độ&amp;nbsp;5V - 2.6A, 9V - 2.1A, 12V - 1.5A , hỗ trợ sạc nhanh tối đa 18W. Nhờ đ&oacute; c&oacute; thể sạc nhanh cho pin dự ph&ograve;ng.&amp;nbsp;&amp;nbsp;<br />\r\nXiaomi 10000mAh Gen 3 2019 c&oacute; một thiết kế rất nhỏ gọn liền lạc, c&aacute;c đường n&eacute;t, chi tiết đều được Xiaomi thiết kế rất kh&eacute;o l&eacute;o nhằm kh&ocirc;ng đưa đến cho người d&ugrave;ng qu&aacute; nhiều chi tiết thừa.&amp;nbsp;Thiết bị được kết cấu với một lớp vỏ kim loại c&oacute; độ bền cấu tr&uacute;c rất cao, cảm gi&aacute;c cầm trong tay rất mịn m&agrave;ng, m&aacute;t tay. B&ecirc;n cạnh đ&oacute;, trọng lượng của sạc cũng kh&ocirc;ng qua nặng. Bạn c&oacute; thể cầm thiết bị tr&ecirc;n tay m&agrave; kh&ocirc;ng cảm gi&aacute;c mỏi, cũng như để trong t&uacute;i quần m&agrave; kh&ocirc;ng ngại cảm gi&aacute;c chật chội, nặng nề.<br />\r\nĐầu v&agrave;o : cổng micro usb v&agrave; type c (hỗ trợ sạc nhanh 18w)<br />\r\nĐầu ra : 2 cổng USB (hỗ trợ sạc nhanh 18w)<br />\r\nLưu &yacute; khi sử dụng: Khi sạc cho SDP n&ecirc;n sử dụng loại củ sạc c&oacute; d&ograve;ng ra 5V-2A hoặc 9V-2A để sạc nhanh đầy cho SDP, kh&ocirc;ng sử dụng loại sạc 5V-1A (5W) sẽ l&acirc;u v&agrave;o pin hoặc c&oacute; thể ko v&agrave;o pin ạ.<br />\r\nBảo h&agrave;nh 1 năm.</p>\r\n\r\n<p><br />\r\n#iphone #samsung #sacduphong #sacnhanh #shopee #shopeevn #shopeetramty #pinsacduphong #pin #xiaomi #typec #lightning #sales #giare #capsac #capsacnhanh #qc #hoco #huuphuoc009 #bosac #cocsac</p>', 'battery_xiao_1.jpg', 283800, 11, 11, 0, 0, 8, 6, NULL, 1, '2021-03-01 20:05:26', '2021-03-01 20:05:26', NULL),
(23, 'Pin Sạc Dự Phòng Samsung Fast Charge 10000 mAh EB-P1100C Type-C - Hàng Chính Hãng', '<p>Pin Sạc Dự Ph&ograve;ng Samsung Fast Charge 10000 mAh EB-P1100C Type-C - H&agrave;ng Ch&iacute;nh H&atilde;ng<br />\r\nBộ sản phẩm bao gồm: Pin sạc dự ph&ograve;ng Samsung 10000 mAh, c&aacute;p Type-C, s&aacute;ch hướng dẫn.</p>\r\n\r\n<p>Dung lượng 10.000mAh<br />\r\nSạc nhanh AFC v&agrave; Quick Charge 2.0<br />\r\nNhiều lựa chọn m&agrave;u sắc ấn tượng</p>\r\n\r\n<p>Lu&ocirc;n Đầy Pin<br />\r\nTận hưởng niềm vui suốt ng&agrave;y d&agrave;i tr&ecirc;n chiếc điện thoại lu&ocirc;n đầy pin với sạc dự ph&ograve;ng Battery Pack mới từ Samsung hỗ trợ c&ocirc;ng nghệ sạc nhanh cao cấp AFC v&agrave; Quick Charge 2.0. Thoải m&aacute;i cắm sạc m&agrave; kh&ocirc;ng lo hư hỏng thiết bị với t&iacute;nh năng Bảo Vệ Qu&aacute; Tải (OCP) vượt trội từ Battery Pack, cho bạn tập trung thực hiện mọi c&ocirc;ng việc quan trọng.</p>\r\n\r\n<p>Sạc Nhanh Mọi L&uacute;c<br />\r\nĐược trang bị t&iacute;nh năng Bảo Vệ Tr&aacute;nh Qu&aacute; &Aacute;p (OVP), pin dự ph&ograve;ng Battery Pack gi&uacute;p gi&uacute;p thiết bị được sạc nhanh ch&oacute;ng v&agrave; an to&agrave;n chỉ với 220 ph&uacute;t ở chế độ sạc nhanh. Thiết bị lu&ocirc;n đầy pin cho mọi trải nghiệm ho&agrave;n hảo v&agrave; liền mạch.</p>\r\n\r\n<p>Gấp Đ&ocirc;i Hiệu Năng<br />\r\nCổng sạc k&eacute;p vượt trội từ pin dự ph&ograve;ng Battery Pack Samsung cho ph&eacute;p sạc hai thiết bị c&ugrave;ng l&uacute;c. Đơn giản v&agrave; tiện lợi hơn gấp hai lần.</p>\r\n\r\n<p>Lu&ocirc;n Lu&ocirc;n Kết Nối<br />\r\nPin dự ph&ograve;ng Battery Pack từ Samsung hỗ trợ d&ograve;ng điện sạc cường độ thấp, gi&uacute;p giữ thiết bị lu&ocirc;n được sạc an to&agrave;n. Tiện lợi sử dụng pin sạc cho nhiều thiết bị đến từ c&aacute;c thương hiệu kh&aacute;c nhau, sẵn s&agrave;ng ngay khi bạn cần.</p>\r\n\r\n<p>Dung Lượng Vượt Trội<br />\r\nSạc bất tận với dung lượng l&ecirc;n đến 10,000mAh từ pin dự ph&ograve;ng Battery Pack. Thoả th&iacute;ch tận hưởng chuyến du lịch hay tự do di chuyển đến bất k&igrave; nơi n&agrave;o m&agrave; kh&ocirc;ng cần phải lo đến dung lượng pin.</p>\r\n\r\n<p>Phong C&aacute;ch v&agrave; Thời Thượng<br />\r\nMang đến tổng thể thiết kế mỏng, gọn nhẹ v&agrave; dễ cầm nắm, sử dụng. Hai lựa chọn m&agrave;u sắc tinh tế v&agrave; sang trọng cho bạn dễ d&agrave;ng thay đổi, thể hiện dấu ấn ri&ecirc;ng.</p>\r\n\r\n<p>- Chất liệu: sử dụng c&ocirc;ng nghệ vỏ hợp kim nh&ocirc;m nhẹ v&agrave; sang trọng, dạng thanh mỏng, tản nhiệt tốt, b&ecirc;n ngo&agrave;i được phủ lớp chống oxy h&oacute;a chịu m&agrave;i m&ograve;n v&agrave; chống va đập cao<br />\r\n- Sạc nhanh AFC v&agrave; Quick Charge 2.0<br />\r\n- Thiết kế nhỏ gọn, thời trang<br />\r\n- Tương th&iacute;ch hầu hết c&aacute;c d&ograve;ng Smartphone, Tablet, c&aacute;c thiết bị m&aacute;y ảnh, m&aacute;y chơi game&hellip;<br />\r\n- Chịu nhiệt cao, chống bụi bẩn<br />\r\n- Đ&egrave;n Led b&aacute;o t&igrave;nh trạng pin<br />\r\n- Ổn định điện &aacute;p, chống chập mạch<br />\r\n- L&otilde;i pin chất lượng cao<br />\r\n- Tự động điều chỉnh d&ograve;ng điện ph&ugrave; hợp từng loại điện thoại<br />\r\n- Nguồn điện đầu v&agrave;o: 5V-2A (sạc thuờng)&nbsp;<br />\r\n- Nguồn điện đầu ra cao nhất: 9V/1.67A/15W<br />\r\n- Dung lượng Pin: 10,000 mAh<br />\r\n- Phụ kiện trong hộp: Pin, C&aacute;p sạc Type C, Hướng dẫn sử dụng (KH&Ocirc;NG BAO GỒM CỐC SẠC)<br />\r\n- K&iacute;ch thước: 141.8 x 71 x 14 mm.<br />\r\n- Sạc nhanh: Fast Charge 15W<br />\r\n- &ETH;ộ mỏng: 14mm&nbsp;<br />\r\n- Trọng lượng: 220g<br />\r\n* Nhấn v&agrave;o n&uacute;t kiểm tra pin tr&ecirc;n đầu Pin Sạc Dự Ph&ograve;ng Samsung để chuyển sang chế độ sạc nhanh AFC &amp;amp; QC 2.0<br />\r\nChế độ SẠC NHANH hoạt động khi sạc 01 thiết bị, sạc k&eacute;p 02 thiết bị sẽ tự chuyển sang sạc thường<br />\r\nPin Sạc Dự Ph&ograve;ng Samsung Fast Charge 10000 mAh EB-P1100C Type-C - H&agrave;ng Ch&iacute;nh H&atilde;ng</p>\r\n\r\n<p>🆘Sản phẩm l&agrave; mặt h&agrave;ng qu&agrave; tặng h&atilde;ng n&ecirc;n Shop kh&ocirc;ng bảo h&agrave;nh, chỉ bao test 7 ng&agrave;y.</p>\r\n\r\n<p>Lưu &yacute; khi đặt h&agrave;ng<br />\r\n✔️shop nhận đổi trả trong trường hợp h&agrave;ng lỗi từ nh&agrave; sản xuất, h&agrave;ng sai size, m&agrave;u do shop gửi (c&oacute; video clip khi mở/nhận h&agrave;ng)<br />\r\n✔️đối với c&aacute;c sản phẩm đồ điện ghi cụ thể ở phần m&ocirc; tả sản phẩm (kh&aacute;ch h&agrave;ng chịu ph&iacute; vận chuyển khi bảo h&agrave;nh)</p>\r\n\r\n<p>:x:kh&ocirc;ng nhận đổi trả khi sản phẩm bị hư hại do t&aacute;c động ngoại lực từ người mua như m&oacute;p, bể, trầy xước, nổ điện, r&aacute;ch tem bảo h&agrave;nh<br />\r\n:x:v&igrave; lượng h&agrave;ng ho&aacute; nhiều shop kh&ocirc;ng nhận đổi trả trong trường hợp kh&aacute;ch kh&ocirc;ng th&iacute;ch, kh&ocirc;ng ưng m&agrave;u, chất liệu; qu&yacute; kh&aacute;ch vui l&ograve;ng đọc kĩ m&ocirc; tả v&agrave; xem h&igrave;nh ảnh cụ thể; nếu cần h&atilde;y chat trực tiếp cho shop để được tư vấn.<br />\r\n✔️ Kh&aacute;ch h&agrave;ng chịu ph&iacute; vận chuyển khi đổi trả.<br />\r\nPin Sạc Dự Ph&ograve;ng Samsung Fast Charge 10000 mAh EB-P1100C Type-C - H&agrave;ng Ch&iacute;nh H&atilde;ng<br />\r\n#điện_thoại #dienthoai #di_động #didong #điện_thoại_di_động #dien_thoai_di_dong #điện_thoại_ch&iacute;nh_h&atilde;ng #h&agrave;ng_ch&iacute;nh_h&atilde;ng #điện_thoại_gi&aacute;_rẻ #dien_thoai_gia_re #khuyen_mai #freeship #pin_sạc_dự_ph&ograve;ng &nbsp;#pin_dự_ph&ograve;ng #sạc_dự_ph&ograve;ng #sạc_dự_ph&ograve;ng_samsung #samsung #samsung_10000mah</p>', 'battery_samsung_1.jpg', 279000, 23, 23, 0, 0, 8, 3, NULL, 1, '2021-03-01 20:07:50', '2021-03-01 20:07:50', NULL),
(24, 'Sạc Anker Quick Charge 3.0, Anker 18W USB Wall Charger (Quick Charge 2.0 Compatible) PowerPort+ 1', '<p>Shop cam kết nếu ph&aacute;t hiện h&agrave;ng giả, h&agrave;ng nh&aacute;i đền gấp 10 lần cho kh&aacute;ch y&ecirc;n t&acirc;m.<br />\r\nSạc Anker Quick Charge 3.0, Anker 18W USB Wall Charger (Quick Charge 2.0 Compatible) PowerPort+ 1<br />\r\nTh&ocirc;ng số chi tiết:<br />\r\nThương hiệu: Anker<br />\r\nM&atilde; sản phẩm: A2013<br />\r\nM&agrave;u sắc: Đen<br />\r\nTrọng lượng: 101g<br />\r\nK&iacute;ch thước: 51 x 58 x 29mm<br />\r\nTần số: 50 &ndash; 60Hz<br />\r\nĐầu v&agrave;o: AC 100 &ndash; 240V ~ 1.2A<br />\r\nĐầu ra (USB-C): 5V &ndash; 3A/ 9V &ndash; 2A/ 20V &ndash; 1.5A<br />\r\nCốc sạc USB type C Anker PowerPort A2014 sở hữu m&agrave;u đen nh&aacute;m sang trọng, k&iacute;ch thước 51 x 58 x 29mm v&agrave; chỉ nặng 101g. Chất liệu nhựa cao cấp, cứng c&aacute;p, bảo vệ thiết bị tr&aacute;nh khỏi hỏng trước những va đập mạnh từ b&ecirc;n ngo&agrave;i.<br />\r\nCốc sạc A2013 30W tiếp nhận điện &aacute;p đầu v&agrave;o dao động từ 100V đến 240V, tần số 50 &ndash; 60Hz v&agrave; đặc biệt c&ocirc;ng suất l&ecirc;n đến 30W. B&ecirc;n cạnh đ&oacute;, nhờ sự hỗ trợ của chuẩn sạc nhanh PD (Power Delivery), cho khả năng truyền tải mượt m&agrave; v&agrave; nhanh hơn gấp nhiều lần so với c&aacute;c thiết bị th&ocirc;ng thường kh&aacute;c.<br />\r\nh&agrave;ng mới 100% .</p>', 'battery_aukey_1.jpg', 190000, 21, 21, 0, 0, 8, 12, NULL, 1, '2021-03-01 20:10:00', '2021-03-01 20:10:00', NULL);
