(25, '[2020] Pin sạc dự phòng năng lượng mặt trời 25000mAh', '<p>Pin sạc dự ph&ograve;ng năng lượng mặt trời 25000 mAh ki&ecirc;m đ&egrave;n pin si&ecirc;u s&aacute;ng<br />\r\nVới sản phẩm Pin sạc dự ph&ograve;ng năng lượng mặt trời 25000 mAh bạn sẽ kh&ocirc;ng c&ograve;n nỗi sợ chiếc điện thoại của m&igrave;nh lu&ocirc;n trong t&igrave;nh trạng pin yếu, điều m&agrave; l&agrave;m cho bạn thấy kh&oacute; chịu. Được thiết kế với khung hợp kim v&agrave; nhựa ABS gi&uacute;p sản phẩm chịu v&agrave; đập v&agrave; độ bền cực cao. Với vẻ ngo&agrave;i thu h&uacute;t v&agrave; hiệu năng sử dụng mạnh mẽ, chiếc pin sạc dự ph&ograve;ng Solar Power bank 20.000mAh sẽ l&agrave; người cộng sự tốt cho &ldquo;dế y&ecirc;u&rdquo; cũng như c&aacute;c thiết bị di động kh&aacute;c của bạn.</p>\r\n\r\n<p>gh<br />\r\nTh&ocirc;ng tin sản phẩm: Pin sạc dự ph&ograve;ng năng lượng mặt trời Solar Charger:<br />\r\n1. C&ocirc;ng suất thiết kế 25000mAh, (chia 2 cổng), c&oacute; thể nạp năng lượng dưới &aacute;nh s&aacute;ng mặt trời.</p>\r\n\r\n<p>2. Với 2 cổng sạc USB, tương th&iacute;ch với mọi loại Smartphone.</p>\r\n\r\n<p>3. Thiết kế nhỏ v&agrave; t&iacute;nh di động cao dễ sử dụng.</p>\r\n\r\n<p>4. Đ&egrave;n b&aacute;o chỉ số trong qu&aacute; tr&igrave;nh sạc xả.</p>\r\n\r\n<p>5. Thuận tiện dễ sử dụng.<br />\r\ng<br />\r\n6. K&egrave;m m&oacute;c kh&oacute;a, v&igrave; vậy bạn c&oacute; thể đ&iacute;nh k&egrave;m n&oacute; v&agrave;o ba l&ocirc; của bạn.</p>\r\n\r\n<p>7. Chống nước, chống va đập, chống bụi bẩn.</p>\r\n\r\n<p>8. T&iacute;ch hợpnỗi sợ chiếc điện thoại của m&igrave;nh lu&ocirc;n trong t&igrave;nh trạng pin yếu, điều m&agrave; l&agrave;m cho bạn thấy kh&oacute; chịu. Được thiết kế với khung hợp kim v&agrave; nhựa ABS gi&uacute;p sản phẩm chịu v&agrave; đập v&agrave; độ bền cực cao. Với vẻ ngo&agrave;i thu h&uacute;t v&agrave; hiệu năng sử dụng mạnh mẽ,&nbsp;<br />\r\n9. Thiết kế Build-in Pin Lithium Polymer chống nổ, trọng lượng nhẹ, nhỏ gọn v&agrave; đ&aacute;ng tin cậy.</p>\r\n\r\n<p>10. Tuổi thọ cao tới hơnj 1.000 lần sạc.<br />\r\nĐặc biệt bạn c&oacute; thể dễ d&agrave;ng mang theo khi di chuyển với trọng lượng nhỏ nhẹ khoảng ~ 300g. Hơn nữa m&agrave;u sắc được thiết kế v&ocirc; c&ugrave;ng trẻ trung th&acirc;n thiện.<br />\r\nPin sạc dự ph&ograve;ng năng lượng mặt trời l&agrave; loại sạc cao cấp sử dụng sạc đầy hầu hết c&aacute;c loại điện thoại v&agrave; m&aacute;y t&iacute;nh bảng.<br />\r\n- Tự động ngắt điện khi pin đầy, bảo vệ pin<br />\r\n- D&ograve;ng điện ổn định cho Pin v&agrave; điện thoại<br />\r\n- C&oacute; BA c&aacute;ch sạc pin rất tiện lợi v&agrave; dễ sử dụng.<br />\r\n- Kh&ocirc;ng sợ hết pin khi đi c&ocirc;ng t&aacute;c, chơi game, lướt web, du lịch&hellip;<br />\r\nPin sạc dự ph&ograve;ng năng lượng mặt trời 25000 mAh c&ocirc;ng nghệ L&otilde;i pin polymer cho dung lượng l&ecirc;n đến 25.000mAh th&ocirc;ng qua c&aacute;c tấm năng lượng mặt trời 4W - 200mA. Với hiệu suất sạc khoảng 80%, sạc li&ecirc;n tục kh&ocirc;ng sợ hết điện.<br />\r\nPin sạc dự ph&ograve;ng năng lượng mặt trời 25000 mAh c&oacute; thể nạp năng lượng dễ d&agrave;ng bằng c&aacute;ch phơi dưới &aacute;nh nắng mặt trời. B&ecirc;n cạnh đ&oacute; pin sạc dự ph&ograve;ng Solar 25.000mah cũng c&oacute; thể sạc bằng phương ph&aacute;p th&ocirc;ng thường đ&oacute; l&agrave; sạc bằng d&ograve;ng điện 220V hoặc kết nối với m&aacute;y t&iacute;nh th&ocirc;ng qua cổng USB.</p>\r\n\r\n<p>Pin sạc dự ph&ograve;ng năng lượng mặt trời 25000 mAh với 4 c&aacute;ch sạc tr&ecirc;n, pin sẽ c&oacute; thời gian nạp đầy kh&aacute;c nhau: 3 tiếng cho sạc trực tiếp qua ổ cắm, 6 tiếng khi cắm sạc th&ocirc;ng qua cổng USB li&ecirc;n kết với m&aacute;y t&iacute;nh, sạc bằng năng lượng mặt trời v&agrave; đ&egrave;n huỳnh quang sẽ c&oacute; thời gian đầy phụ thuộc v&agrave;o cường độ chiếu s&aacute;ng m&agrave; &aacute;nh s&aacute;ng mang lại.</p>\r\n\r\n<p>Pin sạc dự ph&ograve;ng năng lượng mặt trời 25000 mAh c&oacute; khả năng truyền t&agrave;i d&ograve;ng điện ổn định.</p>\r\n\r\n<p>#Pinsacduphong #sacduphong #sacmat</p>', 'battery_sun_1.jpg', 400000, 21, 21, 0, 0, 8, 11, NULL, 1, '2021-03-01 20:12:59', '2021-03-01 20:12:59', NULL),
(26, 'Loa Bluetooth Kiêm Đồng Hồ G10 Mặt Gương Hiển Thị Đèn Led - Đài FM - Đồng Hồ Báo Thức - Phụ Kiện Tomato 4.8', '<p>Loa Bluetooth Ki&ecirc;m Đồng Hồ G10 Mặt Gương Hiển Thị Đ&egrave;n Led - Đ&agrave;i FM - Đồng Hồ B&aacute;o Thức - Bảo h&agrave;nh 03 th&aacute;ng 1 đổi 1 - Phụ Kiện Tomato</p>\r\n\r\n<p>Giới Thiệu :<br />\r\n- Chất liệu nhựa ABS bền đẹp với m&agrave;u sắc thời trang: hồng , đen , trắng<br />\r\n- Mặt trước của loa gương s&aacute;ng b&oacute;ng, sắc n&eacute;t, gi&uacute;p người d&ugrave;ng dễ d&agrave;ng quan s&aacute;t<br />\r\n- M&agrave;ng loa k&eacute;p cộng hưởng với c&ocirc;ng suất 3W cho &acirc;m thanh sống động, ch&acirc;n thực<br />\r\n- Dung lượng pin 1200mAh nghe nhạc li&ecirc;n tục kết hợp c&ugrave;ng hiển thị đồng hồ l&ecirc;n đến 4 Giờ<br />\r\n- Sản phẩm được trang bị những tiện &iacute;ch như đặt b&aacute;o thức v&agrave; gi&aacute; đỡ điện thoại<br />\r\n- C&aacute;c n&uacute;t điều khiển bố tr&iacute; ở mặt tr&ecirc;n của loa với độ nảy cao, gi&uacute;p dễ thao t&aacute;c<br />\r\n- Kết nối bluetooth 5.0 nhanh ch&oacute;ng v&agrave; ổn định trong phạm vi 10m</p>\r\n\r\n<p><br />\r\nTh&ocirc;ng Số Kỹ Thuật :&nbsp;<br />\r\n- Chất liệu : Nhựa - Kim Loại<br />\r\n- Phi&ecirc;n bản Bluetooth : V5.0<br />\r\n- Khoảng c&aacute;ch truyền: 10m<br />\r\n- C&ocirc;ng suất: 3W * 2 loa<br />\r\n- Nguồn: 3.7V<br />\r\n- Dung lượng pin: 1400 mAh<br />\r\n- Kết nối: qua c&aacute;p AUX để kết nối với m&aacute;y t&iacute;nh hoặc điện thoại, Thẻ nhớ micro SD (Tối đa 32Gb)<br />\r\n- Tần số FM: 87.5-108MHz<br />\r\n- M&agrave;u sắc: Nhiều mầu<br />\r\n- K&iacute;ch thước: 140x70x46mm<br />\r\n- Thời gian sử dụng : Từ 3-5H<br />\r\n- Thời gian chờ : 98h li&ecirc;n tiếp&nbsp;</p>\r\n\r\n<p>* C&Aacute;CH SỬ DỤNG LOA :&nbsp;<br />\r\n- Nhấn giữ n&uacute;t ON để mở<br />\r\n- Loa c&oacute; 3 chế độ: C&oacute; sử dụng bluetooth / FM Radio / B&igrave;nh thường (kh&ocirc;ng kết nối được bluetooth). Mặc định khi bật l&ecirc;n sẽ l&agrave; chế độ c&oacute; sử dụng bluetooth (C&oacute; hiện chữ BT tr&ecirc;n m&agrave;n h&igrave;nh)<br />\r\n- Nhấn n&uacute;t M để đổi sang chế độ kh&aacute;c<br />\r\n- C&aacute;ch kết nối bluetooth: ở thiết bị cần ph&aacute;t nhạc(điện thoại, laptop...) bật bluetooth v&agrave; kết nối với loa c&oacute; t&ecirc;n &quot;G10&quot; l&agrave; xong bạn mở thử một b&agrave;i nhạc v&agrave; thưởng thức nh&eacute;<br />\r\n- C&aacute;ch nghe FM: Loa sau khi bật nhấn n&uacute;t M một lần để chuyển sang chế độ FM, cắm c&aacute;p sạc v&agrave;o(kh&ocirc;ng cần sạc, c&aacute;p sạc c&oacute; t&aacute;c dụng l&agrave; anten thu s&oacute;ng FM) v&agrave; nhấn n&uacute;t ON, loa sẽ tự động d&ograve; k&ecirc;nh cho bạn, đợi d&ograve; xong l&agrave; bạn nghe được, c&oacute; thể nhấn n&uacute;t &amp;gt;&amp;gt; hoặc &amp;lt;&amp;lt; (1 lần) để đổi k&ecirc;nh. Hai n&uacute;t n&agrave;y c&ograve;n c&oacute; t&aacute;c dụng tăng giảm &acirc;m lượng (nhấn giữ l&acirc;u)<br />\r\n- Thay đổi độ s&aacute;ng: bạn nhấn v&agrave;o n&uacute;t h&igrave;nh &aacute;nh s&aacute;ng(h&igrave;nh mặt trời) để đổi nh&eacute; ( m&agrave;n h&igrave;nh hiển thị s&aacute;ng trong v&ograve;ng 5 ph&uacute;t sau đ&oacute; loa sẽ mờ lại bật chế độ tiết kiệm pin )<br />\r\n- Chỉnh giờ: Nhấn giữ n&uacute;t SET -&amp;gt; chỉnh giờ (bằng 2 n&uacute;t &amp;lt; v&agrave; &amp;gt;) -&amp;gt; nhấn 1 lần n&uacute;t SET -&amp;gt; chỉnh ph&uacute;t -&amp;gt; Nhấn giữ n&uacute;t SET -&amp;gt; xong<br />\r\n- Chỉnh b&aacute;o thức: Bạn được c&agrave;i đặt 2 b&aacute;o thức, nhấn n&uacute;t SET 1 lần để chọn B&aacute;o thức( B&aacute;o thức 1 hoặc 2 hoặc cả 2) -&amp;gt; nhấn giữ n&uacute;t SET -&amp;gt; chọn giờ -&amp;gt; Nhấn n&uacute;t SET 1 lần -&amp;gt; Chỉnh Ph&uacute;t -&amp;gt; Nhấn n&uacute;t SET 1 lần -&amp;gt; Chọn chu&ocirc;ng (đổi bằng 2 n&uacute;t &amp;lt; v&agrave; &amp;gt;) -&amp;gt; nhấn giữ n&uacute;t SET -&amp;gt; xong&nbsp;<br />\r\nCh&uacute;c c&aacute;c bạn sử dụng th&agrave;nh c&ocirc;ng !</p>\r\n\r\n<p>BẢO H&Agrave;NH 3 TH&Aa