rave;i ra c&ograve;n hỗ trợ nghe nhạc th&ocirc;ng qua thẻ nhớ, cổng AUX 3.5mm, USB cho nhiều sự lựa chọn<br />\r\n&hearts;C&ocirc;ng suất 5W*2 với &acirc;m thanh chuẩn stereo 360 độ chất lượng - trải nghiệm &acirc;m thanh sống động<br />\r\n&hearts;Hỗ trợ c&aacute;c ph&iacute;m chức năng: nguồn, tăng/giảm &acirc;m lượng, chuyển b&agrave;i, play/pause ngay tr&ecirc;n th&acirc;n loa<br />\r\n&hearts;Kết nối: Bluetooth V5.0<br />\r\n&hearts;Tương th&iacute;ch: c&aacute;c thiết bị hỗ trợ bluetooth, thẻ nhớ, AUX 3.5mm, USB<br />\r\n&hearts;Bộ sản phẩm gồm: 1 loa, 1 c&aacute;p sạc, 1 hộp,<br />\r\n&hearts;&hearts;&hearts;Chất liệu: nhựa ABS + kim loại<br />\r\n&hearts;Cổng sạc: Micro USB<br />\r\n&hearts;Nguồn điện sạc: DC5V<br />\r\n&hearts;M&agrave;ng loa rộng: 45mm * 2<br />\r\n&hearts;C&ocirc;ng suất: 5W*2<br />\r\n&hearts;Thời gian sạc: ~1.5 giờ<br />\r\n&hearts;Thời gian sử dụng: ~2.5 giờ (với &acirc;m lượng 80%)<br />\r\n-----------------------<br />\r\n#loa_bluetooth #loa_bluetooth_hoco #loa_bluetooth_mini #loa_bluetooth_jbl #loa_bluetooth_xiaomi #loa_bluetooth_sony #loa_bluetooth_dong_ho #loa_bluetooth_kimiso #loa_bluetooth_lg #loa_bluetooth_gia_re #loa_bluetooth_chinh_hang #loa_blutooth #loa_blutooth_mini #loa_blutooth_chinh_hang #loa_hoco_bs30 #loa_hoco_bs31 #loa_hoco_ds03</p>', 'audio_23.jpg', 249000, 21, 21, 0, 0, 9, 11, NULL, 1, '2021-03-01 20:23:21', '2021-03-01 20:23:21', NULL),
(29, 'Combo 2 cái bộ đàm Baofeng BF888S(bắt sóng xa 5km)', '<p>Th&ocirc;ng số kỹ thuật BF-888S<br />\r\n- Dải tần số UHF 400-470 Mhz<br />\r\n- C&ocirc;ng suất cao tần : &amp;lt; 3 Watt<br />\r\n- C&ocirc;ng suất &acirc;m thanh : 800mW<br />\r\n- Độ nhạy thu: ＜0.20 &micro; V (12dB SINAD)<br />\r\n- Kiểu điều chế : FM (F3E)<br />\r\n- Độ gi&atilde;n k&ecirc;nh: &amp;lt;5KHz(W), &amp;lt;2.5KHz(N)<br />\r\n- Hỗ trợ : 50 CTCSS and 210 DCS Codes<br />\r\n- Trở kh&aacute;ng anten: 50 &Omega;<br />\r\n- Dung lượng k&ecirc;nh: 16 k&ecirc;nh<br />\r\n- Loại pin chuẩn Li-ion ( cho ph&eacute;p sạc nhồi)<br />\r\n- Điện &aacute;p pin : 3.7 V<br />\r\n- Dung lượng: 1500 mAh<br />\r\n- Thời gian sạc pin: &amp;gt;3 giờ<br />\r\n- Thời gian sử dụng pin khoảng: 8 giờ ( 5-5-90)<br />\r\n- K&iacute;ch thước (W x H x D) 57 x 97 x 29 mm<br />\r\n- Trọng lượng cả m&aacute;y : 200 g</p>\r\n\r\n<p>Cấu h&igrave;nh m&aacute;y bao gồm:<br />\r\n- 01 th&acirc;n m&aacute;y<br />\r\n- 01 pin Li-ion 3,7V dung lượng 1500 mAH<br />\r\n- 01 đế sạc b&agrave;n ti&ecirc;u chuẩn<br />\r\n- 01 anten<br />\r\n- 01 c&agrave;i lưng, s&aacute;ch t&agrave;i liệu đi k&egrave;m</p>\r\n\r\n<p>Cự ly li&ecirc;n lạc:<br />\r\n- Khu vực nhiều nh&agrave; cao tầng, khu đ&ocirc;ng d&acirc;n cư, v&ugrave;ng c&oacute; ảnh hưởng nhiều s&oacute;ng kh&aacute;c: &amp;lt; 1 km<br />\r\n- Khu vực v&ugrave;ng ven th&agrave;nh phố, &iacute;t nh&agrave; cao tầng, &iacute;t vật cản &amp;lt; 3 km<br />\r\n- Khu vực đất trống, bến cảng, ngoại th&agrave;nh &amp;lt; 5 km<br />\r\n- Trong c&aacute;c t&ograve;a nh&agrave; cao ốc đang x&acirc;y dựng &amp;lt; 40 tầng<br />\r\n- Trong c&aacute;c t&ograve;a nh&agrave; cao ốc đang hoạt động &amp;lt; 20 tầng</p>\r\n\r\n<p>Th&ocirc;ng tin th&ecirc;m về sản phẩm:<br />\r\n- H&atilde;ng sản xuất: Baofeng<br />\r\n- Lắp r&aacute;p tại: Trung Quốc<br />\r\n- Bảo h&agrave;nh th&acirc;n m&aacute;y 06 th&aacute;ng<br />\r\n- Bảo h&agrave;nh phụ kiện 06 th&aacute;ng</p>\r\n\r\n<p>Hướng dẫn sử dụng:</p>\r\n\r\n<p>C&aacute;c m&aacute;y bộ đ&agrave;m muốn li&ecirc;n lạc được với nhau th&igrave; phải c&oacute; chung tần số (kh&ocirc;ng ph&acirc;n biệt chủng loại, h&atilde;ng sản xuất) đầu ti&ecirc;n mới mua m&aacute;y về ta phải sạc đầy pin trước khi sử dụng, sau đ&oacute; lắp anten v&agrave;o m&aacute;y (điều n&agrave;y bắt buộc), mở nguồn m&aacute;y, chỉnh &acirc;m lượng ph&ugrave; hợp, chọn c&ugrave;ng số k&ecirc;nh li&ecirc;n lạc cho tất cả c&aacute;c m&aacute;y, cuối c&ugrave;ng bấm n&uacute;t n&oacute;i v&agrave; thả tay ra để nghe ( xem hướng dẫn chi tiết b&ecirc;n dưới )</p>\r\n\r\n<p>C&aacute;ch lắp, th&aacute;o anten&nbsp;<br />\r\nLắp anten v&agrave;o m&aacute;y theo chiều kim đồng hồ, th&aacute;o ra ta vặn ngược lại</p>\r\n\r\n<p>&nbsp;C&aacute;ch mở nguồn m&aacute;y v&agrave; điều chỉnh &acirc;m lượng to<br />\r\nVặn n&uacute;m C (n&uacute;t nhỏ b&ecirc;n ngo&agrave;i như h&igrave;nh ph&iacute;a tr&ecirc;n) theo chiều kim đồng hồ để mở nguồn m&aacute;y, vặn tiếp ta sẽ điều chỉnh &acirc;m lượng lớn l&ecirc;n.&nbsp;</p>\r\n\r\n<p>C&aacute;ch tắt nguồn m&aacute;y v&agrave; điều chỉnh &acirc;m lượng nhỏ<br />\r\nVặn n&uacute;m C ( n&uacute;t nhỏ b&ecirc;n ngo&agrave;i như h&igrave;nh ph&iacute;a tr&ecirc;n) ngược chiều kim đồng hồ để giảm dần &acirc;m lượng v&agrave; tắt m&aacute;y.</p>\r\n\r\n<p>Chọn k&ecirc;nh li&ecirc;n lạc<br />\r\nChỉnh n&uacute;m B ( xem vị tr&iacute; n&uacute;m trong h&igrave;nh ph&iacute;a tr&ecirc;n ) chọn vị tr&iacute; k&ecirc;nh cần li&ecirc;n lạc ( nếu chọn vị tr&iacute; 1 th&igrave; tất cả c&aacute;c m&aacute;y trong nh&oacute;m phải chọn vị tr&iacute; 1 th&igrave; l&uacute;c n&agrave;y ta mới c&oacute; thể li&ecirc;n lạc chung với nhau )</p>\r\n\r\n<p>Thao t&aacute;c để gọi<br />\r\nNhấn giữ tay n&uacute;t D ( xem vị tr&iacute; n&uacute;t trong h&igrave;nh ph&iacute;a tr&ecirc;n ) sau đ&oacute; đặt m&aacute;y gần miệng đế n&oacute;i ( lưu &yacute; bấm n&uacute;t trước sau đ&oacute; mới n&oacute;i ) khi n&oacute;i xong c&acirc;u nhả tay ra để nghe m&aacute;y kh&aacute;c trả lời ( kh&ocirc;ng được nhấn giữ n&uacute;t D khi đ&atilde; n&oacute;i xong)</p>\r\n\r\n<p>#bộ_đ&agrave;m #bộ_đ&agrave;m_baofeng #bộ_đ&agrave;m_gi&aacute;_rẻ #bo_dam #bo_dam_baofeng #bo_dam_gia_re #glo.vn #bộ_đ&agrave;m_baofeng_BF888S #bo_dam_baofeng_BF888S</p>', 'walkie_1.jpg', 360000, 11, 11, 0, 0, 9, 11, NULL, 1, '2021-03-01 20:24:34', '2021-03-01 20:24:34', NULL),
(30, 'Máy nghe nhạc mp3 BTS-tặng tai nghe, dây sạc-chức năng FM, ghi âm, xem ảnh, đọc sách', '<p>M&aacute;y nghe nhạc mp3 BTS-tặng tai nghe, d&acirc;y sạc-chức năng FM, ghi &acirc;m, xem ảnh, đọc s&aacute;ch</p>\r\n\r\n<p>* Sản phẩm chưa bao gồm thẻ nhớ v&agrave; kh&ocirc;ng c&oacute; bộ nhớ trong. Shop c&oacute; b&aacute;n thẻ nhớ c&aacute;c bạn c&oacute; thể tham khảo tại trang chủ của shop.<br />\r\n* Đ&oacute;ng g&oacute;i: 1 m&aacute;y nghe nhạc+ 1 tai nghe+ 1 d&acirc;y sạc+ 1 hướng dẫn sử dụng.<br />\r\n* Khe cắm thẻ nhớ t&ugrave;y chỉnh dung lượng l&ecirc;n đến 32GB. Cổng tai nghe 3.5mm. Kh&ocirc;ng c&oacute; loa ngo&agrave;i.<br />\r\n* Chức năng: nghe nhạc, ghi &acirc;m, FM, xem ảnh, đọc s&aacute;ch dạng .txt.<br />\r\n* K&iacute;ch thước: 9x4x1cm. Khối lượng: 50gram.<br />\r\n* Thời gian sử dụng 5h.<br />\r\n* Thời gian sạc 2 tiếng, tr&aacute;nh sạc qu&aacute; thời gian tr&ecirc;n sẽ g&acirc;y ra hiện tượng trai pin/phồng pin. Gỉam thời gian nghe của m&aacute;y.<br />\r\n* D&ograve;ng điện sạc 5V-1A. Tuyệt đối kh&ocirc;ng d&ugrave;ng sạc tr&ecirc;n 1A để tr&aacute;nh qu&aacute; tải ảnh hưởng đến pin của m&aacute;y. Sử dụng tương tự với cục sạc dự ph&ograve;ng.<br />\r\n* C&aacute;ch sử dụng: lắp thẻ nhớ c&oacute; sẵn b&agrave;i h&aacute;t, cắm tai nghe, gạt c&ocirc;ng tắc nguồn để sử dụng.<br />\r\n-----<br />\r\n#maynghenhac #mp3 #tangtainghe #thenho #mini #classic #musicplayer #thoitrang #phongcach #quatang #giaitri #pubgmobile #bts #blackpink #hoctap #madaotosu #hatakashop</p>', 'ipad_1.jpg', 195000, 21, 21, 0, 0, 9, 6, NULL, 1, '2021-03-01 20:25:51', '2021-03-01 20:25:51', NULL),
(31, 'Loa Kéo Bluetooth P88 P89 KIOMIC Tặng Micro Hát Karaoke Cực Hay-Bảo hành 1 đổi 1(Có Hàng Nhiều)', '<p>- C&oacute; clip quay sản phẩm<br />\r\n- Tặng k&egrave;m 1 micro h&aacute;t Karaoke<br />\r\n- Chỉ b&aacute;n Kiomic Ch&iacute;nh Hang<br />\r\n- C&aacute;c sản phẩm đều được test kĩ tại kho n&ecirc;n qu&yacute; kh&aacute;ch y&ecirc;n t&acirc;m về chất lượng<br />\r\n- Bảo hảnh loa 1 đổi 1</p>\r\n\r\n<p>Loa bluetooth, karaoke P88, tuy c&oacute; thiết kế b&ecirc;n ngo&agrave;i kh&aacute;c biệt nhưng t&iacute;nh năng của loa P88 cũng tương tự như mẫu P89, cũng vẫn hỗ trợ nghe nhạc qua kết nối kh&ocirc;ng d&acirc;y với c&aacute;c thiết bị, ngo&agrave;i ra loa c&ograve;n t&iacute;ch hợp th&ecirc;m 2 cổng nghe nhạc từ USB v&agrave; thẻ nhớ, P-88 c&ograve;n c&oacute; th&ecirc;m cổng cắm mic c&oacute; d&acirc;y: ch&uacute;ng ta c&oacute; thể d&ugrave;ng chức năng n&agrave;y cho việc đ&aacute;p ứng c&aacute;c nhu cầu: đ&agrave;o tạo, b&aacute;n h&agrave;ng, quảng b&aacute;, hướng dẫn, ca h&aacute;t giải tr&iacute; ...<br />\r\nTh&ocirc;ng số kỹ thuật:</p>\r\n\r\n<p>-Model: P-88/ P88</p>\r\n\r\n<p>-Chất liệu: nhựa ABS</p>\r\n\r\n<p>-C&ocirc;ng suất: 20W</p>\r\n\r\n<p>-Tần số đ&aacute;p ứng: 100Hz - 20KHz</p>\r\n\r\n<p>-Hỗ trợ chức năng nghe nhạc MP3 từ: USB/ TF card</p>\r\n\r\n<p>-Kết nối bluetooth</p>\r\n\r\n<p>-Khoảng c&aacute;ch kết nối khoảng 10m</p>\r\n\r\n<p>-Dung lượng pin: 4200mAh</p>\r\n\r\n<p>-Nguồn: AC 220V</p>\r\n\r\n<p>-Thời gian sử dụng: 3 - 6h</p>\r\n\r\n<p>-Giao m&agrave;u ngẫu nhi&ecirc;n</p>\r\n\r\n<p>- Phụ kiện: d&acirc;y nguồn&nbsp;<br />\r\n------------------------------<br />\r\n- Micro l&agrave; qu&agrave; tặng k&egrave;m kh&ocirc;ng hỗ trợ bảo h&agrave;nh.<br />\r\n- Giao ngẫu nhi&ecirc;n mẫu p88, p89 kiomic<br />\r\n#p88 #p89 #loa #bluetooth #kiomic #loabluetooth #loakeo #karaoke #loap88 #loap89 #loa88</p>', 'karaoke_1.jpg', 182000, 12, 12, 0, 0, 9, 9, NULL, 1, '2021-03-01 20:28:26', '2021-03-01 20:28:26', NULL),
(32, 'Micro không dây Karaoke JVJ YS-91 Bluetooth - Hỗ trợ ghi âm', '<p>Micro kh&ocirc;ng d&acirc;y Karaoke JVJ YS-91 Bluetooth - Kết nối điện thoại, tivi qua Bluetooth , C&ocirc;ng suất 3W, H&uacute;t giọng<br />\r\nTh&ocirc;ng số kỹ thuật:<br />\r\n- Thương hiệu: JVJ<br />\r\n- T&ecirc;n sản phẩm: Micro Karaoke Bluetooth JVJ YS-91<br />\r\n- Bộ Sản phẩm bao gồm: 1 Micro k&egrave;m loa, 1 C&aacute;p sạc, 1 Thẻ bảo h&agrave;nh ch&iacute;nh h&atilde;ng, th&ocirc;ng tin bảo h&agrave;nh&nbsp;<br />\r\n- Chất liệu sản phẩm: Nhựa ABS, kim loại<br />\r\n- C&ocirc;ng suất:3W - 2 loa<br />\r\n- Dải tần: 100Hz-10KHz<br />\r\n- Điện &aacute;p: DC 5V<br />\r\n- Tương th&iacute;ch: IOS, Android, PC, Smart TV<br />\r\n- Hỗ trợ: Thẻ nhớ TF, Tai nghe, Bluetooth 4.2&nbsp;<br />\r\n- Kết nối: USB, MicroSD<br />\r\n- Dung lượng Pin: 2200mAh<br />\r\n- Max SPL: &ge; 115dB 1KHz THD&amp;lt;1%<br />\r\n- Thời gian sử dụng: 3-5 giờ<br />\r\n- Thời gian sạc: 2h<br />\r\n- K&iacute;ch thước: 7,4x7,4x246cm<br />\r\n- Trọng lượng: 300Gr<br />\r\nTh&ocirc;ng tin chi tiết:<br />\r\n- &Aacute;p dụng c&ocirc;ng nghệ lọc loại bỏ bớt tạp &acirc;m b&ecirc;n ngo&agrave;i v&ocirc; c&ugrave;ng hiện đại, khả năng bắt v&agrave; h&uacute;t &acirc;m của mic rất tốt, &acirc;m thanh to, thanh, trung thực v&agrave; c&oacute; độ ấm cao<br />\r\n- Mic Karaoke Bluetooth JVJ YS-91 khắc phục được nhược điểm l&agrave; tiếng loa bị r&egrave;, vỡ &acirc;m hay loa đột nhi&ecirc;n r&uacute; l&ecirc;n khi v&ocirc; t&igrave;nh ma s&aacute;t v&agrave;o v&ograve;m mic. C&aacute;c n&uacute;t điều chỉnh chức năng được sắp xếp hợp l&yacute; thuận tiện sử dụng hơn kh&aacute; nhiều.<br />\r\n- Đặc biệt Mic Karaoke Bluetooth JVJ YS-91 được t&iacute;ch hợp chức năng chỉnh tone giọng tạo sự mới lạ khi h&aacute;t.<br />\r\nCấu tạo v&agrave; chất liệu<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Mic Karaoke Bluetooth JVJ YS-91 c&oacute; kiểu d&aacute;ng hầm hố, kết cấu bền chắc với hợp kim nhựa v&agrave; kim loại, kh&ocirc;ng qu&aacute; nặng khi cầm tr&ecirc;n tay, thiết kế đẹp mắt cầm rất chắc tay<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Mic Karaoke Bluetooth JVJ YS-91 c&oacute; 3 chế độ kết nối để bạn lấy nhạc bao gồm: kết nối bluetooth, kết nối USB v&agrave; kết nối thẻ nhớ. Gi&uacute;p bạn c&oacute; thể thoải m&aacute;i hơn trong việc lựa chọn kết nối m&agrave; m&igrave;nh muốn. Thường th&igrave; ch&uacute;ng ta sẽ sử dụng kết nối Bluetooth với điện thoại, rồi mở nhạc tr&ecirc;n điện thoại để h&aacute;t. Tuy nhi&ecirc;n đ&ocirc;i khi ch&uacute;ng ta kh&ocirc;ng c&oacute; sẵn điện thoại để ph&aacute;t nhạc th&igrave; c&oacute; thể chuẩn bị USB hoặc thẻ nhớ rồi ch&eacute;p nhạc v&agrave;o đ&oacute; v&agrave; gắn v&agrave;o Micro để ph&aacute;t</p>\r\n\r\n<p>*) JVJ l&agrave; thương hiệu c&ocirc;ng nghệ l&acirc;u năm đến từ Singapore, tại Việt Nam được biết đến với thương hiệu về m&aacute;y ghi &acirc;m, loa nghe nhạc, điện thoại di động, đồng hồ c&ocirc;ng nghệ... Với chất lượng tốt, mẫu m&atilde; bền đẹp. Với &nbsp;15 chi nh&aacute;nh bảo h&agrave;nh to&agrave;n quốc, ch&uacute;ng t&ocirc;i cam kết sẽ mang tới sản phẩm chất lượng v&agrave; dịch vụ tốt nhất</p>\r\n\r\n<p>*) CAM KẾT VỀ CHẤT LƯỢNG V&Agrave; DỊCH VỤ B&Aacute;N H&Agrave;NG:&nbsp;<br />\r\n1. H&agrave;ng thật như h&igrave;nh.&nbsp;<br />\r\n2. Kiểm tra h&agrave;ng trước khi thanh to&aacute;n.&nbsp;<br />\r\n3. Cung cấp c&aacute;c sản phẩm chất lượng&nbsp;<br />\r\n*) QUY ĐỊNH ĐỔI TRẢ: 1 ĐỔI 1 trong v&ograve;ng 7 ng&agrave;y nếu lỗi do nh&agrave; sản xuất<br />\r\n1. Sản phẩm bị lỗi do nh&agrave; sản xuất<br />\r\n&nbsp;2. Hư hỏng trong qu&aacute; tr&igrave;nh vận chuyển<br />\r\n&nbsp;3. Kh&aacute;ch h&agrave;ng đưa ra l&yacute; do hợp l&yacute; về sự kh&ocirc;ng h&agrave;i l&ograve;ng đối với sản phẩm v&agrave; được sự đồng &yacute; từ Shop<br />\r\n&nbsp;*) SẢN PHẨM ĐƯỢC BẢO H&Agrave;NH 6 TH&Aacute;NG</p>\r\n\r\n<p>#mic #micro #mickaraoke #microkaraoke #micbluetooth #microbluetooth #mickaraokebluetooth #microkaraokebluetooth #michat #mickemloa #mickiemloa #microkhongday #mickhongday #michatbluetooth #karaoke #michathay #michay #micchatluong</p>', 'mic_1.jpg', 399000, 11, 11, 0, 0, 9, 6, NULL, 1, '2021-03-01 20:29:31', '2021-03-01 20:29:31', NULL),
(33, 'Loa Kéo Bluetooth Karaoke Kimiso S2 Tặng Kèm 1 Mic Dây 3m- Phiên Bản Nâng Cấp Mn03 MP03 P88 P89 JHW 802', '<p>Loa Bluetooth Karaoke Kimiso S2 (Đen) Tặng K&egrave;m 1 Mic H&aacute;t C&oacute; D&acirc;y Cắm Trực Tiếp, Si&ecirc;u Bass Kh&ocirc;ng D&acirc;y, Đ&egrave;n Led Sống Động&nbsp;</p>\r\n\r\n<p>GIỚI THIỆU VỀ LOA BLUETOOTH KARAOKE X&Aacute;CH TAY KIMISO S2 K&Egrave;M MIC<br />\r\nKhi c&aacute;c bạn muốn thưởng thức &acirc;m nhạc ngo&agrave;i trời m&agrave; lo lắng khi phải b&ecirc; những chiếc loa to cồng kềnh th&igrave; giờ đ&acirc;y ch&uacute;ng t&ocirc;i muốn giới thiệu đến c&aacute;c bạn một sản phẩm v&ocirc; c&ugrave;ng tiện &iacute;ch v&agrave; hiện đại &ndash; Loa Karaoke Bluetooth X&aacute;ch Tay KIMISO S2 k&egrave;m mic kh&ocirc;ng d&acirc;y rất tiện khi di chuyển ngo&agrave;i trời, với &acirc;m thanh lớn, chất lượng, hiệu ứng loa tốt, bass tuyệt vời c&aacute;c bạn tha hồ nghe những b&agrave;i nhạc y&ecirc;u th&iacute;ch ở bất cứ nơi đ&acirc;u bạn muốn.</p>\r\n\r\n<p>ĐẶC ĐIỂM NỔI BẬT<br />\r\n&ndash; Đặc Biệt Với Loa Super Bass, Cho Tiếng Bass Si&ecirc;u Trầm, &Acirc;m Thanh Cực Chắc V&agrave; Kh&ocirc;ng Bị R&egrave;.<br />\r\n&ndash; Với Chức Năng NGHE GỌI RẢNH TAY Khi Kết Nối Loa Với Điện Thoại Qua Bluetooth.<br />\r\n&ndash; Đầy Đủ C&aacute;c Cổng Kết Nối: Bluetooth, USB, Thẻ Nhớ TF, Jack &Acirc;m Thanh AUX, Jack Cắm MIC&nbsp;<br />\r\n&ndash; Cắm Mic v&agrave; h&aacute;t Karaoke thật dễ d&agrave;ng, c&oacute; c&aacute;ch t&ugrave;y chỉnh cho Mic ngay tr&ecirc;n loa<br />\r\n&ndash; Hỗ Trợ Đầu V&agrave;o &Acirc;m Thanh Của GHITA ĐIỆN.<br />\r\n&ndash; Kết Nối Được Với Tất Cả C&aacute;c Thiết Bị: Điện Thoại, Ipad, M&aacute;y Nghe Nhạc, Laptop, M&aacute;y PSP,&hellip;.Qua C&aacute;c Cổng Kết Nối.<br />\r\n&ndash; Thiết Kế C&aacute;c Ph&iacute;m Chức Năng Đa Dạng, Dễ D&agrave;ng Tuỳ Chỉnh &Acirc;m Thanh Ph&ugrave; Hợp Với Sở Th&iacute;ch Nghe.<br />\r\n&ndash; Với Quai X&aacute;ch Ở Nhiều Vị Tr&iacute; , Dễ D&agrave;ng Mang Theo B&ecirc;n M&igrave;nh Khi Đi Đến Bất Cứ Đ&acirc;u.</p>\r\n\r\n<p>TH&Ocirc;NG TIN SẢN PHẨM<br />\r\n&ndash; Chất liệu: Nhựa ABS cao cấp<br />\r\n&ndash; Khoảng c&aacute;ch kết nối Bluetooth: 10m<br />\r\n&ndash; Hỗ trợ cổng: USB, Thẻ nhớ,Aux,Mic<br />\r\n&ndash; C&ocirc;ng suất: &nbsp;2x20W<br />\r\n&ndash; Dung lượng PIN: 10000mAh (Sử dụng li&ecirc;n tục trong 6 - 8 giờ li&ecirc;n tục) c&oacute; thể sử dụng như 1 sạc dự ph&ograve;ng.<br />\r\n&ndash; Nguồn cung cấp: D&ugrave;ng Adapter 5V-1A/2A để sạc cho thiết bị, Adapter tr&ecirc;n 5.5V c&oacute; thể g&acirc;y ra hư hỏng cho thiết bị.<br />\r\n&ndash; Trọng lượng: 2 KG<br />\r\n&ndash; K&iacute;ch thước: 18 (cao) x 38 (ngang) x 16 (d&agrave;y)<br />\r\n&ndash; FullBox: Loa + C&aacute;p Sạc USB + C&aacute;p AUX + HDSD + Thẻ bảo h&agrave;nh<br />\r\nLoa Bluetooth Karaoke X&aacute;ch Tay KIMISO S2 K&egrave;m Mic hiện đang l&agrave; sản phẩm rất ưu chuộng với mọi lứa tuổi v&igrave; t&iacute;nh đa năng, năng động, c&aacute; t&iacute;nh. Đem lại &acirc;m thanh sống động cho người sử dụng</p>\r\n\r\n<p>TI&Ecirc;U CH&Iacute; CỦA NGƯỜI B&Aacute;N<br />\r\n- Lu&ocirc;n mang đến những sản phẩm chất lượng với giả cả hợp l&yacute; nhất<br />\r\n- Lu&ocirc;n đặt lợi &iacute;ch của kh&aacute;ch h&agrave;ng l&ecirc;n h&agrave;ng đầu</p>\r\n\r\n<p>QUYỀN LỢI CỦA KH&Aacute;CH H&Agrave;NG<br />\r\n- Bảo h&agrave;nh: 6 th&aacute;ng<br />\r\n- Hỗ trợ đổi 1-1 trong 7 ng&agrave;y kể từ ng&agrave;y nhận h&agrave;ng nếu sản phẩm lỗi hoặc kh&ocirc;ng giống với h&igrave;nh ảnh<br />\r\n#loakhongday #loabluetooth #Loathongminh #loadaulau #loadeban #loadidong #loachinhhang #loanhogon #loamini #loabluetoothmini #loacamtay #loanghenhac #loaminibluetooth #loanghenhachay #loanghenhacbluetooth #Loahay #loausb #loathenhoTF</p>', 'bluetooth_1.jpg', 239000, 12, 12, 0, 0, 9, 9, NULL, 1, '2021-03-01 20:30:38', '2021-03-01 20:30:38', NULL),
(34, 'Loa Bluetooth Mini Đèn LED Đổi Màu', '<p>Lớp vỏ ngo&agrave;i của Loa Bluetooth bằng nhựa chống trơn trượt<br />\r\nThiết kế tinh tế, c&ocirc;ng nghệ đột ph&aacute;, sử dụng đơn giản, kiểu đ&oacute;ng g&oacute;i độc đ&aacute;o.<br />\r\nPh&aacute;t nhạc qua bluetooth của c&aacute;c thiết bị c&oacute; chức năng ph&aacute;t nhạc qua bluetooth.<br />\r\nChiếc loa bluetooth c&oacute; &acirc;m thanh bass kh&aacute; tốt, chuy&ecirc;n bass trầm mạnh.<br />\r\nH&igrave;nh ảnh sản phẩm khi l&ecirc;n h&igrave;nh c&oacute; thể c&oacute; sự kh&aacute;c biệt m&agrave;u sắc do hiệu ứng khi chụp ảnh, g&oacute;c nh&igrave;n.</p>\r\n\r\n<p>* Bảo h&agrave;nh: 01 th&aacute;ng<br />\r\n* Th&ocirc;ng tin chi tiết sản phẩm:</p>\r\n\r\n<p>- &nbsp;Loa Output: 3w<br />\r\n- Tần số đ&aacute;p ứng: 60HZ - 20KHz<br />\r\n- Signal-to-noise: &ge; 90dB<br />\r\n- Distortion: &le; 0,5% @ (1KHz)<br />\r\n- Pin điện &aacute;p / c&ocirc;ng suất: 350mAh<br />\r\n- Pin sạc điện &aacute;p: 5V &plusmn; 0.5V<br />\r\n- Thời gian sạc pin: 2 giờ<br />\r\n- Bluetooth phi&ecirc;n bản: V2.1 (tần số 2402-2480MHz)<br />\r\n- Phạm vi l&agrave;m việc l&ecirc;n tới: 10m<br />\r\n- Thời gian l&agrave;m việc l&ecirc;n tới: 1 - 3 giờ<br />\r\n- K&iacute;ch thước: 60mm x 50mm</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;<br />\r\n&nbsp;<br />\r\n#loa #linhkien #phukien #bluetooh #a9</p>', 'mini_speaker_1.jpg', 39998, 11, 11, 0, 0, 9, 10, NULL, 1, '2021-03-01 20:31:51', '2021-03-01 20:31:51', NULL),
(35, 'Loa SoundBar 100 Âm Thanh Vòm Sống Động Phong Cách Rạp Phim, Fullbox, Chính Hãng GENIUS', '<p>🎁 ĐẶC BIỆT: Nhấp v&agrave;o &ocirc; &ldquo;M&Atilde; GIẢM GI&Aacute;&rdquo; l&uacute;c đặt h&agrave;ng để lấy m&atilde; MIỄN / GIẢM PH&Iacute; VẬN CHUYỂN bạn nh&eacute;</p>\r\n\r\n<p>💎 LƯU &Yacute;: LOA KẾT NỐI C&Oacute; D&Acirc;Y, KH&Ocirc;NG CẮM THẺ NHỚ HAY USB&nbsp;</p>\r\n\r\n<p>💎 &nbsp;ĐẶC ĐIỂM NỔI BẬT CỦA LOA:<br />\r\n------</p>\r\n\r\n<p>&bull; &nbsp; &nbsp; &nbsp; Loa USB SoundBar 100 mang đến &acirc;m thanh sắc n&eacute;t, m&ecirc; hoặc, sống động, mang đến cho bạn trải nghiệm &acirc;m thanh v&ograve;m tuyệt vời như rạp phim, điều chỉ c&oacute; ở những thiết bị &acirc;m thanh cao cấp.<br />\r\n&bull; &nbsp;&nbsp; &nbsp;Giao diện kết nối: Kết nối qua cổng USB, kh&ocirc;ng cần d&acirc;y nguồn, kh&ocirc;ng cần sạc pin.<br />\r\n&bull; &nbsp; &nbsp; &nbsp; Khả năng tương th&iacute;ch rộng, c&oacute; thể kết nối với nhiều thiết bị kh&aacute;c nhau như: Desktop, Laptop, Tablet, Smartphone, MP3/MP4, TV, Radio.<br />\r\n&bull; &nbsp; &nbsp; &nbsp; Điều khiển &acirc;m lượng dễ d&agrave;ng chỉ với một n&uacute;t cuộn<br />\r\n&bull; &nbsp; &nbsp; &nbsp; Dễ sử dụng, chỉ với đầu cắm USB, kh&ocirc;ng cần pin hoặc d&acirc;y nguồn, hoạt động với mọi thiết NHỎbị c&oacute; giắc cắm 3,5mm ti&ecirc;u chuẩn.<br />\r\n&bull; &nbsp;&nbsp;&nbsp; &nbsp; m thanh mạnh mẽ, chất lượng &acirc;m thanh tuyệt vời. Kh&ocirc;ng bị m&eacute;o tiếng ở &acirc;m lượng tối đa v&agrave; đủ lớn d&ugrave; bạn c&oacute; ở trong một căn ph&ograve;ng rộng.<br />\r\n&bull; &nbsp; &nbsp; &nbsp; Thiết kế si&ecirc;u nhỏ gọn, tinh tế chắc chắn sẽ l&agrave;m bạn h&agrave;i l&ograve;ng.<br />\r\n&bull; &nbsp; &nbsp; &nbsp; K&iacute;ch thước (D&agrave;i x Rộng x Cao): 320mm x 65mm x 70 mm<br />\r\n&bull; &nbsp; &nbsp; &nbsp; Trọng lượng: 476,5g<br />\r\n&bull; &nbsp; &nbsp; &nbsp; Tổng c&ocirc;ng suất đầu ra: 6 W<br />\r\n&bull; &nbsp; &nbsp; &nbsp; Đ&aacute;p ứng điện trở: 3 &Omega;<br />\r\n&bull; &nbsp; &nbsp; &nbsp; Độ nhạy: 600mv &plusmn; 100mv<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Đ&aacute;p ứng tần số: 110HZ ~ 20KHz<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Đầu v&agrave;o &acirc;m thanh jack: 3,5 mm<br />\r\n&bull; &nbsp; &nbsp; &nbsp; M&agrave;u sắc: M&agrave;u Đen tinh tế<br />\r\n&bull; &nbsp; &nbsp; &nbsp; Thiết kế v&ocirc; c&ugrave;ng nhỏ gọn, thanh lịch, tiết kiệm diện t&iacute;ch b&agrave;n l&agrave;m việc của bạn</p>\r\n\r\n<p>💎 BỘ SẢN PHẨM GỒM:<br />\r\n---<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Bộ loa SoundBar 100 USB<br />\r\n&bull;&nbsp;&nbsp; &nbsp;S&aacute;ch hướng dẫn sử dụng</p>\r\n\r\n<p>💎 &nbsp;CH&Uacute;NG T&Ocirc;I CAM KẾT:<br />\r\n---<br />\r\n&bull;&nbsp;&nbsp; &nbsp;H&igrave;nh sao h&agrave;ng vậy, đảm bảo chất lượng sản phẩm như cam kết<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Sau khi nhận h&agrave;ng NẾU SẢN PHẨM C&Oacute; LỖI qu&yacute; kh&aacute;ch c&oacute; quyền y&ecirc;u cầu ĐỔI TRẢ - BẢO H&Agrave;NH 1 ĐỔI 1 hoặc HO&Agrave;N TIỀN th&ocirc;ng qua t&iacute;nh năng tr&ecirc;n SHOPEE. Qu&yacute; kh&aacute;ch ho&agrave;n to&agrave;n y&ecirc;n t&acirc;m khi mua sắm với ch&uacute;ng t&ocirc;i.</p>\r\n\r\n<p>🧡 Shop cam kết chất lượng l&agrave;m bạn h&agrave;i l&ograve;ng<br />\r\n&nbsp;<br />\r\n✪ CH&Uacute; &Yacute;: Trong tuần nhiều ưu đ&atilde;i n&agrave;y ĐẰNG N&Agrave;O CŨNG MUA, MUA NGAY H&Ocirc;M NAY TH&Igrave; GI&Aacute; RẺ HƠN.</p>\r\n\r\n<p>#loausb &nbsp;#loa &nbsp;#loasoundbar100 &nbsp; #loamaytinh &nbsp;#loadeban &nbsp;#loamaytinhgiare &nbsp;#loamaytinhdep &nbsp;#loaamthanhvom&nbsp;&nbsp; &nbsp;#soundbar100<br />\r\n&nbsp;</p>', 'sound_bar_1.jpg', 229000, 10, 10, 0, 0, 9, 8, NULL, 1, '2021-03-01 20:33:50', '2021-03-01 20:33:50', NULL),
(36, 'loa Nghe Nhạc Usb Thẻ Nhớ FM Craven CR-836s', '<p>Loa nghe thẻ nhớ, USB, FM Craven CR 836s - &nbsp;Th&ecirc; hệ loa ti&ecirc;n tiến nhất - 2 pin dung lượng cao</p>\r\n\r\n<p>Cảm ơn qu&yacute; kh&aacute;ch đ&atilde; gh&eacute; thăm shop Diệu T&uacute; &ndash; Cung cấp loa nghe thẻ nhớ, usb, m&aacute;y nghe giảng ph&aacute;p, niệm Phật. Ch&uacute;c qu&yacute; kh&aacute;ch chọn được sản phẩm ph&ugrave; hợp cho nhu cầu sử dụng của m&igrave;nh.<br />\r\nMọi th&ocirc;ng tin cần tư vấn chi tiết: qu&yacute; kh&aacute;ch vui l&ograve;ng nhắn tin cho shop hoặc LH: Diệu T&uacute;: 0988.415.556</p>\r\n\r\n<p>Th&ocirc;ng tin sản phẩm: Loa Craven CR836s ( Lưu &yacute; với qu&yacute; kh&aacute;ch l&agrave; loa CR836s c&oacute; anten ch&iacute;nh l&agrave; d&acirc;y đeo của m&aacute;y)<br />\r\n+ TH&Ocirc;NG TIN CHUNG: LOA CRAVEN CR-836s</p>\r\n\r\n<p>- Kiểu d&aacute;ng radio nhỏ gọn, tiện bỏ t&uacute;i mang theo &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- &Acirc;m thanh sống động, bass hay<br />\r\n- Nghe nhạc &nbsp;mp3 từ thẻ nhớ Micro SD, USB &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - Nghe radio FM &nbsp; &nbsp; &nbsp;- C&oacute; ch&acirc;n cắm tai nghe 3.5&nbsp;<br />\r\n- M&agrave;n h&igrave;nh hiển thị led &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - C&ocirc;ng suất: 3W<br />\r\n- Sử dụng pin rời dễ d&agrave;ng thay thế v&agrave; n&acirc;ng cấp &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - Thời gian sử dụng li&ecirc;n tục tầm 20 tiếng mới phải sạc &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br />\r\n&nbsp;- Bảo h&agrave;nh: 3 th&aacute;ng &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- &nbsp;M&aacute;y gồm 2 pin dung lượng 2200mAh x 2</p>\r\n\r\n<p>- Chức năng mới:&nbsp;<br />\r\nVới người c&oacute; nhu cầu nghe Giảng ph&aacute;p, tụng kinh, niệm Phật, shop DT cung cấp sẵn c&aacute;c list b&agrave;i giảng ph&aacute;p để qu&yacute; kh&aacute;ch, qu&yacute; phật tử lựa chọn.<br />\r\n-&nbsp;&nbsp; &nbsp;Với nhu cầu hỗ trợ học tiếng anh cho b&eacute;, c&aacute;c mẹ c&oacute; thể ch&eacute;p file học mp3 v&agrave;o thẻ nhớ cho b&eacute; tắm tiếng anh h&agrave;ng ng&agrave;y.<br />\r\n-&nbsp;&nbsp; &nbsp;Đ&acirc;y cũng l&agrave; người bạn l&yacute; tưởng để c&aacute;c b&aacute;c, c&aacute;c c&ocirc; c&oacute; thể thưởng thức c&aacute;c bản nhạc ưa th&iacute;ch mọi l&uacute;c mọi nơi.&nbsp;<br />\r\n-&nbsp;&nbsp; &nbsp;Nhờ chức năng ph&aacute;t FM, c&aacute;c bạn c&oacute; thể cập nhật tin tức, thời sự tr&ecirc;n s&oacute;ng FM tại bất k&igrave; đ&acirc;u..</p>\r\n\r\n<p>- Bảo hành th&acirc;n loa 06 tháng bằng tem dán tr&ecirc;n loa * Kh&ocirc;ng bảo hành với những trường hợp sau: Rơi nước. Rơi vỡ. Có d&acirc;́u hi&ecirc;̣u tháo SP tự sữa chữa. Bung tem. Dán keo 502. gãy ch&acirc;n USB. Gãy ch&acirc;n sạc. *&nbsp;<br />\r\nLưu &yacute;: Đ&agrave;i chưa k&egrave;m thẻ nhớ. Nếu chưa lắp thẻ nhớ, chỉ c&oacute; thể nghe FM. * H&igrave;nh ảnh chụp sản phẩm thực tế, kh&ocirc;ng chỉnh sửa *<br />\r\n#BKK # Craven #Craven836s #Loathẻnhớ #Loanghenhạc #Loamp3 #Loa2khethẻ #M&aacute;yngheph&aacute;p #Đ&agrave;inghePh&aacute;p # 3pin # Craven3 pin #CRAVEN</p>', 'foreign_speaker_1.jpg', 246000, 23, 23, 0, 0, 9, 7, NULL, 1, '2021-03-01 20:35:08', '2021-03-01 20:35:08', NULL),
(37, 'Loa bluetooth Goden House S6 cao cấp, loa bluetooth mini để bàn tích hợp công nghệ âm thanh stereo siêu trầm ấm', '<p>🏡🏡🏡🏡🏡Godenhouse.vn &ndash; Cửa H&agrave;ng Phụ Kiện Ch&iacute;nh H&atilde;ng🏡🏡🏡🏡🏡</p>\r\n\r\n<p>✔️&nbsp;&nbsp; &nbsp;Sản phẩm c&oacute; sao quảng c&aacute;o vậy, kh&ocirc;ng quảng c&aacute;o sai so với sản phẩm.</p>\r\n\r\n<p>✔️&nbsp;&nbsp; &nbsp;Bảo h&agrave;nh 1 đổi 1, 1 năm nếu gặp lỗi do nh&agrave; sản xuất.</p>\r\n\r\n<p>✔️&nbsp;&nbsp; &nbsp;C&aacute;c sản phẩm trước khi gửi đi đều được kiểm tra cẩn thận, trong qu&aacute; tr&igrave;nh vận chuyển c&oacute; thể dẫn đến hư hỏng kh&ocirc;ng mong muốn ==&amp;gt;Qu&yacute; kh&aacute;ch vui l&ograve;ng quay lại video khi nhận h&agrave;ng v&agrave; mở g&oacute;i h&agrave;ng để được bảo h&agrave;nh.</p>\r\n\r\n<p>✔️ &nbsp; Kiểm tra h&agrave;ng kỹ khi nhận đ&uacute;ng h&agrave;ng mới thanh to&aacute;n.</p>\r\n\r\n<p>✔️&nbsp;&nbsp; &nbsp;Hotline : 0975.96.94.97</p>\r\n\r\n<p>✔️&nbsp;&nbsp; &nbsp;CTV,Sỉ,Dropship li&ecirc;n hệ Zalo : 0975.96.94.97</p>\r\n\r\n<p>&nbsp;➡️ Ch&iacute;nh s&aacute;ch của Shopee: MIỄN PH&Iacute; SHIP CHO ĐƠN H&Agrave;NG TỪ 0đ</p>\r\n\r\n<p>&nbsp;➡️ Giới thiệu sản phẩm: Loa bluetooth S6 kh&ocirc;ng d&acirc;y gi&aacute; rẻ,thiết kế nhỏ gọn,h&igrave;nh mắt chim,chất lượng &acirc;m thanh&nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; tốt,r&otilde; r&agrave;ng,&acirc;m thanh lớn.</p>\r\n\r\n<p>&nbsp;➡️ Loa buletool cao cấp S6, loa &acirc;m thanh kết nối bluetool cực ngầu khoảng c&aacute;ch kết nối cao, chắc chắn l&agrave; sản&nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; phẩm m&agrave; c&aacute;c bạn sẽ tin d&ugrave;ng, với tốc độ ph&aacute;t nhạc nhanh v&agrave; chuẩn cho gia đ&igrave;nh của bạn tận hưởng ph&ograve;ng&nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; karaoke tại nh&agrave;, an to&agrave;n tuyệt đối cho người d&ugrave;ng.</p>\r\n\r\n<p>&nbsp;➡️ &nbsp;Loa buletool cao cấp S6, loa &acirc;m thanh kết nối bluetool cực ngầu khoảng c&aacute;ch kết nối cao, với thiết kế nhỏ&nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; gọn chắc chắn, mức gi&aacute; hợp l&yacute; sẽ kh&ocirc;ng thể thiếu cho pc, điện thoại, laptop của bạn.</p>\r\n\r\n<p>&nbsp;➡️ 2 loa &acirc;m thanh chất lượng cao với c&ocirc;ng nghẹ stereo mới nhất kết hợp c&ugrave;ng đ&egrave;n nh&aacute;y tuyệt đẹp.</p>\r\n\r\n<p>&nbsp;➡️ Chất liệu: nhựa ABS</p>\r\n\r\n<p>&nbsp;➡️ C&ocirc;ng suất: 5W</p>\r\n\r\n<p>&nbsp;➡️ Kết nối bluetooth, &le; 10m</p>\r\n\r\n<p>&nbsp;➡️ Tần số đ&aacute;p ứng: 100Hz - 20KHz</p>\r\n\r\n<p>&nbsp;➡️ SNR: &ge; 85dB</p>\r\n\r\n<p>&nbsp;➡️ Nghe nhạc từ USB (max 32Gb) /SD Card</p>\r\n\r\n<p>&nbsp;➡️ Cổng AUX: kết nối với c&aacute;c thiết bị ph&aacute;t</p>\r\n\r\n<p>&nbsp;➡️ Cổng sạc mini USB, DC 5V</p>\r\n\r\n<p>&nbsp;➡️ Pin sạc: 1500mAh</p>\r\n\r\n<p>&nbsp;➡️ Thời gian sử dụng: 2 - 4h t&ugrave;y v&agrave;o c&ocirc;ng suất sử dụng</p>\r\n\r\n<p>&nbsp;➡️ Thời gian sạc đầy: 2 - 3h</p>\r\n\r\n<p>&nbsp;➡️ Phụ kiện: d&acirc;y c&aacute;p 2 đầu 3.5mm, d&acirc;y nguồn</p>\r\n\r\n<p>✔️✔️ CH&Iacute;NH S&Aacute;CH BẢO H&Agrave;NH</p>\r\n\r\n<p>&nbsp;- Sản phẩm bị lỗi kỹ thuật do nh&agrave; sản xuất.</p>\r\n\r\n<p>&nbsp;- M&atilde; vạch, số serial, th&ocirc;ng số kỹ thuật của nh&agrave; sản xuất đ&atilde; được d&aacute;n tr&ecirc;n sản phẩm<br />\r\nphải c&ograve;n nguy&ecirc;n vẹn.</p>\r\n\r\n<p>&nbsp;- C&ograve;n trong thời hạn bảo h&agrave;nh, thời hạn bảo h&agrave;nh được t&iacute;nh từ ng&agrave;y kh&aacute;ch đặt h&agrave;ng</p>\r\n\r\n<p>&nbsp;- ĐỂ THUẬN TIỆN CHO VIỆC NHẬN ƯU Đ&Atilde;I V&Agrave; BẢO H&Agrave;NH QU&Yacute; KH&Aacute;CH BẤM<br />\r\n&nbsp; &nbsp;FOLLOW SHOP NH&Eacute; !</p>\r\n\r\n<p>✔️ lưu &yacute;:- Mọi thắc mắc về sản phẩm v&agrave; hướng dẫn c&aacute;c bạn vui l&ograve;ng gọi về hotline hoặc v&agrave;o link để được tư vấn&nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;chi tiết ạ.&nbsp;<br />\r\n&nbsp;&nbsp; &nbsp; &nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; - Khi nhận h&agrave;ng kh&aacute;ch h&agrave;ng vui l&ograve;ng quay lại video khi mở h&agrave;ng v&agrave; test h&agrave;ng nếu kh&ocirc;ng c&oacute; video shop&nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;kh&ocirc;ng chấp nhận đổi chả.<br />\r\n&nbsp;&nbsp; &nbsp; &nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- Sản phẩm bị hư hỏng do lỗi người sử dụng, kh&ocirc;ng nằm trong phạm vi bảo h&agrave;nh của<br />\r\n&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;nh&agrave; sản xuất như: rơi, vỡ, va đập, m&oacute;p m&eacute;o, cong hoặc g&atilde;y, bị trầy xước, ẩm ướt,<br />\r\n&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;hoen rỉ, chảy nước, c&ocirc;n tr&ugrave;ng x&acirc;m nhập, ch&aacute;y nổ, thi&ecirc;n tai, hỏa hoạn SẼ KH&Ocirc;NG<br />\r\n&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ĐƯỢC BẢO H&Agrave;NH</p>\r\n\r\n<p>#loa #bluetooth #khong #day #hang #tot #chat #luong #cap #cao #s6 #chinh #hang #uy #tin #an #toan #godenhouse</p>', 'niqin_speaker_1.jpg', 225000, 11, 11, 0, 0, 9, 7, NULL, 1, '2021-03-01 21:08:03', '2021-03-01 21:08:03', NULL);
