(38, 'Loa bluetooth CAO CẤP - âm thanh BASS mạnh Loa chống nước IPX7 - âm hanh trung thực vthm9 (vthm9)', '<p>Loa bluetooth CAO CẤP - &acirc;m thanh BASS mạnh Loa chống nước IPX7 - &acirc;m hanh trung thực. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Loa Bluetooth Kh&ocirc;ng D&acirc;y Vỏ Nh&ocirc;m nổi tiếng với &acirc;m bass mạnh mẽ, Chiến mọi thể loại nhạc từ EDM, DJ, Nonstop, Remix đến những b&agrave;i nhạc Pop s&acirc;u lắng, nhẹ nh&agrave;ng đầy cảm x&uacute;c hay những ca kh&uacute;c Cải lương, nhạc Bolero, nhạc c&aacute;ch mạng, kinh phật... đều tốt cả nh&eacute;. &Acirc;m thanh hay vượt trội, diễn tả mọi cung bậc cảm x&uacute;c của bản nhạc m&agrave; bạn y&ecirc;u th&iacute;ch thật sự tuyệt vời.<br />\r\n- Loa Bluetooth Kh&ocirc;ng D&acirc;y &nbsp;Vỏ Nh&ocirc;m trang bị c&ocirc;ng nghệ Bluetooth v&ocirc; c&ugrave;ng phổ biến n&ecirc;n bạn c&oacute; thể kết nối loa với c&aacute;c thiết bị c&ocirc;ng nghệ th&ocirc;ng minh như điện thoại, m&aacute;y t&iacute;nh bảng, laptop đấy nh&eacute;. Sử dụng Bluetooth ở loa cũng rất đơn giản, chỉ cần mở nguồn l&agrave; loa sẽ tự động mở kết nối bluetooth, sau đ&oacute; kết nối bluetooth của điện thoại bạn với loa l&agrave; c&oacute; thể nghe nhạc, xem phim, gọi điện tr&ograve; chuyện th&ocirc;ng qua loa cực k&igrave; thoải m&aacute;i thoải m&aacute;i.<br />\r\n- Ngo&agrave;i kết nối bluetooth, Loa Bluetooth Kh&ocirc;ng D&acirc;yi Vỏ Nh&ocirc;m c&ograve;n c&oacute; th&ecirc;m 2 cổng thẻ nhớ v&agrave; USB. Với trang bị cổng thẻ nhớ TF, cổng USB tr&ecirc;n th&acirc;n loa gi&uacute;p loa c&oacute; thể t&iacute;ch hợp thẻ nhớ v&agrave; USB ph&aacute;t nhạc một c&aacute;ch dễ dang.&nbsp;<br />\r\n- Loa Bluetooth Kh&ocirc;ng D&acirc;y Vỏ Nh&ocirc;m được thiết kế c&oacute; phần nhỏ hơn so với những d&ograve;ng loa charge 3 thường n&ecirc;n cũng c&oacute; phần ưu điểm hơn. Cầm kh&aacute; gọn tr&ecirc;n tay, cũng kh&aacute; nhẹ n&ecirc;n bạn c&oacute; thể mang đi chơi, đi học, đi du lịch, c&ocirc;ng t&aacute;c, cắm trại, d&atilde; ngoại đều th&iacute;ch cả nh&eacute;. Bỏ trong balo, trong cặp kh&ocirc;ng hề chiếm nhiều diện t&iacute;ch, nghe nhạc mọi l&uacute;c mọi nơi.<br />\r\nTH&Ocirc;NG SỐ KỸ THUẬT LOA BLUETOOTH<br />\r\nBộ sản phẩm gồm: 1 loa, 1 c&aacute;p sạc&nbsp;<br />\r\n&ndash; Chất liệu: nhựa, kim loại&nbsp;<br />\r\n&ndash; C&ocirc;ng suất: 12W&nbsp;<br />\r\n&ndash; Thời gian sử dụng: 3-5giờ (t&ugrave;y theo &acirc;m lượng sử dụng)&nbsp;<br />\r\n&ndash; Thời gian sạc: 1.5 - 2 giờ&nbsp;<br />\r\n&ndash; Kết nối: Bluetooth, AUX<br />\r\n&ndash; Trọng lượng:400g<br />\r\n- M&agrave;u sắc: Đỏ, Đen, Xanh dương, Xanh l&aacute;<br />\r\n*) CAM KẾT VỀ CHẤT LƯỢNG V&Agrave; DỊCH VỤ B&Aacute;N H&Agrave;NG:<br />\r\n1. H&agrave;ng thật như h&igrave;nh.<br />\r\n2. Kiểm tra h&agrave;ng trước khi thanh to&aacute;n.<br />\r\n3. Cung cấp c&aacute;c sản phẩm chất lượng ph&ugrave; hợp với gi&aacute; tiền<br />\r\n*) QUY ĐỊNH ĐỔI TRẢ:<br />\r\nSẵn s&agrave;ng đổi trả hoặc ho&agrave;n lại tiền cho kh&aacute;ch h&agrave;ng trong 48h kể từ ng&agrave;y nhận h&agrave;ng cho những l&yacute; do sau :<br />\r\n1. Sản phẩm bị lỗi.<br />\r\n2. Hư hỏng trong qu&aacute; tr&igrave;nh vận chuyển.<br />\r\n3. Kh&aacute;ch h&agrave;ng đưa ra l&yacute; do hợp l&yacute; về sự kh&ocirc;ng h&agrave;i l&ograve;ng đối với sản phẩm v&agrave; được sự đồng &yacute; từ Shop.<br />\r\nSản Phẩm bảo h&agrave;nh 3 th&aacute;ng. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;#loabluetooth #loagiare #loamini #loarobot #loabamax #PTH800 #loanghethenho #loangheusb #loacamtay #baymaxA9 #loanhogon #atstore #loakiemgiadodienthoai #loaamthanhhay #loakieudangdocla #loaxemphim#Loa bluetooth #Loa Bluetooth #Loa di động #LoaBluetooth #loabluetooth #Loabluetooth #LoaBluetooth #bluetooth #loabass #loadidong #loa #loablue #loaxachtay #blue #loaled #loaden #didong #tooth #led #wireless #loawireless #loawire #loa bluetooth #loa bluetooth</p>', 'high_speaker_1.jpg', 499000, 11, 11, 0, 0, 9, 7, NULL, 1, '2021-03-01 21:13:41', '2021-03-01 21:13:41', NULL),
(39, 'Loa karaoke bluetooth mini SD-306 loa hát karaoke đa năng,Tặng Kèm 2 Mic Không Dây - Bảo hành', '<p>Loa karaoke bluetooth mini SD-306 loa h&aacute;t karaoke đa năng,Tặng K&egrave;m 2 Mic Kh&ocirc;ng D&acirc;y - Bảo h&agrave;nh</p>\r\n\r\n<p>🎄 GIỚI THIỆU SẢN PHẨM:<br />\r\n( H&agrave;ng mới nguy&ecirc;n hộp 100%, giao h&agrave;ng to&agrave;n quốc )<br />\r\nThị trường loa bluetooth ng&agrave;y nay rất ph&aacute;t triển v&agrave; ng&agrave;y nay đ&atilde; t&iacute;ch hợp th&ecirc;m micro k&egrave;m theo loa n&ecirc;n những cuộc vui lu&ocirc;n được khai th&aacute;c tối đa. Nổi bật nhất trong số đ&oacute; ch&iacute;nh l&agrave; mẫu loa bluetooth karaoke SD-306 khi được t&iacute;ch hợp 2 loa bass v&agrave; 2 loa bass cộng hưởng gi&uacute;p &acirc;m thanh được đ&aacute;nh kh&aacute; mạnh mẽ mặc d&ugrave; k&iacute;ch thước kh&aacute; nhỏ. Đi k&egrave;m với loa l&agrave; cặp micro cao cấp. Loa bluetooth karaoke mini SD-306 rất th&iacute;ch hợp đối với c&aacute;c bạn nữ y&ecirc;u th&iacute;ch ca h&aacute;t v&igrave; loa sở hữu cho m&igrave;nh ngoại quan kh&aacute; đ&aacute;ng y&ecirc;u, loa được l&agrave;m bằng nhựa ABS cao cấp được phủ lớp sơn m&agrave;u hồng &oacute;ng &aacute;nh v&ocirc; c&ugrave;ng nữ t&iacute;nh v&agrave; c&ograve;n c&oacute; h&igrave;nh d&aacute;ng như một ch&uacute; c&uacute; m&egrave;o cau c&oacute; nữa, v&ocirc; c&ugrave;ng dễ thương !!!</p>\r\n\r\n<p>🎄TH&Ocirc;NG SỐ KỸ THUẬT LOA BLUETOOTH SD-306:2 màu:<br />\r\n_ Loa Bass: 2 loa bass 1 tấc<br />\r\n_ Micro: 2 micro cao c<br />\r\n_ Đọc USB/ SD: C&oacute;<br />\r\n_ Bluetooth: C&oacute;<br />\r\n_ Kết nối loa ngo&agrave;i: C&oacute;<br />\r\n_ Thời lượng pin: 2 - 3h&nbsp;<br />\r\n_ Thời gian sạc: 2 - 3h<br />\r\n_ Nguồn sạc: sử dụng sạc điện thoại sạc cho m&aacute;y<br />\r\n_ C&acirc;n Nặng: 2,5 kg</p>\r\n\r\n<p><br />\r\n*) CAM KẾT VỀ CHẤT LƯỢNG V&Agrave; DỊCH VỤ B&Aacute;N H&Agrave;NG:&nbsp;<br />\r\n1. H&agrave;ng thật như h&igrave;nh.&nbsp;<br />\r\n2. Kiểm tra h&agrave;ng trước khi thanh to&aacute;n.&nbsp;<br />\r\n3. Cung cấp c&aacute;c sản phẩm chất lượng&nbsp;<br />\r\n*) QUY ĐỊNH ĐỔI TRẢ: 1 ĐỔI 1 trong v&ograve;ng 7 ng&agrave;y nếu lỗi do nh&agrave; sản xuất&nbsp;<br />\r\n1. Sản phẩm bị lỗi do nh&agrave; sản xuất&nbsp;<br />\r\n2. Hư hỏng trong qu&aacute; tr&igrave;nh vận chuyển&nbsp;<br />\r\n3. Kh&aacute;ch h&agrave;ng đưa ra l&yacute; do hợp l&yacute; về sự kh&ocirc;ng h&agrave;i l&ograve;ng đối với sản phẩm v&agrave; được sự đồng &yacute; từ Shop&nbsp;<br />\r\n*) SẢN PHẨM ĐƯỢC BẢO H&Agrave;NH 6 TH&Aacute;NG</p>\r\n\r\n<p>#loa2mic #micro #mickaraoke #microkaraoke #micbluetooth &nbsp;#mickaraokebluetooth #mickhongday #mickiemloa #microkhongday #mickhongday #michatbluetooth #karaoke #michathay #michay #loa2mic #microlivetream #loa306 #michatkraoke&nbsp;</p>\r\n\r\n<p>CHẤT LƯỢNG L&Agrave; SỐ 1</p>', 'karaoke_bluetooth_1.jpg', 759000, 11, 11, 0, 0, 9, 7, NULL, 1, '2021-03-01 21:15:49', '2021-03-01 21:15:49', NULL),
(40, 'Loa Bluetooth Cao Cấp Yayuci - C7 Có Đèn LED Đổi Màu, Âm Thanh Vòm 6D, Dung Lượng Pin 1000mAh', '<p>Loa bluetooth C7 đ&egrave;n Led &acirc;m thanh v&ograve;m 6D - Loa bluetooth trong suốt si&ecirc;u bass<br />\r\nLoa bluetooth kh&ocirc;ng d&acirc;y c&oacute; đ&egrave;n led C7 trong suốt t&iacute;ch hợp đ&egrave;n Led nhiều m&agrave;u s&aacute;ng theo nhịp nhạc, mang tới cho bạn một kh&ocirc;ng gian sống sinh động v&agrave; mới mẻ. Loa bluetooth C7 , kh&ocirc;ng thể thiếu trong mỗi cuộc vui, &acirc;m thanh v&ograve;m 6D cực sống động. Kiểu d&aacute;ng gọn nhẹ với thiết kế đẹp mắt v&agrave; trẻ trung<br />\r\nDung lượng pin 600 mAh cho ph&eacute;p ph&aacute;t nhạc li&ecirc;n tục trong khoảng 2-4 giờ</p>\r\n\r\n<p>TH&Ocirc;NG &nbsp;SỐ KỸ THUẬT<br />\r\nmodel: C7<br />\r\nBluetooth: V5.0<br />\r\nC&ocirc;ng suất: 3W<br />\r\nPhạm vi kết nối: 10m<br />\r\nDung lượng pin: 600 mAh<br />\r\nThời lượng sử dụng: 2-4 giờ<br />\r\nTrọng lượng: 300g<br />\r\nThiết kế nhỏ gọn, nhẹ nh&agrave;ng, dễ cầm v&agrave; mang đi tới mọi nơi bạn muốn t&iacute;ch hợp đ&egrave;n LED nh&aacute;y s&aacute;ng theo điệu nhạc, c&oacute; thể đổi m&agrave;u rất sống động.<br />\r\nBộ sản phẩm bao gồm:<br />\r\n- 1Loa Bluetooth kh&ocirc;ng d&acirc;y c&oacute; đ&egrave;n led đổi m&agrave;u&nbsp;<br />\r\n- 1 c&aacute;p sạc<br />\r\n- 1 c&aacute;p aux &amp;amp; h&ocirc;p đựng</p>\r\n\r\n<p>CH&Iacute;NH S&Aacute;CH BẢO H&Agrave;NH<br />\r\n1.&nbsp;&nbsp; &nbsp;Ho&agrave;n đổi trả h&agrave;ng trong 3 ng&agrave;y sử dụng<br />\r\n2.&nbsp;&nbsp; &nbsp;Đổi trả h&agrave;ng trong mọi trường hợp lỗi của nh&agrave; sản xuất, rơi vỡ m&oacute;p m&eacute;o do vận chuyển<br />\r\n3.&nbsp;&nbsp; &nbsp;H&agrave;ng sai kh&ocirc;ng đ&uacute;ng m&ocirc; tả hoặc m&atilde; h&agrave;ng<br />\r\n4.&nbsp;&nbsp; &nbsp;K&ecirc;nh đổi h&agrave;ng ho&agrave;n tiền c&aacute;c bạn inbox với shop để gửi v&agrave; ho&agrave;n tiền cụ thể th&ocirc;ng qua STK ng&acirc;n h&agrave;ng<br />\r\n5.&nbsp;&nbsp; &nbsp;H&agrave;ng đổi lại y&ecirc;u cầu kh&ocirc;ng biến dạng bong tr&oacute;c ch&agrave;y sước,đủ hộp, phụ kiện kh&ocirc;ng m&oacute;p m&eacute;o<br />\r\n6.&nbsp;&nbsp; &nbsp;Ngay khi nhận được h&agrave;ng lỗi c&aacute;c Bạn gủi về shop ho&agrave;n tiền hoặc đổi mới h&agrave;ng ngay .<br />\r\nCảm ơn c&aacute;c Bạn đ&atilde; mua h&agrave;ng v&agrave; rất mong hợp t&aacute;c vui vẻ. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Mọi vấn đề thắc mắc ho&agrave;n hủy hoặc chất lượng shop hết sức hỗ trợ tr&aacute;ch nhiệm nhất xứng đ&aacute;ng chi ph&iacute; c&aacute;c bạn.</p>\r\n\r\n<p>#loa #loabluetooth #loakhongday #loabluetoothc7 #yuyasi #loamini #loadidong #loaled #loachinhhang #loaminibluetooth #loakhongday #loabluetooth #loathongminh #loa #bluetooth #loanhogon #loamini #loabluetoothmini #loacamtay #loanghenhac #loaminibluetooth #loanghenhachay #loanghenhacbluetooth #loahay #loausb #loathenho</p>', 'remote_speaker_1.jpg', 140000, 11, 11, 0, 0, 9, 5, NULL, 1, '2021-03-01 21:17:31', '2021-03-01 21:17:31', NULL),
(41, 'Máy trợ giảng không dây Aporo T9 UHF (Tặng củ sạc) có Bluetooth - Hàng chính hãng', '<p>M&aacute;y trợ giảng kh&ocirc;ng d&acirc;y nhỏ gọn APORO T9UHF &nbsp; ch&iacute;nh h&atilde;ng</p>\r\n\r\n<p>M&aacute;y trợ giảng Aporo T9 UHF d&agrave;nh cho hướng dẫn vi&ecirc;n du lịch, dạy học, b&aacute;n h&agrave;ng ngo&agrave;i trời ,thuyết tr&igrave;nh trước đ&aacute;m đ&ocirc;ng, hoạt động giải tr&iacute; ngo&agrave;i trời<br />\r\nKhả năng giao tiếp đa dạng với Line In 3.5: bạn ho&agrave;n to&agrave;n c&oacute; thể sử dụng m&aacute;y trợ giảng Aporo T9 UHF như một chiếc loa di động, với kết nối tới c&aacute;c nguồn t&iacute;n hiệu &acirc;m thanh đầu v&agrave;o như Laptop, PC, thiết bị Mobile (miễn l&agrave; hỗ trợ khe cắm 3.5mm)<br />\r\nKhả năng hoạt động bền bỉ, l&acirc;u d&agrave;i với thời gian đ&aacute;p ứng l&ecirc;n tới 10 giờ, thoải m&aacute;i v&agrave; y&ecirc;n t&acirc;m khi thực hiện những buổi thuyết tr&igrave;nh, hướng dẫn trong khoảng thời gian d&agrave;i.<br />\r\nV&ocirc; c&ugrave;ng tiện lợi khi sử dụng bởi bạn c&oacute; thể đặt m&aacute;y ở 1 vị tr&iacute; v&agrave; di chuyển ra xa trong qu&aacute; tr&igrave;nh thuyết tr&igrave;nh, hoặc c&oacute; thể mang theo bằng d&acirc;y đeo cấp theo m&aacute;y.<br />\r\nĐ&acirc;y l&agrave; d&ograve;ng sản phẩm sở hữu nhiều t&iacute;nh năng ưu việt, hy vọng sẽ đ&aacute;p ứng được nhu cầu sử dụng của qu&yacute; vị v&agrave; c&aacute;c bạn</p>\r\n\r\n<p>Đặc điểm nổi bật:<br />\r\n- Kết nối Bluetooth với điện thoại<br />\r\n- C&oacute; ghi &acirc;m b&agrave;i giảng, hỗ trợ thẻ nhớ, USB<br />\r\n- C&oacute; m&agrave;n h&igrave;nh đ&egrave;n LED hiển thị pin, trạng th&aacute;i...<br />\r\n- &Acirc;m thanh trung thực với giọng n&oacute;i thật<br />\r\n- M&aacute;y nhỏ gọn: K&iacute;ch thước 12x9x3,5cm<br />\r\n- Trọng lượng: 215gr&nbsp;<br />\r\n- Bảo h&agrave;nh ch&iacute;nh h&atilde;ng 12 th&aacute;ng<br />\r\nC&ocirc;ng suất ra 15W<br />\r\nSạc điện &aacute;p DC 5V 500mA<br />\r\nSử dụng trợ giảng 8-10 giờ<br />\r\nThời gian sạc m&aacute;y 4-6 giờ<br />\r\nThời gian sạc mic 3-4 giờ<br />\r\n&Acirc;m thanh trung thực, kh&ocirc;ng bị r&iacute;t v&agrave; r&egrave;<br />\r\nGhi &acirc;m b&agrave;i giảng, kết nối USB<br />\r\nKhoảng c&aacute;ch thu ph&aacute;t xa 20m-25m<br />\r\nM&agrave;n h&igrave;nh LCD hiển thị chức năng v&agrave; lượng pin<br />\r\nM&aacute;y si&ecirc;u nhỏ: K&iacute;ch thước 12x9x3.5cm<br />\r\nTrọng lượng si&ecirc;u nhẹ 215 Gram</p>\r\n\r\n<p>HƯỚNG DẪN SỬ DỤNG:&nbsp;</p>\r\n\r\n<p>- Bật m&aacute;y ở c&ocirc;ng tắc vặn ngay đầu m&aacute;y ph&iacute;a b&ecirc;n tr&aacute;i, vặn c&ocirc;ng tắc về hướng ON. Đồng thời c&ocirc;ng tắc n&agrave;y cũng l&agrave; c&ocirc;ng tắc tăng giảm &acirc;m lượng, vặn về ON l&agrave; tăng &acirc;m lượng, vặn về OFF l&agrave; giảm &acirc;m lượng v&agrave; tắt m&aacute;y.&nbsp;<br />\r\n-Sau đ&oacute; bật mic l&ecirc;n, đ&egrave;n mic sẽ b&aacute;o s&aacute;ng m&agrave;u xanh. Qu&yacute; kh&aacute;ch c&oacute; thể tăng giảm &acirc;m lượng của mic ở n&uacute;t bấm c&oacute; dấu (+) v&agrave; (-)<br />\r\n-Sau khi bật m&aacute;y v&agrave; mic, ch&uacute;ng sẽ tự động kết nối với nhau l&agrave; bạn c&oacute; thể sử dụng.<br />\r\n-M&aacute;y c&oacute; thể ph&aacute;t từ USB v&agrave; Thẻ nhớ ra loa, qu&yacute; kh&aacute;ch chỉ cần gắn USB hoặc Thẻ nhớ v&agrave;o m&aacute;y cũng sẽ tự động ph&aacute;t. Qu&yacute; kh&aacute;ch c&oacute; thể sử dụng c&aacute;c n&uacute;t bấm tr&ecirc;n m&aacute;y để chuyển b&agrave;i, l&ugrave;i b&agrave;i hoặc tạm dừng&nbsp;<br />\r\n- Để sử dụng chức năng ghi &acirc;m, qu&yacute; kh&aacute;ch gắn USB hoặc Thẻ nhớ v&agrave;o m&aacute;y, sau đỏ bấm n&uacute;t REC để bắt đầu ghi &acirc;m. Ghi &acirc;m xong bấm n&uacute;t REC để kết th&uacute;c, m&aacute;y sẽ tự động ph&aacute;t File ghi &acirc;m v&agrave; tự động lưu trong USB hoặc thẻ nhớ<br />\r\n- Khi m&agrave;n h&igrave;nh m&aacute;y hiển thị chữ UHF ( tức l&agrave; chế độ sử dụng micro kh&ocirc;ng d&acirc;y), nếu qu&yacute; kh&aacute;ch muốn chuyển sang chế độ micro c&oacute; d&acirc;y chỉ cần bấm n&uacute;t M ở m&aacute;y th&igrave; m&agrave;n h&igrave;nh m&aacute;y sẽ chuyển sang hiển thị chữ SP ( tức chế độ sử dụng micro c&oacute; d&acirc;y)</p>\r\n\r\n<p>LƯU &Yacute;</p>\r\n\r\n<p>Trong trường hợp micro v&agrave; loa bị cạn pin đến mức tự tắt hoặc mic bị qu&ecirc;n s&oacute;ng, 2 thiết bị n&agrave;y sẽ bị mất kết nối t&iacute;n hiệu s&oacute;ng. Để c&oacute; thể kết nối lại, mời qu&yacute; kh&aacute;ch thực hiện c&aacute;c bước dưới đ&acirc;y:<br />\r\n- Bật mic l&ecirc;n, nhấn v&agrave; giữ n&uacute;t bấm c&oacute; chữ M ở giữa mic khoảng 3-5 gi&acirc;y, khi đ&egrave;n b&aacute;o ở mic nhấp nh&aacute;y th&igrave; thả tay<br />\r\n- Bật m&aacute;y l&ecirc;n đợi khoảng 5 gi&acirc;y đến khi đ&egrave;n b&aacute;o ở mic v&agrave; chữ UHF tr&ecirc;n m&agrave;n h&igrave;nh m&aacute;y đứng y&ecirc;n.</p>', 'teaching_assistant_1.jpg', 699000, 11, 11, 0, 0, 9, 5, NULL, 1, '2021-03-01 21:19:30', '2021-03-01 21:19:30', NULL),
(42, 'CHỌN BỘ HÁT THU ÂM KARAOKE BM900-XOX K10 2020 TẶI TAI CHỤP BH 6 tháng', '<p>Mic livestream WOAICHANG bm900 Sound Card XOX K10 2020 ch&acirc;n m&agrave;ng đ&atilde; c&oacute; d&acirc;y live stream- Bộ mic thu &acirc;m sound card k10 2020.<br />\r\n1. GIỚI THIỆU BM900<br />\r\n- Micro thu &acirc;m BM-900 l&agrave; micro ph&acirc;n kh&uacute;c gi&aacute; dưới 1 triệu d&agrave;nh cho C&aacute;c bạn trẻ sở hữu niềm say m&ecirc; ca h&aacute;t, phục vụ cho c&aacute;c Streamer tr&ecirc;n c&aacute;c k&ecirc;nh như TalkTV, IdolTV, Twitch,.... H&aacute;t tr&ecirc;n mobile như Bigo Live, Palktalk. Gi&aacute; cực rẻ chỉ , chất lượng thu &acirc;m phải chăng kh&ocirc;ng k&eacute;m c&aacute;c micro cao cấp, kết nối trực tiếp m&aacute;y t&iacute;nh gi&uacute;p bạn thu &acirc;m một phương ph&aacute;p dễ d&agrave;ng. Micro BM900 l&agrave; tuyển lựa rẻ nhất cho bạn. Khi bạn muốn l&ecirc;n th&igrave; micro thu &acirc;m nay chưa đủ bạn cần phải cần c&oacute; một Sound Card. Micro thu &acirc;m sẽ kết nối Soundcard cho giọng n&oacute;i bạn ấm hơn, dễ d&agrave;ng thay đổi rộng r&atilde;i hiệu ứng &acirc;m thanh kh&aacute;c nhau để th&iacute;ch hợp sở hữu giọng h&aacute;t của m&igrave;nh, v&igrave; &acirc;m thanh sau khi qua Sound card sẽ được xử l&yacute; ho&agrave;n to&agrave;n v&agrave; chuyển qua t&iacute;n hiệu băng tần (analog) gi&uacute;p &acirc;m thanh ch&acirc;n thực v&agrave; gần như &acirc;m sắc.</p>\r\n\r\n<p>2. TRỌN BỘ SẢN PHẨM BM900 &nbsp;- SOUND CARD XOX K10 2020<br />\r\n1- Micro BM-900 &nbsp;(bm900 , b&ocirc;ng mic , shockmout , d&acirc;y mic)<br />\r\n2- K10 ( d&acirc;y 2 đầu 3.5 , d&acirc;y nguồn , d&acirc;y live stream)<br />\r\n3- Ch&acirc;n gi&aacute;&nbsp;<br />\r\n4- &nbsp;Lọc&nbsp;</p>\r\n\r\n<p>3. TH&Ocirc;NG SỐ BM900<br />\r\nModel: BM-900<br />\r\nH&atilde;ng sản xuất: WOAICHANG<br />\r\nGiải tần &acirc;m thanh: 40Hz ~ 18Khz<br />\r\nĐiện trở suất: 600Omh + 30% (At 1Khz)<br />\r\nK&iacute;ch thước: D&agrave;i 17,5cm; Rộng 4,4Cm<br />\r\nĐộ nhạy: -46+- 3db<br />\r\nĐiện trở kh&aacute;ng tối đa: &amp;gt;= 1000Omh<br />\r\nTần số tạp &acirc;m: 18db SPL<br />\r\nChịu được tạp &acirc;m tối đa: 135db<br />\r\nTần số h&oacute;a: 76db<br />\r\nTrọng lượng: 0,395Kg<br />\r\nM&agrave;u sắc: Trắng, Xanh, Bạc, Đen</p>\r\n\r\n<p>4. TH&Ocirc;NG SỐ KỸ THUẬT SOUND CARD XOX K10 2020&nbsp;<br />\r\nThương hiệu : XOX<br />\r\nModen : k10 2020<br />\r\nFXS Reverb K&ecirc;nh: 2 IN / 2 OUT&nbsp;<br />\r\nGhi: 16bit / 44. 1KHZ, 90dB (Tối đa)&nbsp;<br />\r\nPh&aacute;t lại: 16bit / 44. 1KHZ, 100dB (Tối đa)&nbsp;<br />\r\nBiến dạng: &amp;lt;0. &nbsp;1% (ghi &acirc;m), &amp;lt;0. &nbsp;005% (ph&aacute;t lại)<br />\r\n&nbsp;C&ocirc;ng suất đầu ra tối đa: 500mW (tai nghe)<br />\r\n&nbsp;C&ocirc;ng suất tổng thể: &amp;lt;1. &nbsp;5W<br />\r\n&nbsp;Điện &aacute;p / d&ograve;ng điện: V / 0. 3A (MAX)&nbsp;<br />\r\nK&iacute;ch thước: 190mmx130mmx55mm. &nbsp;<br />\r\nTrọng lượng: 415g<br />\r\nXuất sứ : China</p>\r\n\r\n<p>5. BẢO H&Agrave;NH<br />\r\n-&nbsp;&nbsp; &nbsp;Tai nghe b&ecirc;n shop bảo h&agrave;nh 06 &nbsp;th&aacute;ng &ldquo; Sản phẩm phải c&oacute; đầy đủ v&agrave; phụ kiện với vỏ hộp , kh&ocirc;ng được trầy xước &rdquo; Th&igrave; mới được bảo h&agrave;nh .<br />\r\n-&nbsp;&nbsp; &nbsp;B&ecirc;n shop hỗ trợ vận chuyển trong v&ograve;ng 1 tuần t&iacute;nh từ ng&agrave;y mua.<br />\r\n-&nbsp;&nbsp; &nbsp;Hỗ trợ vận chuyển 1 chiều trong v&ograve;ng 1 th&aacute;ng .<br />\r\n-&nbsp;&nbsp; &nbsp;H&agrave;ng điện tử c&oacute; 1% lỗi n&ecirc;n nhiều khi kh&aacute;ch h&agrave;ng th&ocirc;ng cảm.</p>', 'combo_karaoke_1.jpg', 1095000, 11, 11, 0, 0, 9, 6, NULL, 1, '2021-03-01 21:20:26', '2021-03-01 21:20:26', NULL),
(43, 'Smart Tivi Samsung 4K 49 inch UA49RU7300KXXV', '<p>Th&ocirc;ng tin sản phẩm :&nbsp;<br />\r\nĐặc điểm nổi bật Smart Tivi Samsung 4K 49 inch UA49RU7300KXXV.<br />\r\nSmart tivi Samsung 4K 49 inch UA49RU7300KXXV sở hữu thiết kế viền si&ecirc;u mỏng, vẻ đẹp tự nhi&ecirc;n mang đến sự phong c&aacute;ch, tinh tế cho gian ph&ograve;ng được bố tr&iacute;. M&agrave;n h&igrave;nh cong của tivi mang đến sự thoải m&aacute;i, bao tr&ugrave;m ở mọi g&oacute;c nh&igrave;n, hướng sự tập trung tuyệt đối của người xem.<br />\r\nĐộ ph&acirc;n giải 4K hiển thị sắc n&eacute;t gấp 4 lần Full HD. C&ocirc;ng nghệ m&agrave;n h&igrave;nh PurColor thể hiện dải m&agrave;u sắc rộng, ch&acirc;n thực hơn. Tăng cường độ tương phản hiệu quả, m&agrave;u sắc rực rỡ hơn với c&ocirc;ng nghệ HDR<br />\r\nC&ocirc;ng nghệ UHD Dimming t&aacute;i hiện v&ugrave;ng s&aacute;ng nổi bật, v&ugrave;ng tối s&acirc;u hơn<br />\r\nTối ưu độ s&aacute;ng, chi tiết r&otilde; r&agrave;ng hơn ở c&aacute;c khung h&igrave;nh tối với c&ocirc;ng nghệ Dynamic Crystal Ratio<br />\r\n&Acirc;m thanh lan toả, chất &acirc;m l&ocirc;i cuốn đến từ c&ocirc;ng nghệ Dolby Digital Plus<br />\r\nTivi Samsung với c&ocirc;ng suất loa 20W, &acirc;m thanh ch&iacute;nh x&aacute;c, l&ocirc;i cuốn khiến những bản nhạc, bộ phim h&agrave;nh động trở n&ecirc;n ch&acirc;n thực, sống động hơn bao giờ hết.<br />\r\nKho ứng dụng phong ph&uacute; đủ nhiều thể loại giải tr&iacute; phổ biến hiện nay, gi&uacute;p bạn c&oacute; những ph&uacute;t gi&acirc;y thư giản trọn vẹn, thoải m&aacute;i b&ecirc;n người th&acirc;n, bạn b&egrave;.<br />\r\nTh&ocirc;ng số kỹ thuật chi tiết Smart Tivi Samsung 4K 49 inch UA49RU7300KXXV :&nbsp;<br />\r\nLoại Tivi: &nbsp;Smart Tivi<br />\r\nK&iacute;ch cỡ m&agrave;n h&igrave;nh: &nbsp;49 inch<br />\r\nĐộ ph&acirc;n giải: &nbsp;Ultra HD 4K<br />\r\nKết nối<br />\r\nBluetooth: &nbsp;C&oacute; (b&agrave;n ph&iacute;m, loa)<br />\r\nKết nối Internet: &nbsp;Cổng LAN, Wifi<br />\r\nCổng AV: &nbsp;C&oacute; cổng Composite v&agrave; cổng Component<br />\r\nCổng HDMI: &nbsp;3 cổng<br />\r\nCổng xuất &acirc;m thanh: &nbsp;Cổng Optical (Digital Audio Out), Cổng Coaxial out, HDMI ARC<br />\r\nUSB: &nbsp;2 cổng<br />\r\nT&iacute;ch hợp đầu thu kỹ thuật số: &nbsp;DVB-T2<br />\r\nHệ điều h&agrave;nh, giao diện: &nbsp;Tizen OS<br />\r\nC&aacute;c ứng dụng sẵn c&oacute;: &nbsp;Youtube, Netflix, Tr&igrave;nh duyệt web, Kho ứng dụng<br />\r\nC&aacute;c ứng dụng phổ biến c&oacute; thể tải th&ecirc;m: &nbsp;FPT Play, Fim+, Benthanh Karaoke, Spotify, MyTV, ClipTV, Zing TV<br />\r\nRemote th&ocirc;ng minh: &nbsp;Kh&ocirc;ng d&ugrave;ng được<br />\r\nĐiều khiển tivi bằng điện thoại: &nbsp;Bằng ứng dụng SmartThings<br />\r\nKết nối kh&ocirc;ng d&acirc;y với điện thoại, m&aacute;y t&iacute;nh bảng: &nbsp;Chiếu m&agrave;n h&igrave;nh Screen Mirroring<br />\r\nKết nối B&agrave;n ph&iacute;m, chuột: &nbsp;C&oacute; thể kết nối (sử dụng tốt nhất trong tr&igrave;nh duyệt web)<br />\r\nC&ocirc;ng nghệ h&igrave;nh ảnh, &acirc;m thanh<br />\r\nC&ocirc;ng nghệ h&igrave;nh ảnh: &nbsp;Game mode, UHD Dimming, PurColor, HDR, Dynamic Contrast Ratio, Contrast Enhancer<br />\r\nTần số qu&eacute;t thực: &nbsp;60 Hz<br />\r\nC&ocirc;ng nghệ &acirc;m thanh: &nbsp;Dolby Digital Plus<br />\r\nTổng c&ocirc;ng suất loa: &nbsp;20 W<br />\r\n***KH&Ocirc;NG VOICE SREACH + ON REMOTE</p>\r\n\r\n<p><br />\r\nTh&ocirc;ng tin chung Smart Tivi Samsung 4K 49 inch UA49RU7300KXXV<br />\r\nC&ocirc;ng suất: &nbsp;130 W<br />\r\nK&iacute;ch thước c&oacute; ch&acirc;n, đặt b&agrave;n: &nbsp;Ngang 110.15 cm - Cao 71.74 cm - D&agrave;y 26.13 cm<br />\r\nKhối lượng c&oacute; ch&acirc;n: &nbsp;13.7 kg<br />\r\nK&iacute;ch thước kh&ocirc;ng ch&acirc;n, treo tường: &nbsp;Ngang 110.15 cm - Cao 63.85 cm - D&agrave;y 9.57 cm<br />\r\nKhối lượng kh&ocirc;ng ch&acirc;n: &nbsp;13.3 kg<br />\r\nChất liệu: &nbsp;Viền nhựa, ch&acirc;n đế nhựa</p>\r\n\r\n<p>Th&ocirc;ng tin bảo h&agrave;nh Smart Tivi Samsung 4K 49 inch UA49RU7300KXXV<br />\r\nBộ sản phẩm bao gồm: &nbsp;Tivi, Ch&acirc;n đế, Adapter, Remote<br />\r\nBảo h&agrave;nh 24 th&aacute;ng.<br />\r\nTrung t&acirc;m bảo h&agrave;nh: &nbsp;https: &nbsp; &nbsp; &nbsp; &nbsp;//www.samsung.com/vn/support/service-center/<br />\r\nHotline: &nbsp;1800-588-855<br />\r\n#Samsung &nbsp; &nbsp;#UA49RU7300KXXV &nbsp; #SmartTV &nbsp; #49inch &nbsp; #4K<br />\r\nC&ocirc;ng lắp đặt: Miễn ph&iacute; cho nội th&agrave;nh HN (12 quận: Quận Ba Đ&igrave;nh, Quận Bắc Từ Li&ecirc;m, Quận Cầu Giấy, Quận H&agrave; Đ&ocirc;ng, Quận Hai B&agrave; Trưng, Quận Ho&agrave;n Kiếm, Quận Ho&agrave;ng Mai, Quận Long Bi&ecirc;n, Quận Nam Từ Li&ecirc;m, Quận T&acirc;y Hồ, Quận Thanh Xu&acirc;n, Quận Đống Đa) v&agrave;<br />\r\nnội th&agrave;nh HCM (Trừ Nh&agrave; B&egrave;, B&igrave;nh Ch&aacute;nh, Cần Giờ, Củ Chi).<br />\r\n- Chi ph&iacute; vật tư: Nh&acirc;n vi&ecirc;n sẽ th&ocirc;ng b&aacute;o ph&iacute; vật tư (ống đồng, d&acirc;y điện v.v...) khi khảo s&aacute;t lắp đặt (Bảng k&ecirc; xem tại ảnh 2). Kh&aacute;ch h&agrave;ng sẽ thanh to&aacute;n trực tiếp cho nh&acirc;n vi&ecirc;n kỹ thuật sau khi việc lắp đặt ho&agrave;n th&agrave;nh - chi ph&iacute; n&agrave;y sẽ kh&ocirc;ng ho&agrave;n lại trong bất cứ trường hợp n&agrave;o.<br />\r\n- Thời gian li&ecirc;n hệ lắp đặt: 24h kể từ khi nhận h&agrave;ng (Trừ Chủ nhật/ Ng&agrave;y Lễ).<br />\r\n- Quy định đổi trả: Chỉ đổi/trả sản phẩm, từ chối nhận h&agrave;ng tại thời điểm nhận h&agrave;ng trong trường hợp sản phẩm giao đến kh&ocirc;ng c&ograve;n nguy&ecirc;n vẹn, thiếu phụ kiện hoặc nhận được sai h&agrave;ng. Khi sản phẩm đ&atilde; được cắm điện sử dụng v&agrave;/hoặc lắp đặt, v&agrave; gặp lỗi kĩ thuật, sản phẩm sẽ được hưởng chế độ bảo h&agrave;nh theo đ&uacute;ng ch&iacute;nh s&aacute;ch của nh&agrave; sản xuất<br />\r\n- Qu&yacute; kh&aacute;ch h&agrave;ng c&oacute; thể tr&igrave; ho&atilde;n việc lắp đặt tối đa l&agrave; 7 ng&agrave;y lịch kể từ ng&agrave;y giao h&agrave;ng th&agrave;nh c&ocirc;ng (kh&ocirc;ng t&iacute;nh ng&agrave;y Lễ). Nếu nh&acirc;n vi&ecirc;n hỗ trợ kh&ocirc;ng thể li&ecirc;n hệ được với Kh&aacute;ch h&agrave;ng qu&aacute; 3 lần, hoặc Kh&aacute;ch h&agrave;ng tr&igrave; ho&atilde;n việc lắp đặt qu&aacute; thời hạn tr&ecirc;n, Dịch vụ lắp đặt sẽ được hủy bỏ.<br />\r\n- Đơn vị vận chuyển giao h&agrave;ng cho bạn KH&Ocirc;NG c&oacute; nghiệp vụ lắp đặt sản phẩm. Đơn vị lắp đặt sẽ li&ecirc;n hệ bạn trong v&ograve;ng 24h khi bạn nhận h&agrave;ng!<br />\r\n- Khi sản phẩm đ&atilde; được cắm điện sử dụng v&agrave;/hoặc lắp đặt, v&agrave; gặp lỗi kĩ thuật, sản phẩm sẽ được hưởng chế độ bảo h&agrave;nh theo đ&uacute;ng ch&iacute;nh s&aacute;ch của nh&agrave; sản xuất</p>', 'tivi_samsung_1.png', 8590000, 3, 3, 0, 0, 9, 9, NULL, 1, '2021-03-01 21:22:06', '2021-03-01 21:22:06', NULL),
(44, 'Smart Tivi TCL 4K 43 inch L43U50 - Hàng Chính Hãng', '<p>Smart Tivi TCL 4K 43 inch &nbsp;L43U50</p>\r\n\r\n<p><br />\r\nTh&ocirc;ng tin nổi bật<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Thiết kế hiện đại, trẻ trung, m&agrave;n h&igrave;nh lớn 43 inch.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Hệ điều h&agrave;nh TV+ OS dễ sử dụng, kho ứng dụng phong ph&uacute;.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Độ ph&acirc;n giải 4K cực kỳ sắc n&eacute;t.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;C&ocirc;ng nghệ HDR v&agrave; Micro Dimming gi&uacute;p tối ưu h&igrave;nh ảnh v&agrave; độ tương phản.<br />\r\n&bull;&nbsp;&nbsp; &nbsp; &Acirc;m thanh v&ograve;m Dolby tạo hiệu ứng sống động.<br />\r\n&bull;&nbsp;&nbsp; &nbsp;Điều khiển tivi bằng ứng dụng T-Cast.</p>\r\n\r\n<p>Th&ocirc;ng Tin chi tiết<br />\r\nThiết kế hiện đại trẻ trung<br />\r\nSmart Tivi TCL 4K 43 inch &nbsp;L43U50 sở hữu m&agrave;n h&igrave;nh 43 inch độ ph&acirc;n giải UHD 4K, tr&igrave;nh chiếu những nội dung sắc n&eacute;t. Viền m&agrave;n h&igrave;nh thiết kế mỏng ph&ugrave; hợp nhiều kh&ocirc;ng gian nội thất kh&aacute;c nhau.<br />\r\nC&ocirc;ng nghệ h&igrave;nh ảnh<br />\r\nĐộ ph&acirc;n giải Ultra HD 4K v&ocirc; c&ugrave;ng sắc n&eacute;t, gấp 4 lần so với chuẩn Full HD th&ocirc;ng thường, kết hợp c&ocirc;ng nghệ HDR gi&uacute;p tăng cường độ tương phản, h&igrave;nh ảnh trở n&ecirc;n sắc n&eacute;t hơn.<br />\r\nTV TCL natural UHD sử dụng c&ocirc;ng nghệ n&acirc;ng cấp h&igrave;nh ảnh 2K-4K độc quyền, gi&uacute;p nguồn FHD c&oacute; thể được n&acirc;ng cấp l&ecirc;n mức 4K tuyệt đẹp - v&agrave; độ trung thực h&igrave;nh ảnh cao hơn 90% - từ đ&oacute; mang lại h&igrave;nh ảnh độ ph&acirc;n giải cao tuyệt vời.<br />\r\nC&ocirc;ng nghệ &acirc;m thanh<br />\r\nTrang bị c&ocirc;ng nghệ &acirc;m thanh Dolby MS12 tạo hiệu ứng &acirc;m thanh v&ograve;m sống động, cung cấp &acirc;m thanh v&ograve;m 5.1 tuyệt vời với bộ giải m&atilde; Dolby gi&uacute;p tối ưu h&oacute;a chất lượng &acirc;m thanh của TV.<br />\r\nHệ điều h&agrave;nh TV+ OS th&ocirc;ng minh<br />\r\nSmart tivi TCL được trang bị hệ điều h&agrave;nh TV+ OS dễ sử dụng, kho ứng dụng phong ph&uacute; với đầy đủ c&aacute;c ứng dụng xem phim giải tr&iacute; như: ClipTV, Youtube, FPT Play, Netflix,...<br />\r\nĐiều khiển tivi tiện lợi bằng ứng dụng T-Cast<br />\r\nCổng kết nối đa dạng</p>\r\n\r\n<p><br />\r\nTh&ocirc;ng số kỹ thuật Smart Tivi TCL 4K 43 inch L43U50</p>\r\n\r\n<p>Tổng quan<br />\r\nLoại Tivi: Smart Tivi<br />\r\nK&iacute;ch cỡ m&agrave;n h&igrave;nh: 43 inch<br />\r\nĐộ ph&acirc;n giải: Ultra HD 4K</p>\r\n\r\n<p>Kết nối<br />\r\nBluetooth: C&oacute; (kết nối loa bluetooth)<br />\r\nKết nối Internet: Cổng LAN, Wifi<br />\r\nCổng AV: C&oacute; cổng Composite v&agrave; cổng Component<br />\r\nCổng HDMI: 3 cổng<br />\r\nCổng xuất &acirc;m thanh: Cổng Optical (Digital Audio Out), Jack loa 3.5 mm, HDMI ARC<br />\r\nUSB: 1 cổng<br />\r\nT&iacute;ch hợp đầu thu kỹ thuật số: DVB-T2</p>\r\n\r\n<p>T&iacute;nh năng th&ocirc;ng minh<br />\r\nHệ điều h&agrave;nh, giao diện:TV+ OS<br />\r\nC&aacute;c ứng dụng sẵn c&oacute;:Youtube, Netflix, Tr&igrave;nh duyệt web, kho ứng dụng<br />\r\nC&aacute;c ứng dụng phổ biến c&oacute; thể tải th&ecirc;m:Zing TV, HTV, FPT Play, ClipTV, MyTV<br />\r\nRemote th&ocirc;ng minh:Kh&ocirc;ng d&ugrave;ng được<br />\r\nĐiều khiển tivi bằng điện thoại:Bằng ứng dụng T-Cast<br />\r\nKết nối B&agrave;n ph&iacute;m, chuột: C&oacute;</p>\r\n\r\n<p>C&ocirc;ng nghệ h&igrave;nh ảnh, &acirc;m thanh<br />\r\nC&ocirc;ng nghệ h&igrave;nh ảnh: Micro Dimming, HDR<br />\r\nTần số qu&eacute;t thực: 60 Hz<br />\r\nC&ocirc;ng nghệ &acirc;m thanh:Dolby MS12<br />\r\nTổng c&ocirc;ng suất loa:16 W&nbsp;</p>\r\n\r\n<p><br />\r\nTh&ocirc;ng tin chung<br />\r\nC&ocirc;ng suất: 80 W<br />\r\nK&iacute;ch thước c&oacute; ch&acirc;n, đặt b&agrave;n:Ngang 97 cm- Cao 61.8 cm - D&agrave;y 21.9 cm<br />\r\nKhối lượng c&oacute; ch&acirc;n: 7,5 Kg<br />\r\nK&iacute;ch thước kh&ocirc;ng ch&acirc;n, treo tường:Ngang 97 cm- Cao 56.7 cm - D&agrave;y 7.56cm<br />\r\nKhối lượng kh&ocirc;ng ch&acirc;n: 7.4 Kg<br />\r\nChất liệu: Viền nhựa, ch&acirc;n đế nhựa</p>\r\n\r\n<p>Th&ocirc;ng tin bảo h&agrave;nh:<br />\r\nBảo h&agrave;nh ch&iacute;nh h&atilde;ng 36 th&aacute;ng<br />\r\nChi tiết xem tại: https://www.tcl.com/vn/vi/services.html<br />\r\nHotline: &nbsp;1800-588-880 (xử l&yacute; trong v&ograve;ng 24 giờ - miễn cước ph&iacute;)</p>\r\n\r\n<p>C&ocirc;ng lắp đặt: Miễn ph&iacute; cho nội th&agrave;nh HN (12 quận: Quận Ba Đ&igrave;nh, Quận Bắc Từ Li&ecirc;m, Quận Cầu Giấy, Quận H&agrave; Đ&ocirc;ng, Quận Hai B&agrave; Trưng, Quận Ho&agrave;n Kiếm, Quận Ho&agrave;ng Mai, Quận Long Bi&ecirc;n, Quận Nam Từ Li&ecirc;m, Quận T&acirc;y Hồ, Quận Thanh Xu&acirc;n, Quận Đống Đa) v&agrave;<br />\r\nnội th&agrave;nh HCM (Trừ Nh&agrave; B&egrave;, B&igrave;nh Ch&aacute;nh, Cần Giờ, Củ Chi).<br />\r\n- Chi ph&iacute; vật tư: Nh&acirc;n vi&ecirc;n sẽ th&ocirc;ng b&aacute;o ph&iacute; vật tư (ống đồng, d&acirc;y điện v.v...) khi khảo s&aacute;t lắp đặt (Bảng k&ecirc; xem tại ảnh 2). Kh&aacute;ch h&agrave;ng sẽ thanh to&aacute;n trực tiếp cho nh&acirc;n vi&ecirc;n kỹ thuật sau khi việc lắp đặt ho&agrave;n th&agrave;nh - chi ph&iacute; n&agrave;y sẽ kh&ocirc;ng ho&agrave;n lại trong bất cứ trường hợp n&agrave;o.<br />\r\n- Thời gian li&ecirc;n hệ lắp đặt: 24h kể từ khi nhận h&agrave;ng (Trừ Chủ nhật/ Ng&agrave;y Lễ).<br />\r\n- Quy định đổi trả: Chỉ đổi/trả sản phẩm, từ chối nhận h&agrave;ng tại thời điểm nhận h&agrave;ng trong trường hợp sản phẩm giao đến kh&ocirc;ng c&ograve;n nguy&ecirc;n vẹn, thiếu phụ kiện hoặc nhận được sai h&agrave;ng. Khi sản phẩm đ&atilde; được cắm điện sử dụng v&agrave;/hoặc lắp đặt, v&agrave; gặp lỗi kĩ thuật, sản phẩm sẽ được hưởng chế độ bảo h&agrave;nh theo đ&uacute;ng ch&iacute;nh s&aacute;ch của nh&agrave; sản xuất<br />\r\n- Qu&yacute; kh&aacute;ch h&agrave;ng c&oacute; thể tr&igrave; ho&atilde;n việc lắp đặt tối đa l&agrave; 7 ng&agrave;y lịch kể từ ng&agrave;y giao h&agrave;ng th&agrave;nh c&o