ph&iacute; n&agrave;y sẽ kh&ocirc;ng ho&agrave;n lại trong bất cứ trường hợp n&agrave;o.<br />\r\n- Thời gian li&ecirc;n hệ lắp đặt: 24h kể từ khi nhận h&agrave;ng (Trừ Chủ nhật/ Ng&agrave;y Lễ).<br />\r\n- Quy định đổi trả: Chỉ đổi/trả sản phẩm, từ chối nhận h&agrave;ng tại thời điểm nhận h&agrave;ng trong trường hợp sản phẩm giao đến kh&ocirc;ng c&ograve;n nguy&ecirc;n vẹn, thiếu phụ kiện hoặc nhận được sai h&agrave;ng. Khi sản phẩm đ&atilde; được cắm điện sử dụng v&agrave;/hoặc lắp đặt, v&agrave; gặp lỗi kĩ thuật, sản phẩm sẽ được hưởng chế độ bảo h&agrave;nh theo đ&uacute;ng ch&iacute;nh s&aacute;ch của nh&agrave; sản xuất<br />\r\n- Qu&yacute; kh&aacute;ch h&agrave;ng c&oacute; thể tr&igrave; ho&atilde;n việc lắp đặt tối đa l&agrave; 7 ng&agrave;y lịch kể từ ng&agrave;y giao h&agrave;ng th&agrave;nh c&ocirc;ng (kh&ocirc;ng t&iacute;nh ng&agrave;y Lễ). Nếu nh&acirc;n vi&ecirc;n hỗ trợ kh&ocirc;ng thể li&ecirc;n hệ được với Kh&aacute;ch h&agrave;ng qu&aacute; 3 lần, hoặc Kh&aacute;ch h&agrave;ng tr&igrave; ho&atilde;n việc lắp đặt qu&aacute; thời hạn tr&ecirc;n, Dịch vụ lắp đặt sẽ được hủy bỏ.<br />\r\n- Đơn vị vận chuyển giao h&agrave;ng cho bạn KH&Ocirc;NG c&oacute; nghiệp vụ lắp đặt sản phẩm. Đơn vị lắp đặt sẽ li&ecirc;n hệ bạn trong v&ograve;ng 24h khi bạn nhận h&agrave;ng!<br />\r\n- Khi sản phẩm đ&atilde; được cắm điện sử dụng v&agrave;/hoặc lắp đặt, v&agrave; gặp lỗi kĩ thuật, sản phẩm sẽ được hưởng chế độ bảo h&agrave;nh theo đ&uacute;ng ch&iacute;nh s&aacute;ch của nh&agrave; sản xuất</p>', 'tivi_led_1.png', 2690000, 8, 8, 0, 0, 9, 10, NULL, 1, '2021-03-01 21:27:16', '2021-03-01 21:27:16', NULL),
(47, 'Smart Tivi TCL 4K 50 inch L50U50 - Hàng Chính Hãng BOX HDR. Micro Dimming, Dolby, T-cast - Tivi giá rẻ chất lượng', '<p>Thiết kế hiện đại trẻ trung<br />\r\nSmart Tivi TCL 4K 50 inch L50U50 sở hữu m&agrave;n h&igrave;nh 50 inch độ ph&acirc;n giải UHD 4K, tr&igrave;nh chiếu những nội dung sắc n&eacute;t. Viền m&agrave;n h&igrave;nh thiết kế mỏng ph&ugrave; hợp nhiều kh&ocirc;ng gian nội thất kh&aacute;c nhau.<br />\r\nSản phẩm g&acirc;y ấn tượng với kiểu d&aacute;ng hiện đại, sang trọng c&ugrave;ng khung viền mỏng kiểu c&aacute;ch sẽ l&agrave; điểm nhấn nội thất đắt gi&aacute; cho mọi ng&ocirc;i nh&agrave;. Ch&acirc;n đế tivi h&igrave;nh chữ V dạng rời kết hợp với t&ocirc;ng m&agrave;u đen trung t&iacute;nh c&agrave;ng tăng th&ecirc;m vẻ thẩm mỹ cho tivi TCL 50 inch n&agrave;y, d&ugrave; treo tường ở ph&ograve;ng họp hay để b&agrave;n tr&ecirc;n ph&ograve;ng kh&aacute;ch đều ph&ugrave; hợp.<br />\r\nN&acirc;ng cấp h&igrave;nh ảnh l&ecirc;n độ ph&acirc;n giải 4K<br />\r\nĐộ ph&acirc;n giải Ultra HD 4K v&ocirc; c&ugrave;ng sắc n&eacute;t, gấp 4 lần so với chuẩn Full HD th&ocirc;ng thường, kết hợp c&ocirc;ng nghệ HDR gi&uacute;p tăng cường độ tương phản, h&igrave;nh ảnh trở n&ecirc;n sắc n&eacute;t hơn.<br />\r\nTV TCL natural UHD sử dụng c&ocirc;ng nghệ n&acirc;ng cấp h&igrave;nh ảnh 2K-4K độc quyền, gi&uacute;p nguồn FHD c&oacute; thể được n&acirc;ng cấp l&ecirc;n mức 4K tuyệt đẹp - v&agrave; độ trung thực h&igrave;nh ảnh cao hơn 90% - từ đ&oacute; mang lại h&igrave;nh ảnh độ ph&acirc;n giải cao tuyệt vời.<br />\r\nC&ocirc;ng nghệ h&igrave;nh ảnh Micro Dimming cho h&igrave;nh ảnh sắc n&eacute;t<br />\r\nTrang bị c&ocirc;ng nghệ &acirc;m thanh Dolby MS12 tạo hiệu ứng &acirc;m thanh v&ograve;m sống động, cung cấp &acirc;m thanh v&ograve;m 5.1 tuyệt vời với bộ giải m&atilde; Dolby gi&uacute;p tối ưu h&oacute;a chất lượng &acirc;m thanh của TV.<br />\r\nNgo&agrave;i ra loa c&oacute; tổng c&ocirc;ng suất 2 loa l&ecirc;n đến 16W, chất &acirc;m t&aacute;i hiện ch&iacute;nh x&aacute;c c&ugrave;ng hiệu ứng nổi bật, bao tr&ugrave;m kh&ocirc;ng gian căn ph&ograve;ng, hứa hẹn mang đến những ph&uacute;t gi&acirc;y xem phim, nghe nhạc th&ecirc;m phần l&ocirc;i cuốn, hấp dẫn hơn.<br />\r\nSmart tivi TCL được trang bị hệ điều h&agrave;nh TV+ OS dễ sử dụng. Trang bị kho ứng dụng đa dạng nhiều thể loại phổ biến như: ClipTV, Youtube, FPT Play, Netflix, v&agrave; c&ograve;n nhiều ứng dụng kh&aacute;c c&oacute; thể tải về nữa, gi&uacute;p bạn c&oacute; những trải nghi&ecirc;m giải tr&iacute; thoải m&aacute;i, trọn vẹn.</p>\r\n\r\n<p>Th&ocirc;ng số kỹ thuật:<br />\r\nThương hiệu: TCL<br />\r\nSản xuất tại: Việt Nam<br />\r\nLoại Tivi: Smart tivi<br />\r\nKich thước sản phẩm: 1265 x 133 x 806<br />\r\nTần số qu&eacute;t: 60Hz<br />\r\nXem 3D: Kh&ocirc;ng<br />\r\nTivi kỹ thuật số (DVB-T2): C&oacute;<br />\r\nC&ocirc;ng nghệ xử l&yacute; h&igrave;nh ảnh: Micro Dimming, HDR<br />\r\nC&ocirc;ng nghệ &acirc;m thanh: Dolby MS12<br />\r\nTổng c&ocirc;ng suất loa: 16W<br />\r\nSố lượng loa: 2<br />\r\nWifi: C&oacute;<br />\r\nCổng internet (LAN): C&oacute;<br />\r\nCổng HDMI: 3<br />\r\nComponent video: 1<br />\r\nComposite video: 1<br />\r\nUSB: 1<br />\r\nHệ điều h&agrave;nh, giao diện: TV+ OS<br />\r\nC&aacute;c ứng dụng sẵn c&oacute;: Youtube, Netflix, Tr&igrave;nh duyệt web, kho ứng dụng<br />\r\nC&aacute;c ứng dụng phổ biến c&oacute; thể tải th&ecirc;m: Zing TV, HTV, FPT Play, ClipTV, MyTV<br />\r\nĐiều khiển tivi bằng điện thoại: Bằng ứng dụng T-Cast<br />\r\nKết nối b&agrave;n ph&iacute;m, chuột: C&oacute;</p>\r\n\r\n<p>Th&ocirc;ng tin bảo h&agrave;nh:<br />\r\nBảo h&agrave;nh ch&iacute;nh h&atilde;ng 36 th&aacute;ng<br />\r\nChi tiết xem tại: https://www.tcl.com/vn/vi/services.html<br />\r\nHotline: &nbsp;1800-588-880 (xử l&yacute; trong v&ograve;ng 24 giờ - miễn cước ph&iacute;)</p>', 'tivi_tcl_1.jpg', 6990000, 11, 11, 0, 0, 9, 5, NULL, 1, '2021-03-01 21:28:43', '2021-03-01 21:28:43', NULL),
(48, 'Smart Tivi Xiaomi 4S 70 inch 4K HDR viền kim loại', '<p>K&iacute;ch cỡ m&agrave;n h&igrave;nh&nbsp;&nbsp; &nbsp;70 inch<br />\r\nĐộ ph&acirc;n giải&nbsp;&nbsp; &nbsp;4K<br />\r\nCấu h&igrave;nh<br />\r\nGPU&nbsp;&nbsp; &nbsp;ARM Advanced Multi-Core<br />\r\nCPU&nbsp;&nbsp; &nbsp;ARM Advanced Multi-Core 1.5GHz<br />\r\nHD&nbsp;&nbsp; &nbsp;HDR 10<br />\r\nRam&nbsp;&nbsp; &nbsp;2GB<br />\r\nBộ nhớ trong&nbsp;&nbsp; &nbsp;8GB<br />\r\nKết nối<br />\r\nBluetooth&nbsp;&nbsp; &nbsp;C&oacute; (kết nối loa, b&agrave;n ph&iacute;m, chuột, tay game)<br />\r\nKết nối Internet&nbsp;&nbsp; &nbsp;Cổng LAN, Wifi<br />\r\nCổng AV&nbsp;&nbsp; &nbsp;1 cổng<br />\r\nCổng HDMI&nbsp;&nbsp; &nbsp;3 cổng<br />\r\nCổng xuất &acirc;m thanh&nbsp;&nbsp; &nbsp;S/PDIF<br />\r\nUSB&nbsp;&nbsp; &nbsp;2 cổng<br />\r\nT&iacute;ch hợp đầu thu kỹ thuật số&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\nT&iacute;nh năng th&ocirc;ng minh<br />\r\nC&aacute;c ứng dụng sẵn c&oacute;&nbsp;&nbsp; &nbsp;Youtube, Tr&igrave;nh duyệt web, ClipTV<br />\r\nC&aacute;c ứng dụng phổ biến c&oacute; thể tải th&ecirc;m&nbsp;&nbsp; &nbsp;FPT Play, Fim+, MyTV, Nhaccuatui, THVLi, HTV, Spotify, Zing TV<br />\r\nRemote th&ocirc;ng minh&nbsp;&nbsp; &nbsp;Điều khiển giọng n&oacute;i<br />\r\nĐiều khiển tivi bằng điện thoại&nbsp;&nbsp; &nbsp;Kết nối Bluetooth<br />\r\nKết nối kh&ocirc;ng d&acirc;y với điện thoại, m&aacute;y t&iacute;nh bảng&nbsp;&nbsp; &nbsp;Chiếu m&agrave;n h&igrave;nh điện thoại<br />\r\nKết nối B&agrave;n ph&iacute;m, chuột&nbsp;&nbsp; &nbsp;C&oacute;<br />\r\nT&iacute;nh năng th&ocirc;ng minh kh&aacute;c&nbsp;&nbsp; &nbsp;T&igrave;m kiếm bằng giọng n&oacute;i ( hỗ trợ tiếng Việt)<br />\r\nC&ocirc;ng nghệ h&igrave;nh ảnh, &acirc;m thanh<br />\r\nC&ocirc;ng nghệ h&igrave;nh ảnh&nbsp;&nbsp; &nbsp;HD<br />\r\nTần số qu&eacute;t thực&nbsp;&nbsp; &nbsp;60 Hz<br />\r\nC&ocirc;ng nghệ &acirc;m thanh&nbsp;&nbsp; &nbsp;DTS-HD<br />\r\nTổng c&ocirc;ng suất loa&nbsp;&nbsp; &nbsp;2&times;8W<br />\r\nTh&ocirc;ng tin chung<br />\r\nK&iacute;ch thước&nbsp;&nbsp; &nbsp;1561 x 972 mm<br />\r\nKhối lượng c&oacute; ch&acirc;n&nbsp;&nbsp; &nbsp;20,5 kg<br />\r\nK&iacute;ch thước kh&ocirc;ng ch&acirc;n&nbsp;&nbsp; &nbsp;1561 x 904 mm<br />\r\nKhối lượng kh&ocirc;ng ch&acirc;n&nbsp;&nbsp; &nbsp;20,1 kg<br />\r\nViền kim loại</p>', 'tivi_xiao_1.jpg', 19992600, 11, 11, 0, 0, 9, 6, NULL, 1, '2021-03-01 21:37:01', '2021-03-01 21:37:01', NULL);
