(49, 'MIỄN PHÍ LẮP ĐẶT - Smart Tivi SKYWORTH 43 Inch 43W710', '<p>Loại TV&nbsp;&nbsp; &nbsp;Smart LED<br />\r\nK&iacute;ch thước TV&nbsp;&nbsp; &nbsp;43 Inch<br />\r\nC&ocirc;ng Nghệ Chiếu S&aacute;ng&nbsp;&nbsp; &nbsp;Đ&egrave;n LED nền<br />\r\nC&ocirc;ng Nghệ H&igrave;nh Ảnh&nbsp;&nbsp; &nbsp;C&ocirc;ng nghệ Color Gamut<br />\r\nĐộ Ph&acirc;n Giải&nbsp;&nbsp; &nbsp;Full HD 1920x1080<br />\r\nTần Số Qu&eacute;t&nbsp;&nbsp; &nbsp;60 Hz<br />\r\nK&iacute;ch Thước (Khoảng C&aacute;ch Xem)&nbsp;&nbsp; &nbsp;32 - 43&quot; (2 - 3 m&eacute;t)<br />\r\n3D<br />\r\nXem 3D&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\n&Acirc;m Thanh<br />\r\nTổng C&ocirc;ng Suất Loa&nbsp;&nbsp; &nbsp;16W<br />\r\nSố Lượng Loa&nbsp;&nbsp; &nbsp;2<br />\r\nC&ocirc;ng Nghệ &Acirc;m Thanh&nbsp;&nbsp; &nbsp;Dolby Digital<br />\r\nT&iacute;nh Năng Smart TV<br />\r\nHệ Điều H&agrave;nh&nbsp;&nbsp; &nbsp;Linux 5.0<br />\r\nInternet Video&nbsp;&nbsp; &nbsp;Youtube<br />\r\nTr&igrave;nh Duyệt Web&nbsp;&nbsp; &nbsp;C&oacute;<br />\r\nT&iacute;nh Năng Kh&aacute;c&nbsp;&nbsp; &nbsp;Smart Linux 5.0 với kho ứng dụng Opera TV<br />\r\nTiện &Iacute;ch<br />\r\nXem Film Qua USB&nbsp;&nbsp; &nbsp;C&oacute;<br />\r\nHẹn Giờ Tắt M&aacute;y&nbsp;&nbsp; &nbsp;C&oacute;<br />\r\nUSB Play&nbsp;&nbsp; &nbsp;AVI/MKV/WMV/MP4/M4v/FLV/3GPP/VRO/VOB/TS/PS/RMVB, MP3/AAC/WMA/FLAC/WAV, JPEG<br />\r\nTiết Kiệm Điện&nbsp;&nbsp; &nbsp;C&oacute;<br />\r\nNg&ocirc;n Ngữ Hiển Thị&nbsp;&nbsp; &nbsp;Đa Ng&ocirc;n Ngữ<br />\r\nTivi kỹ thuật số (DVB-T2)&nbsp;&nbsp; &nbsp;C&oacute;<br />\r\nCổng Kết Nối<br />\r\nHDMI&nbsp;&nbsp; &nbsp;C&oacute; x3<br />\r\nCổng Composite (AV)&nbsp;&nbsp; &nbsp;C&oacute;<br />\r\nCổng Component&nbsp;&nbsp; &nbsp;C&oacute;<br />\r\nAudio Out&nbsp;&nbsp; &nbsp;C&oacute; (Headphone , Optical)<br />\r\nVGA&nbsp;&nbsp; &nbsp;C&oacute;<br />\r\nUSB&nbsp;&nbsp; &nbsp;C&oacute; x2<br />\r\nLAN&nbsp;&nbsp; &nbsp;C&oacute;<br />\r\nKết Nối Wifi&nbsp;&nbsp; &nbsp;C&oacute;<br />\r\nCổng Kh&aacute;c&nbsp;&nbsp; &nbsp;Antenna<br />\r\nTh&ocirc;ng Số Chung<br />\r\nK&iacute;ch Thước (C&oacute; ch&acirc;n đế)&nbsp;&nbsp; &nbsp;973 x 207 x 605 mm<br />\r\nK&iacute;ch Thước (Kh&ocirc;ng ch&acirc;n đế)&nbsp;&nbsp; &nbsp;973 x 94 x 569 mm<br />\r\nTrọng Lượng (Kh&ocirc;ng ch&acirc;n đế)&nbsp;&nbsp; &nbsp;9.5 Kg<br />\r\nTrọng Lượng (C&oacute; ch&acirc;n đế)&nbsp;&nbsp; &nbsp;12.6 Kg<br />\r\nXuất Xứ &amp;amp; Bảo H&agrave;nh<br />\r\nH&atilde;ng Sản Xuất&nbsp;&nbsp; &nbsp;Skyworth (Thương hiệu : HongKong)<br />\r\nSản Xuất Tại&nbsp;&nbsp; &nbsp;Việt Nam<br />\r\nBảo H&agrave;nh&nbsp;&nbsp; &nbsp;24 Th&aacute;ng<br />\r\nNăm sản xuất&nbsp;&nbsp; &nbsp;2019</p>\r\n\r\n<p>______________________<br />\r\nGIỚI THIỆU SẢN PHẨM SMART TIVI SKYWORTH 43 INCH 43W710<br />\r\nC&ocirc;ng nghệ độc quyền Full Color Gamut<br />\r\nCho dải m&agrave;u rộng hơn, cường độ h&igrave;nh ảnh sẽ được twang l&ecirc;n, cho h&igrave;nh ảnh giống với h&igrave;nh ảnh thật b&ecirc;n ngo&agrave;i thực tế.</p>\r\n\r\n<p>Smart-Tivi-SKYWORTH-43-Inch-43W710</p>\r\n\r\n<p>&nbsp;<br />\r\nC&ocirc;ng nghệ Chip vi xử l&yacute; l&otilde;i tứ X4<br />\r\nViệc sử dụng những bộ vi xử l&yacute; mạnh mẽ sẽ l&agrave;m tăng hiệu suất của TV v&agrave; Smart TV của Skyworth được trang bị chip l&otilde;i tứ l&agrave; tốt nhất hiện nay. Gi&uacute;p khởi đọng nguồn 5s, chạy c&aacute;c ứng dụng v&agrave; Youtube nhanh.</p>\r\n\r\n<p>Smart Tivi SKYWORTH 43 Inch 43W710</p>\r\n\r\n<p>Kết nối d&acirc;y HDMI<br />\r\nHDMI truyền tải dữ liệu phim ảnh l&ecirc;n m&agrave;n h&igrave;nh TV lớn m&agrave; vẫn đảm bảo đưuọc chất lượng h&igrave;nh ảnh v&agrave; &acirc;m thanh nội dung gốc. C&oacute; thể truyền tải một lượng lớn dự liệu nhanh c&ugrave;ng một l&uacute;c.</p>\r\n\r\n<p>Smart Tivi SKYWORTH 43 Inch 43W710</p>\r\n\r\n<p>Hệ thống &acirc;m thanh v&ograve;m<br />\r\nHệ thống kỹ thuật số 2.1 &acirc;m thanh v&ograve;m mang lại một trải nghiệm ho&agrave;n to&agrave;n mới, độ trầm &acirc;m tiếng vang đều được truyền tải rất thật qua hệ thống &acirc;m thanh của TV Skyworth.</p>\r\n\r\n<p>Smart Tivi SKYWORTH 43 Inch 43W710</p>\r\n\r\n<p>Smart TV<br />\r\nVới nền tảng ứng dụng đồ sộ cung cấp đầy đủ mọi th&ocirc;ng tin m&agrave; người d&ugrave;ng c&oacute; thể dễ d&agrave;ng t&igrave;m kiếm như thể thao, thời tiết, phim ảnh, kho dữ liệu, tr&ograve; chơi v&agrave; mạng x&atilde; hội.</p>\r\n\r\n<p>Smart Tivi SKYWORTH 43 Inch 43W710</p>\r\n\r\n<p>Hệ thống LED nền ma trận<br />\r\nĐộ s&aacute;ng m&agrave;n h&igrave;nh TV tự động chỉnh theo c&aacute;c t&iacute;n hiệu đầu v&agrave;o, nhầm n&acirc;ng cao chất lượng h&igrave;nh ảnh, tiết kiệm lượng điện ti&ecirc;u thụ v&agrave; quan trọng nhất l&agrave; nhầm bảo vệ thị gi&aacute;c của người ti&ecirc;u d&ugrave;ng.</p>', 'tivi_smart_10.jpg', 4319000, 5, 5, 0, 0, 9, 7, NULL, 1, '2021-03-01 22:13:55', '2021-03-01 22:13:55', NULL),
(50, 'Găng Tay Cotton Chống Mồ Hôi Chơi Game Bắn Súng Trên Điện Thoại Chuyên Nghiệp', '<p>Thời gian giao h&agrave;ng dự kiến cho sản phẩm n&agrave;y l&agrave; từ 7-9 ng&agrave;y<br />\r\n&nbsp;<br />\r\n&nbsp;#Golden<br />\r\n&nbsp;<br />\r\n&nbsp;T&ecirc;n sản phẩm: Găng đeo ng&oacute;n tay chống mồ h&ocirc;i chơi game chuy&ecirc;n dụng cho c&aacute;c game bắn s&uacute;ng tr&ecirc;n điện thoại<br />\r\n&nbsp;Loại nguồn h&agrave;ng: C&oacute; sẵn<br />\r\n&nbsp;Chất liệu: Sợi bạc<br />\r\n&nbsp;Ph&acirc;n loại: Kh&aacute;c<br />\r\n&nbsp;D&agrave;nh cho: Trung t&iacute;nh / cả nam v&agrave; nữ<br />\r\n&nbsp;Phương ph&aacute;p gia c&ocirc;ng: Gia c&ocirc;ng OEM<br />\r\n&nbsp;Chức năng: D&ugrave;ng được m&agrave;n h&igrave;nh cảm ứng, chống mồ h&ocirc;i<br />\r\n&nbsp;Họa tiết: Chấm bi<br />\r\n&nbsp;Kiểu d&aacute;ng: Găng ng&oacute;n tay<br />\r\n&nbsp;Chức năng: D&ugrave;ng được m&agrave;n h&igrave;nh cảm ứng, chống mồ h&ocirc;i<br />\r\n&nbsp;M&agrave;u sắc: Đen<br />\r\n&nbsp;K&iacute;ch thước: Một k&iacute;ch thước<br />\r\n&nbsp;Ph&ugrave; hợp cho m&ugrave;a: Xu&acirc;n, thu, đ&ocirc;ng, h&egrave;<br />\r\n&nbsp;Hệ điều h&agrave;nh tương th&iacute;ch: Th&ocirc;ng dụng<br />\r\n&nbsp;Ph&ugrave; hợp cho nhiều game phổ biến như King of Glory / CF / Dragon Valley / Ball Ball Battle / Joint Basketball / Sound Tour v.v.<br />\r\n&nbsp;<br />\r\n&nbsp;Mang đến cho bạn trải nghiệm cảm gi&aacute;c mới, n&acirc;ng cấp mới, cảm gi&aacute;c th&acirc;n thiện với l&agrave;n da, sợi co gi&atilde;n, chống m&agrave;i m&ograve;n l&acirc;u d&agrave;i, sợi chống điện c&oacute; thể giặt, găng ng&oacute;n tay, cảm ứng nhạy, nhẹ v&agrave; tho&aacute;ng kh&iacute; 360 &deg;<br />\r\n&nbsp;<br />\r\n&nbsp;Chống mỏi tay v&agrave; chống v&acirc;n tay, trượt nhạy hơn m&agrave; kh&ocirc;ng c&oacute; lỗi<br />\r\n&nbsp;<br />\r\n&nbsp;Quy tr&igrave;nh đan 18 kim cao v&agrave; mỏng, th&ocirc;ng minh v&agrave; mỏng, tốt hơn so với ng&oacute;n tay trần<br />\r\n&nbsp;<br />\r\n&nbsp;Độ đ&agra