(54, 'Tay cầm chơi game k21 - kèm nút bấm cho game PUBG, ROS, Free Fire..gắn điện thoại tiện lợi - senvangshop', '<p>Tay cầm chơi game k21<br />\r\n&quot;Tay cầm chơi game k21&quot;</p>\r\n\r\n<p>- Th&iacute;ch hợp với c&aacute;c điện thoại c&oacute; m&agrave;n h&igrave;nh từ 4.7-6.5 inch ( điều chỉnh được)</p>\r\n\r\n<p>C&aacute;ch sử dụng tay cầm chơi Game PUBG , RULES , LI&Ecirc;N QU&Acirc;N MOBILE, V&Otilde; L&Acirc;M , CF, FIFA,...</p>\r\n\r\n<p>- C&agrave;i đặt n&uacute;t ngắm trong setting của game, di chuyển 2 n&uacute;t ngắm đến vị tr&iacute; ph&ugrave; hợp gắn 2 cốc h&uacute;t v&agrave;o vị tr&iacute; th&iacute;ch hợp vừa c&agrave;i v&agrave; bạn c&oacute; thể bắt đầu chơi vfa c&aacute;i đặt gaem l&agrave; chơi &nbsp;lấy tốp 1</p>\r\n\r\n<p>Loại vật phẩm: Bộ điều khiển PUBG</p>\r\n\r\n<p>Thao t&aacute;c bốn ng&oacute;n tay, dễ ăn g&agrave;, bắn, ba l&ocirc;, nhảy, ngồi xổm, mở gương, thăm d&ograve;, nằm xuống.</p>\r\n\r\n<p>Tay cầm tiện dụng, vừa vặn vừa l&ograve;ng b&agrave;n tay, thời gian d&agrave;i kh&ocirc;ng mệt mỏi.</p>\r\n\r\n<p>Mặt b&ecirc;n của thiết kế rỗng ho&agrave;n to&agrave;n, sạc tai nghe cắm l&agrave; ch&iacute;nh x&aacute;c, tr&ograve; chơi kh&ocirc;ng dừng lại.</p>\r\n\r\n<p>Chất liệu: hợp kim ABS + kẽm</p>\r\n\r\n<p>Sản phẩm &aacute;p dụng: điện thoại th&ocirc;ng minh</p>\r\n\r\n<p>M&agrave;u đen</p>\r\n\r\n<p>Loại phụ kiện m&aacute;y chơi game: game rocker</p>\r\n\r\n<p>G&oacute;i bao gồm:</p>\r\n\r\n<p>1 x sản phẩm, 1 x Hướng dẫn sử dụng, 1 x bao b&igrave; hộp</p>\r\n\r\n<p><br />\r\n&nbsp;#taycamchoigame &nbsp;#gamenhaydu &nbsp;#gamePUBG &nbsp;#taycamchoigamelienquan &nbsp;#taycamkieumoi #taycamchoigameMV &nbsp;#taycamhotrochoigame &nbsp; #Dmdmart &nbsp;#freeship &nbsp;#chatluong #gamepad #pubgmobile #taycầm #mobile #gamediđộng #hỗtrợbắn #flydigi #tảnnhiệt #bluetooth4.0 #ipad #iphone<br />\r\n&nbsp;</p>', 'pubg_1.jpg', 78000, 11, 11, 0, 0, 9, 10, NULL, 1, '2021-03-01 23:04:05', '2021-03-01 23:04:05', NULL),
(55, 'Bàn phím bán cơ 1 tay chơi các game mobi Freefire, CF, liên quân,...siêu chất', '<p>***** KH&Aacute;CH LƯU &Yacute; D&Ugrave;M SHOP Ạ ! VUI L&Ograve;NG ĐỌC KỸ TRONG PHẦN PH&Acirc;N LOẠI, NẾU KH&Aacute;CH Đ&Atilde; C&Oacute; SẴN USB HUB HOẶC C&Aacute;P RỒI TH&Igrave; KH&Aacute;CH CHỈ CẦN MUA TH&Ecirc;M B&Agrave;N PH&Iacute;M LẺ TH&Ocirc;I Ạ ! C&Ograve;N NẾU KH&Aacute;CH CHƯA C&Oacute; THIẾT BỊ G&Igrave; HỖ TRỢ TH&Igrave; N&Ecirc;N MUA CẢ COMBO NHIỀU M&Oacute;N NH&Eacute; KH&Aacute;CH. SHOP ĐƯA RA NHIỀU COMBO CHO KH&Aacute;CH LỰA CHỌN ĐỂ KH&Aacute;CH THIẾU M&Oacute;N G&Igrave; C&Oacute; THỂ MUA TH&Ecirc;M M&Oacute;N Đ&Oacute; CHO TIẾT KIỆM CHI PH&Iacute; Ạ !!!<br />\r\n- Nếu sử dụng cho điện thoại, m&aacute;y t&iacute;nh bảng kh&aacute;ch phải chọn combo 3 m&oacute;n hoặc 4 m&oacute;n, nếu kh&aacute;ch chọn sai ph&acirc;n loại shop kh&ocirc;ng hỗ trợ đổi trả ạ !!!<br />\r\n- LƯU &Yacute; QUAN TRỌNG : SẢN PHẨM CHỈ SỬ DỤNG CHO C&Aacute;C D&Ograve;NG ANDROID - KH&Ocirc;NG D&Ugrave;NG CHO IOS<br />\r\n- Combo 3 m&oacute;n v&agrave; 4 m&oacute;n gồm những phụ kiện g&igrave;, kh&aacute;ch vui l&ograve;ng đọc phần th&ocirc;ng tin chi tiết b&ecirc;n dưới ạ !&nbsp;<br />\r\n* B&agrave;n ph&iacute;m chuy&ecirc;n d&agrave;nh cho game thủ chơi tr&ecirc;n mobile 1 c&aacute;ch dễ d&agrave;ng, gi&aacute; cả phải chăng gi&uacute;p bạn trải nghiệm những trận chiến, bắn s&uacute;ng ho&agrave;n hảo.<br />\r\nTh&ocirc;ng số sản phẩm:&nbsp;<br />\r\nGiao diện: USB Cắm&nbsp;<br />\r\nHỗ trợ Kết nối với m&aacute;y t&iacute;nh v&agrave; điện thoại&nbsp;<br />\r\nPh&iacute;m chức năng Đa phương tiện c&oacute; d&acirc;y: C&oacute; Ph&iacute;m tắt: C&oacute; Tay giữ<br />\r\nChức năng chống thấm nước<br />\r\nĐ&egrave;n nền chức năng 7 m&agrave;u led<br />\r\nChất liệu : nhựa ABS<br />\r\nK&iacute;ch thước sản phẩm : 20*20*8, nặng 700g<br />\r\n* CHUỘT<br />\r\nLED nhiều m&agrave;u<br />\r\nĐộ ph&acirc;n giải quang học 3200 (dpi)<br />\r\nGiao diện kết nối: cổng USB<br />\r\nDễ sử dụng, t