(56, 'Bộ Nút Bắn PUBG Mobile AUTO TAP Kèm Quạt Tản Nhiệt Memo AK03', '<p>N&Uacute;T BẮN PUBG MOBILE AUTO TAP K&Egrave;M QUẠT TẢN NHIỆT MEMO AK03</p>\r\n\r\n<p>🍀 Bộ đ&ocirc;i kết hợp ho&agrave;n hảo cho gamers thoải m&aacute;i chiến game sinh tồn m&agrave; kh&ocirc;ng lo smartphone bị n&oacute;ng như: PUBG Mobile, Free Fire, Rules of Survival, Knives Out, Critical Ops, Fortnite, Cyber Hunter, Call of Duty Mobile&hellip;<br />\r\n🍀 N&uacute;t tr&aacute;i hỗ trợ AUTO TAP l&ecirc;n đến 30 lần/gi&acirc;y<br />\r\n🍀 Pin sử dụng li&ecirc;n tục hơn 24 giờ<br />\r\n🍀 Thiết kế n&uacute;t bấm v&agrave; quạt tản nhiệt hoạt động độc lập, gi&uacute;p bạn c&oacute; thể linh hoạt sử dụng trong nhều trường hợp<br />\r\n🍀 Sử dụng được cho điện thoại d&agrave;y từ 6-11 mm<br />\r\n🍀 Quạt tản nhiệt th&iacute;ch hợp với điện thoại rộng 67-85 mm, pin sử dụng được khoảng 3-4 giờ<br />\r\n🍀 C&oacute; 4 mức độ cho chế đ&ocirc; tap: mức 1 tương ứng tap đơn, mức 2-3-4 tương ứng chế độ auto tap 8-16-30 lần/gi&acirc;y<br />\r\n🍀Tốc độ quạt si&ecirc;u nhanh 6000 v&ograve;ng/ph&uacute;t sẽ l&agrave;m dịu cơn n&oacute;ng điện thoại khi c&aacute;c game thủ v&agrave;o trận chiến m&agrave; kh&ocirc;ng lo trở ngại g&igrave;<br />\r\n🍀 Dung lượng pin quạt: 400mAh, sử dụng được trong v&ograve;ng 3h &ndash; 4h.<br />\r\n--------------------------------------<br />\r\nQUY ĐỊNH ĐỔI TRẢ / BẢO H&Agrave;NH<br />\r\n1. Điều kiện &aacute;p dụng (trong v&ograve;ng 07 ng&agrave;y kể từ khi nhận sản phẩm)&nbsp;<br />\r\nH&agrave;ng ho&aacute; vẫn c&ograve;n mới, chưa qua sử dụng&nbsp;<br />\r\nH&agrave;ng ho&aacute; bị lỗi hoặc hư hỏng do vận chuyển hoặc do nh&agrave; sản xuất&nbsp;</p>\r\n\r\n<p>2. Trường hợp được chấp nhận:&nbsp;<br />\r\nH&agrave;ng kh&ocirc;ng đ&uacute;ng m&agrave;u sắc, kiểu d&aacute;ng, số lượng như qu&yacute; kh&aacute;ch đặt h&agrave;ng.</p>\r\n\r\n<p>3. Trường hợp kh&ocirc;ng đủ điều kiện &aacute;p dụng ch&iacute;nh s&aacute;ch:&nbsp;<br />\r\nQu&aacute; 07 ng&agrave;y kể từ khi Qu&yacute; kh&aacute;ch nhận h&agrave;ng.<br />\r\nGửi lại h&agrave;ng kh&ocirc;ng đ&uacute;ng mẫu m&atilde;, kh&ocirc;ng phải sản phẩm của shop.<br />\r\nKh&ocirc;ng th&iacute;ch, kh&ocirc;ng hợp, đặt nhầm m&atilde;, nhầm m&agrave;u,...&nbsp;<br />\r\n#nutbangame #nuthotrogame #nutbanPUBGmobile #dungcuhotrogame #nutbangamePUBGmobileAS #quattannhietdienthoai #quattannhiet</p>', 'pubg_shooting_1.jpg', 399000, 11, 11, 0, 0, 9, 12, NULL, 1, '2021-03-01 23:07:15', '2021-03-01 23:07:15', NULL),
(57, 'Flydigi Apex 2 | Tay cầm chơi game Liên quân, COD, PUBG cho IOS, Android và PC,TV', '<p>➤ BẢN TI&Ecirc;U CHUẨN: Tay Cầm + Kẹp (Gi&aacute;) Treo Điện Thoại + C&aacute;p Sạc<br />\r\n➤ BẢN ĐẦY ĐỦ: Tay Cầm + Kẹp (Gi&aacute;) Treo Điện Thoại + C&aacute;p Sạc + USB wireless + Joystick sơ cua + Hộp<br />\r\n◉ 2 Phi&ecirc;n bản giống nhau về thiết kế v&agrave; t&iacute;nh năng - chỉ kh&aacute;c nhau về một số phụ kiện k&egrave;m theo.&nbsp;</p>\r\n\r\n<p>Tay cầm chơi game kh&ocirc;ng d&acirc;y Flydigi Apex 2 - Sức mạnh vượt trội với mọi thể loại game!</p>\r\n\r\n<p>Tay cầm chơi game Flydigi Apex 2 chơi game Li&ecirc;n qu&acirc;n, PUBG, CoD, Freefire tr&ecirc;n iOS, Androi v&agrave; PC l&agrave; tay cầm thế hệ thứ 2 của d&ograve;ng tay cầm Apex. Được n&acirc;ng cấp cảm biến con quay 6 trục ( gryo 6 trục) v&agrave; c&aacute;c n&uacute;t BXY được thiết kết để c&oacute; thể t&iacute;ch hợp s&acirc;u v&agrave; điều khiển với MOBA games v&agrave; c&aacute;c game FPS kh&aacute;c.<br />\r\n⭐️ &nbsp;Lưu &yacute;: iOS 13.4 trở l&ecirc;n chưa sử dụng được.</p>\r\n\r\n<p>T&Iacute;NH NĂNG NỔI BẬT<br />\r\n------------------------------------------------------<br />\r\n✅ &nbsp;Th&ecirc;m 4 n&uacute;t ở mặt sau Flydigi Apex 2 tạo đột ph&aacute; với tổng 27 n&uacute;t bấm, tận dụng triệt để những ng&oacute;n tay.<br />\r\n✅ &nbsp;Joystick v&agrave; n&uacute;t bấm được n&acirc;ng cấp để đạt độ ch&iacute;nh x&aacute;c cao v&agrave; tăng cường tuổi thọ.<br />\r\n✅ &nbsp;Thiết kế n&uacute;t BXY kiểu roulette ( trục xoay) với độ ch&iacute;nh x&aacute;c 5&mu;m để chơi c&aacute;c game tốt hơn.<br />\r\n✅ &nbsp;N&uacute;t BXY c&oacute; thể xoay được 360 độ theo mặt phẳng với độ nhạy cao, d&ugrave;ng như thao t&aacute;c vuốt cảm ứng trong MOBA games<br />\r\n✅ &nbsp;LED 16.8 triệu m&agrave;u c&ugrave;ng 4 chế độ hiệu ứng &aacute;nh s&aacute;ng cho bạn t&ugrave;y chọn<br />\r\n✅ &nbsp;Sử dụng c&ocirc;ng nghệ Flashplay chơi mọi tựa game tr&ecirc;n iOS v&agrave; Android cũng như PC&nbsp;<br />\r\n✅ &nbsp;C&oacute; nhiều skin để c&oacute; thể thay đổi<br />\r\n✅ &nbsp;N&uacute;t bắn c&oacute; 2 h&agrave;nh tr&igrave;nh bấm, phản hồi tốt hơn&nbsp;<br />\r\n✅ &nbsp;Flydigi Apex 2 cảm biến gia tốc 6 trục tr&ecirc;n được thiết kế đặc biệt cho c&aacute;c tr&ograve; chơi bắn s&uacute;ng để đạt được độ ch&iacute;nh x&aacute;c.<br />\r\n✅ &nbsp;Gi&aacute; đỡ điện thoại n&acirc;ng cấp 2 khớp điều chỉnh linh hoạt g&oacute;c nh&igrave;n hơn gi&aacute; đỡ th&ocirc;ng thường.<br />\r\n✅ &nbsp;Thiết kết vỏ ngo&agrave;i c&oacute; thể th&aacute;o rời được dễ d&agrave;ng thay đổi skin định h&igrave;nh phong c&aacute;ch c&aacute; nh&acirc;n.<br />\r\n✅ &nbsp;Hỗ trợ tất cả c&aacute;c nền tảng : iOS , Androi v&agrave; PC,TV, giả lập. Flydigi Apex 2 hỗ trợ tất cả c&aacute;c thiết bị của bạn.<br />\r\n✅ &nbsp;Dung lượng pin: 650mAh<br />\r\n✅ &nbsp;Nguồn sạc: 5V-1A<br />\r\n✅ &nbsp;Thời gian sạc: 2-3 &nbsp;giờ<br />\r\n✅ &nbsp;Thời gian sử dụng: 70 giờ<br />\r\n✅ &nbsp;Kết nối: Bluetooth 4.0/2.4G Wireless<br />\r\n✅ &nbsp;Phạm vi: 10m<br />\r\n✅ &nbsp;Nền tảng hoạt động: &nbsp;iOS: &nbsp;iPhone5S trở l&ecirc;n, d&ograve;ng iPad5 trở l&ecirc;n v&agrave; hệ điều h&agrave;nh iOS 9.3 trở l&ecirc;n. &nbsp;Nền tảng Android: &nbsp;Android 5.0 trở l&ecirc;n v&agrave; &nbsp;Bluetooth 4.0, nền tảng m&aacute;y t&iacute;nh bảng: hệ thống WindowsXP trở l&ecirc;n.<br />\r\n✅ &nbsp;Bộ sản phẩm gồm : 01 x Tay cầm game Flydigi Apex 2, 01 x C&aacute;p sạc,01x gi&aacute; đỡ điện thoại, 01 x đầu thu UBS Wireless &nbsp;2.4G, 02 x cặp mũ joystick thay thế , 01 x hộp đựng<br />\r\n------------------------------------------------------<br />\r\n⭐️ &nbsp;BẢO H&Agrave;NH 12 TH&Aacute;NG&nbsp;<br />\r\n------------------------------------------------------<br />\r\n☎️ &nbsp;Hotline/Zalo: 0835908561 INSERT INTO `products` (`id`, `name`, `description`, `image`, `price`, `quantity`, `remaining`, `rating`, `view`, `category_id`, `producer_id`, `discount`, `verified`, `created_at`, `updated_at`, `deleted_at`) VALUES
(68, 'Laptop Nhật FUJITSU LifeBook U772 Core i5-3437U, 4gb ram, SSD 128gb, màn 14inch HD vỏ nhôm siêu mỏng, tặng túi, chột', '<p>M&Aacute;Y T&Iacute;NH KHOA ĐỨC<br />\r\nDC: Li&ecirc;n Kh&ecirc; - Kho&aacute;i Ch&acirc;u - Hưng Y&ecirc;n<br />\r\nDT: 0902.020.889 - 0906.191.018 zalo<br />\r\n( H&atilde;y li&ecirc;n hệ trực tiếp với ch&uacute;ng t&ocirc;i để được hỗ trợ, tư vẫn nhanh nhất)<br />\r\nCh&uacute;ng t&ocirc;i chuy&ecirc;n ph&acirc;n phối m&aacute;y t&iacute;nh x&aacute;ch tay, m&aacute;y t&iacute;nh đồng bộ v&agrave; c&aacute;c linh phụ kiện được nhập khẩu từ c&aacute;c quốc gia ch&acirc;u &acirc;u, Mỹ, Nhật, Anh...<br />\r\nVới ti&ecirc;u ch&iacute; chất lượng v&agrave; dịch vụ h&agrave;ng đầu được kh&aacute;ch h&agrave;ng trong cả nước đ&aacute;nh gi&aacute; cao. Tư vấn th&acirc;n thiện nhiệt t&igrave;nh với mục địch l&agrave;m h&agrave;i l&ograve;ng kh&aacute;ch h&agrave;ng kh&oacute; t&iacute;nh nhất.<br />\r\nNhật Bản l&agrave; một quốc gia c&ocirc;ng nghệ h&agrave;ng đầu th&ecirc; giới, những sản phẩm tiền tiến nhất, tốt nhất đều được sinh ra từ quốc gia n&agrave;y.<br />\r\nMột &yacute; thức tuyệt vời của người nhất l&agrave; họ d&agrave;nh những sản phẩm cao cấp, hiện đại, tốt nhất bền nhất cho ch&iacute;nh c&ocirc;ng d&acirc;n của họ d&ugrave;ng v&igrave; vậy được d&ugrave;ng đồ nhật l&agrave; sở hữu sự hiện đại v&agrave; y&ecirc;n r&acirc;m.<br />\r\nFujitsu được th&agrave;nh lập tư năm 1935, l&agrave; một c&ocirc;ng ty Nhật Bản chuy&ecirc;n ng&agrave;nh trong lĩnh vực b&aacute;n dẫn, m&aacute;y t&iacute;nh, truyền th&ocirc;ng v&agrave; dịch vụ đặt trụ sở tại Tokyo.<br />\r\nVới bề dầy gần 100 năm kinh nghi&ecirc;m, Fujitsu l&agrave; c&ocirc;ng ty đứng tứ 3 tr&ecirc;n thế giới v&agrave; đứng số 1 tại nhật bản.<br />\r\n------*****LAPTOP FUJITSU LIFEBOOK U772*****--------<br />\r\nSở hữu một th&acirc;n h&igrave;nh bằng hợp kim nh&ocirc;m chắc chắn với nhưng đường viền ấn tượng v&agrave; rất mỏng l&agrave;m nối bật vẻ đẹp của sản phẩm.<br />\r\nD&ograve;ng U của fujitsu thuộc d&ograve;ng Ultrabook cao cấp v&agrave; mảnh mai<br />\r\nVới cấu h&igrave;nh mạnh mẽ ph&ugrave; hợp nhiều c&aacute;c nhu cầu c&ocirc;ng việc v&agrave; giải tr&iacute;<br />\r\nM&agrave;n h&igrave;nh 14inh HD chống l&oacute;a với k&iacute;nh full viền cho kh&ocirc;ng gian l&agrave;m việc rộng v&agrave; hiện đại<br />\r\nB&agrave;n ph&iacute;m l&agrave; thứ ấn tượng nhất với sản phẩm, ph&iacute;m khoảng c&aacute;ch tốt c&oacute; độ nẩy v&agrave; nhẹ cho cảm gi&aacute;c g&otilde; ph&iacute;m tuyệt vời<br />\r\nT&iacute;ch hợp đầy đủ c&aacute;c cổng giao tiếp cho nhiều nhu cầu kh&aacute;c nhau.<br />\r\n---------****** CẤU H&Igrave;NH SẢN PHẨM ******----------<br />\r\nT&ecirc;n sản phẩm: Laptop<br />\r\nH&atilde;ng sản xuất: Fujitsu<br />\r\nD&ograve;ng sản phẩm: LIFEBOOK Ultra<br />\r\nModel: U772<br />\r\nNước sản xuất: Nhật Bản<br />\r\nCPU: Core i5-3437U - 1.90GHz Max turbo 2.90GHz 3M cache với 2 nh&acirc;n &nbsp;4 luồng<br />\r\nChipset:Intel&reg; HM77 Express<br />\r\nBộ nhớ ram: 4GB DDR3 bus 1600GHz n&acirc;ng cấp max 8GB<br />\r\nỔ cứng: SSD 128gb sata 3 max 6gb/s<br />\r\nM&agrave;n h&igrave;nh: 14inch HD Crystal View LED chống l&oacute;a với kinh tr&agrave;n viền.<br />\r\nTấm nền: LED IPS<br />\r\nCổng giao tiếp h&igrave;nh ảnh: HDMI<br />\r\nCổng giao tiếp USB: USB3.0 *2 USB2.0 *1<br />\r\nHệ điều h&agrave;nh Windows 10<br />\r\nSản phảm ph&ugrave; hợp mọi nhu cầu chơi game LOL, FC, văn ph&ograve;ng, giải tr&iacute;, l&agrave;m việc....<br />\r\nVui l&ograve;ng li&ecirc;n hệ để được tư vấn<br />\r\n#fujitsu #lifebook #u772</p>', 'japan_laptop_1.jpg', 5600000, 11, 11, 0, 0, 10, 10, NULL, 1, '2021-03-02 00:28:32', '2021-03-02 00:28:32', NULL),
(69, 'Máy tính đồng bộ Dell Optiplex 7010 Core i7 / Core I5 / Core I3 / Ram 4GB / SSD 120GB', '<p>Model : Dell Optiplex 7010<br />\r\n* Mainboard Dell Intel H61 chipset socket 1155 support Core i3, i5, i7 socket 1155 , DDR3 1066/1333MHz max 16GB<br />\r\n* CẤU H&Igrave;NH: &nbsp; &nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;CẤU H&Igrave;NH 1: CPU G2020 / RAM 4GB / HHD 250GB</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;CẤU H&Igrave;NH 2: CPU I3 3220 / RAM 4GB / SSD 120GB (CHƠI GAME LẤY TH&Ecirc;M VGA RỜI ) &nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; =&amp;gt; VGA rời &nbsp;chơi lmht fifa4 đột k&iacute;ch maxsting<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; CẤU H&Igrave;NH 3: CPU I5 3470 / RAM 4GB / SSD 120GB (CHƠI GAME LẤY TH&Ecirc;M VGA RỜI ) &nbsp; &nbsp; &nbsp;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; =&amp;gt; VGA rời &nbsp;chơi lmht fifa4 đột k&iacute;ch maxsting<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;CẤU H&Igrave;NH 4: CPU I7 2600 / RAM 8GB / SSD 120GB ( CHƠI GAME TH&Ecirc;M VGA RỜI)<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; =&amp;gt;VGA rời &nbsp;chơi lmht fifa4 đột k&iacute;ch maxsting<br />\r\n* Card mạng : 10/100/1000Mbps<br />\r\n* Card &acirc;m thanh : Onboard 2.1 Hight Definition<br />\r\n* Nguần : auto 100v-240v 265w<br />\r\n* Hệ điều h&agrave;nh c&agrave;i sẵn&nbsp;<br />\r\n-----------------------------------------------------------------------------------------------------<br />\r\nTặng Ngay : Tặng USB Thu Wifi Hoặc chuột fullhen</p>\r\n\r\n<p>==&amp;gt; Cam kết H&agrave;ng Nhập khẩu trức tiếp tại Nhật &nbsp;, Mỹ &nbsp;....( N&oacute;i Kh&ocirc;ng với H&agrave;ng Trung Quốc , H&agrave;ng K&eacute;m Chất Lượng )</p>\r\n\r\n<p>#m&aacute;y_t&iacute;nh_để_ban &nbsp; #m&aacute;y_t&iacute;nh &nbsp;#vinh_t&iacute;nh<br />\r\n#m&aacute;y_tinh_đồng_bộ #m&aacute;y_vi_tinh<br />\r\n# m&aacute;y_tinh_dell #m&aacute;y_tinh_đồng_bộ_dell<br />\r\n#m&aacute;y_t&iacute;nh_Dell_optiplex_7010 &nbsp;#m&aacute;y_t&iacute;nh_chơi_game<br />\r\n#m&aacute;y_t&iacute;nh_Dell_optiplex_7010 #m&aacute;y_t&iacute;nh_chơi_game<br />\r\n#m&aacute;y_t&iacute;nh_Dell_optiplex_7010 #m&aacute;y_t&iacute;nh_chơi_game<br />\r\n# Dell_990 #Dell_7010 #Dell_7010</p>', 'case_computer_1.jpg', 4450000, 11, 11, 0, 0, 10, 11, NULL, 1, '2021-03-02 00:29:34', '2021-03-02 00:29:34', NULL),
(70, 'BỘ MÁY TÍNH BÀN CHƠI PUBG Mb GTA V LOL CF Siêu Bền', '<p>+ B&aacute;n h&agrave;ng kh&ocirc;ng chạy theo gi&aacute; rẻ k&eacute;m chất lượng ( d&ugrave; biết b&aacute;n h&agrave;ng chất lượng sẽ kh&oacute; cạnh tranh ) .<br />\r\nCh&agrave;o cả nh&agrave; nh&eacute; !hi h&ocirc;m nay shop sẽ giới thiệu c&aacute;c bạn 1 bộ m&aacute;y t&iacute;nh gi&aacute; rẻ v&agrave; lại c&ograve;n đẹp , chiếm game tốt m&agrave; lại bền nh&eacute;.<br />\r\n___________________________________________________<br />\r\nMột số Game v&agrave; ứng dụng đ&atilde; Test : Game li&ecirc;n minh, game đột k&iacute;ch, game GTA V , game audition, Game AOE + &hellip; ( Game pubg mobile v&agrave; FO4 mức tạm ) .<br />\r\n___________________________________________________<br />\r\nCấu h&igrave;nh Bộ Sản Phẩm :&nbsp;<br />\r\n+ Chip :Q9400 với chip n&agrave;y th&igrave; c&aacute;c bạn tha hồ chơi mấy game b&ecirc;n tr&ecirc;n nh&eacute; ( ng&agrave;y trước shop lắp chip E8400 v&agrave; E8500 nhưng giờ chip đ&oacute; yếu qu&aacute; n&ecirc;n shop n&acirc;ng hẳn l&ecirc;n Q cho c&aacute;c bạn nh&eacute; ) .<br />\r\n+ Ram : 4GB với 4GB Ram c&aacute;c bạn thoải m&aacute;i chơi game nh&eacute;.<br />\r\n+ Card h&igrave;nh : Quadro ,GT730 ,AMD hoặc tương đương, đảm bảo được độ mượt khi combat giao tranh nh&eacute; cả nh&agrave;.<br />\r\n+ Ổ cứng : 250GB (trong dip h&egrave; shop hỗ trợ n&acirc;ng cấp ổ hdd 250g &nbsp;l&ecirc;n ssd 120g &nbsp;cho c&aacute;c bạn ạ) th&igrave; thừa sức c&aacute;c bạn lưu game cũng như lưu dữ liệu một c&aacute;ch thoải m&aacute;i nhất .<br />\r\n+ Nguồn : Nguồn CST đồng bộ chuẩn n&ecirc;n mang lại sự ổn định v&agrave; c&agrave;y k&eacute;o khi c&aacute;c bạn chơi l&acirc;u d&agrave;i .<br />\r\n+Vỏ Case : Vỏ kiểu chắc chắn khoẻ mạnh , v&agrave; sẽ thay đổi kiểu d&aacute;ng v&agrave; Led theo thị trường v&agrave; độ Hot nh&eacute; c&aacute;c bạn.<br />\r\n+ M&agrave;n h&igrave;nh : M&agrave;n h&igrave;nh 19-20inh 2nd mang lại h&igrave;nh ảnh sắc n&eacute;t khi c&aacute;c bạn chơi game cũng như nghe nhạc xem film nh&eacute;.&nbsp;<br />\r\n+ Tặng k&egrave;m : Ph&iacute;m v&agrave; chuột v&agrave; l&oacute;t chuột mới .<br />\r\n___________________________________________________<br />\r\nTổng đơn h&agrave;ng khi c&aacute;c đến tay c&aacute;c bạn bao gồm : Bộ case Q9400/4GB/250GB/M&agrave;n 19-20inh 2nd/ Ph&iacute;m Chuột l&oacute;t /D&acirc;y c&aacute;p kết nối .<br />\r\n___________________________________________________<br />\r\n+ Trường hợp c&aacute;c bạn kh&ocirc;ng muốn lấy phụ kiện khuyến mại đi k&egrave;m th&igrave; sẽ trừ thẳng v&agrave;o gi&aacute; của tổng sản phẩm cụ thể như sau :<br />\r\n+ C&aacute;c bạn kh&ocirc;ng lấy ph&iacute;m mới v&agrave; chuột mới : Trừ 200k .<br />\r\n&ldquo; C&aacute;c bạn kh&ocirc;ng lấy phụ kiện n&agrave;o th&igrave; &ldquo; TRẢ GI&Aacute; &ldquo; sản phẩm &nbsp;trước khi đặt h&agrave;ng cho giảm tiền nh&eacute; &nbsp;&ldquo; .<br />\r\n___________________________________________________<br />\r\nCh&iacute;nh s&aacute;ch xử l&yacute; lỗi v&agrave; bảo h&agrave;nh hoặc đổi trả :<br />\r\n+ Khi c&aacute;c bạn nhận h&agrave;ng c&aacute;c bạn thấy thiếu bất k&igrave; sản phẩm n&agrave;o th&igrave; c&aacute;c bạn b&aacute;o shop để shop xử l&yacute; cũng như gửi lại cho c&aacute;c bạn nh&eacute; .<br />\r\n+ Kh&aacute;ch h&agrave;ng gặp lỗi về sản phẩm : Chat với shop hoặc gọi v&agrave; zalo trực tiếp : 0869.368.512 ( từ 8h &ndash; 12h trưa v&agrave; 2h chiều đến 8h tối ) .<br />\r\n+ C&aacute;c bạn chat với shop để shop gửi tờ ch&iacute;nh s&aacute;ch bảo h&agrave;nh đổi trả cho c&aacute;c bạn tham khảo nha .</p>', 'gaming_computer_1.jpg', 3390000, 11, 11, 0, 0, 10, 7, NULL, 1, '2021-03-02 00:30:45', '2021-03-02 00:30:45', NULL),
(71, 'BỘ MÁY TÍNH BÀN CHƠI GAME LED 8G PUBG, PUBG MOBI, FIFA 4', '<p>Bộ m&aacute;y t&iacute;nh chuy&ecirc;n chơi game nặng như: PUBG,PUBG MOBILE,FIFA ONLINE 4, LoL, GTA V, Battlefield 1, Đột K&iacute;ch, Battlefield 4, CS:Go, Dota<br />\r\n+ CPU được &eacute;p xung ( overlock ) l&ecirc;n core i7 mạnh mẽ.<br />\r\n+ Ram 8GB dư sức c&acirc;n c&aacute;c tựa game hạng nặng<br />\r\n+ SSD 120G lưu trữ đủ c&aacute;c game hot nhất (tốc độ gấp 500% ổ cứng hdd thường)<br />\r\n+ Card h&igrave;nh đồ họa GTX 750 - GTX750TI - GTX 1030 - RX470 4G hiệu năng ngang GTX 1050 TI .<br />\r\n+ Nguồn ATX c&ocirc;ng suất thực một số h&atilde;ng như Huntkey, cooler master, Acbel ., đảm bảo ổn định khi vận h&agrave;nh m&aacute;y&nbsp;<br />\r\n+ Vỏ game led đẹp chắc chắn ( t&ugrave;y theo thời điểm m&agrave; vỏ c&oacute; thể thay đổi ) .<br />\r\n+ M&agrave;n h&igrave;nh chơi game 19,20, 22inch - 24 inh đảm bảo chất lượng h&igrave;nh ảnh đẹp v&agrave; thoải m&aacute;i khi chơi game&nbsp;<br />\r\n+ Bộ ph&iacute;m chuột led giả cơ led 7 mầu chơi game cao cấp<br />\r\n+ B&agrave;n di chuột gaming cao cấp<br />\r\nBộ m&aacute;y t&iacute;nh chơi game trước khi giao tới qu&yacute; kh&aacute;ch đều đ&atilde; được chạy kiểm tra kĩ c&agrave;ng trước khi giao h&agrave;ng.</p>\r\n\r\n<p>#maytinhchoigame #maytinhchoigamegiare #maytinhban #pc #maytinhdeban #maytinhgaming #PUBG #pubgmobile #rx470 #rx580 #gtx1050ti #gtx1060 #fifaonline4 #gtav #ff4 #i5 #maytinhi7 #fifa4</p>', 'new_computer_1.jpg', 6999000, 11, 11, 0, 0, 10, 11, NULL, 1, '2021-03-02 00:32:37', '2021-03-02 00:32:37', NULL),
(72, 'BỘ MÁY TÍNH BÀN CHƠI GAME CORE I5 PUBG, PUBG MOBI, FIFA 4', '<p>ch&iacute;nh s&aacute;ch bảo h&agrave;nh v&agrave; hỗ trợ kh&aacute;ch h&agrave;ng:<br />\r\n✅ kh&aacute;ch h&agrave;ng lu&ocirc;n lu&ocirc;n đ&uacute;ng.<br />\r\n✅ C&aacute;c bạn được trả h&agrave;ng ho&agrave;n tiền trong 3 ng&agrave;y đầu kh&ocirc;ng cần l&yacute; do.<br />\r\n✅ Sản phẩm lỗi 1 đổi 1, n&oacute;i kh&ocirc;ng với sửa chữa.<br />\r\n✅ khi sản phẩm bị lỗi,nh&acirc;n vi&ecirc;n shiper giao h&agrave;ng mới v&agrave; lấy h&agrave;ng lỗi miễn ph&iacute; tại nh&agrave; của bạn<br />\r\n✅ c&aacute;c bạn c&oacute; thể y&ecirc;u cầu shop c&agrave;i game theo &yacute; m&igrave;nh.<br />\r\n✅Tổng đơn h&agrave;ng khi c&aacute;c đến tay c&aacute;c bạn bao gồm : &nbsp;case core i5, m&agrave;n h&igrave;nh 19 , 20 inch , ph&iacute;m chuột led, loa hoặc tai nghe, d&acirc;y cắm đầy đủ k&egrave;m theo.</p>\r\n\r\n<p>Bộ m&aacute;y t&iacute;nh CORE I5 được c&agrave;i WINDOW 10 MỚI NHẤT, chuy&ecirc;n chơi game nặng như: PUBG,PUBG MOBILE,FIFA ONLINE 4, LoL, GTA V, Battlefield 1, Battlefield 4, CS:Go, Dota.<br />\r\n+ CPU CORE I5<br />\r\n+ Ram 4GB dư sức c&acirc;n c&aacute;c tựa game hạng nặng<br />\r\n+ Ổ cứng SSD 120gb - tốc độ gấp 500% ổ cứng hdd thường<br />\r\n+ Card h&igrave;nh đồ họa rời GT730, GTX750 trở l&ecirc;N Đảm bảo chất lượng h&igrave;nh ảnh khi chơi game , xem video .<br />\r\n+ Nguồn ATX c&ocirc;ng suất thực một số h&atilde;ng như Huntkey, cooler master, Acbel ..., đảm bảo ổn định khi vận h&agrave;nh m&aacute;y&nbsp;<br />\r\n+ Vỏ game đẹp chắc ( t&ugrave;y theo thời điểm m&agrave; vỏ c&oacute; thể thay đổi ) .<br />\r\n+ M&agrave;n h&igrave;nh chơi game 19,20, 22inch - 24 inh đảm bảo chất lượng h&igrave;nh ảnh đẹp v&agrave; thoải m&aacute;i khi chơi game&nbsp;<br />\r\n+ Bộ ph&iacute;m chuột led giả cơ led 7 mầu chơi game cao cấp<br />\r\n+ B&agrave;n di chuột gaming cao cấp<br />\r\nBộ m&aacute;y t&iacute;nh chơi game trước khi giao tới qu&yacute; kh&aacute;ch đều đ&atilde; được chạy kiểm tra kĩ c&agrave;ng trước khi giao h&agrave;ng.</p>\r\n\r\n<p>#maytinhchoigame #maytinhchoigamegiare #bomaytinhchoigame #maytinhdeban #maytinhgaming #PUBG #pubgmobile #gtx750 #gtx750ti #fifaonline4 #gtav #ff4 #i5 #3470 #3570 #pubgmobile #pubg #fifa</p>', 'pubg_computer_10.jpg', 4999000, 11, 11, 0, 0, 10, 9, NULL, 1, '2021-03-02 00:35:06', '2021-03-02 00:35:06', NULL),
(73, 'USB Kingston SE9 LOẠI 16GB 32GB bảo hành Tại Shop', '<p>USB Kingston m&atilde; SE9 16GB 32GB BẢO H&Agrave;NH Tại Shop<br />\r\n-B&ecirc;n mình sẽ xé seal mặt sau hoặc mặt trước sản ph&acirc;̉m đ&ecirc;̉ l&acirc;́y dán tem bảo hành nh&acirc;̀m ph&acirc;n bi&ecirc;̣t sản ph&acirc;̉m mong khách lưu ý.<br />\r\n***Qu&yacute; kh&aacute;ch lưu &yacute;: Dung lượng 16Gb hoặc 32Gb sẽ khi cấm m&aacute;y sẽ kh&ocirc;ng nhận đủ. vd:16gb chỉ c&ograve;n khoảng hơn 14gb v&igrave; được hiểu theo 1Gb l&agrave; 1000mb trong khi thực tế 1gb l&agrave; 1024Mb bất cứ usb, thẻ nhớ hay ổ cứng cũng vậy.<br />\r\nUSB Kingston DTSE9 16GB - USB 2.0 thiết kế đơn giản gọn nhẹ với v&ograve;ng m&oacute;c chắc chắn c&ugrave;ng lớp vỏ kim loại &nbsp;s&agrave;nh điệu. Sản phẩm c&oacute; thể tương th&iacute;ch với nhiều hệ điều h&agrave;nh kh&aacute;c nhau. Dung lượng USB 16GB cũng đủ đ&aacute;p ứng nhu cầu lưu trữ của bạn.&nbsp;</p>\r\n\r\n<p>Th&ocirc;ng tin sản phẩm</p>\r\n\r\n<p>Thiết kế vỏ nh&ocirc;m nguy&ecirc;n khối<br />\r\nSản phẩm c&oacute; thiết kế nhỏ gọn rất th&iacute;ch hợp cho những người hay di chuyển. Vỏ kim loại s&agrave;nh điệu ́c&agrave;ng tăng l&agrave;m sự cuốn h&uacute;t của sản phẩm. V&ograve;ng m&oacute;c đeo lớn gi&uacute;p bạn dễ d&agrave;ng gắn với nhiều loại m&oacute;c kh&oacute;a kh&aacute;c nhau.</p>\r\n\r\n<p>Cổng kết nối<br />\r\nUSB Kingston c&oacute; thể kết nối với c&aacute;c m&aacute;y t&iacute;nh hiện h&agrave;nh th&ocirc;ng qua cổng USB 2.0 th&ocirc;ng thường. Bạn c&oacute; thể kết nối dễ d&agrave;ng với thiết bị th&ocirc;ng qua cổng USB 2.0 v&agrave; sử dụng ngay m&agrave; kh&ocirc;ng cần c&agrave;i đặt bất k&igrave; phần mềm n&agrave;o.</p>\r\n\r\n<p>Dung lượng<br />\r\nDung lượng 16GB cho phép bạn lưu trữ nhi&ecirc;̀u dữ li&ecirc;̣u hơn nhằm gi&uacute;p cho bạn lu&ocirc;n chủ động trong c&ocirc;ng việc.</p>\r\n\r\n<p>Th&ocirc;ng số kỹ thuật<br />\r\n- Dung lượng: 16GB<br />\r\n- Giao tiếp: USB 2.0<br />\r\n- Hỗ trợ Windows&reg; 8, Vista&reg;, &nbsp;XP &amp;amp; Mac, win 10</p>\r\n\r\n<p>Thủ thuật sử dụng USB đ&uacute;ng c&aacute;ch<br />\r\n- Hạn chế sự l&acirc;y lan của virus: Click phải v&agrave;o USB v&agrave; chọn Explorer để ngăn chặn sự x&acirc;m nhập của virus v&agrave;o m&aacute;y, n&ecirc;n qu&eacute;t virus bằng phần mềm trước khi sử dụng.<br />\r\n- Tr&aacute;nh l&agrave;m việc trực tiếp với dữ liệu lưu tr&ecirc;n ổ USB<br />\r\n- Để m&aacute;y t&iacute;nh khởi động hết c&aacute;c ứng dụng ho&agrave;n to&agrave;n mới cắm USB v&agrave;o m&aacute;y<br />\r\n- Ngắt USB an to&agrave;n: Chọn Eject/ Eject Mobile Disk/ Eject Mass Store Device Safely Remove USB Mass Storage Device trước khi r&uacute;t USB.<br />\r\n- Tr&aacute;nh để ổ USB bị rơi, bị va đập, tr&aacute;nh xa khỏi nước, v&agrave; đừng để ở nơi c&oacute; nhiệt độ qu&aacute; cao.<br />\r\n- Trong trường hợp kh&ocirc;ng may ổ USB bị rơi v&agrave;o nước, n&ecirc;n sấy kh&ocirc; ho&agrave;n to&agrave;n v&agrave; kh&ocirc;ng sử dụng &iacute;t nhất trong 48 giờ.<br />\r\n- Tr&aacute;nh &quot;FORMAT&quot; USB nhiều lần để tr&aacute;nh l&agrave;m giảm lưu lượng của USB.</p>\r\n\r\n<p>Bảo h&agrave;nh ch&iacute;nh h&atilde;ng 12 Th&aacute;ng tại Shop.</p>', 'kingston_usb_1.jpg', 90000, 11, 11, 0, 0, 10, 10, NULL, 1, '2021-03-02 00:37:57', '2021-03-02 00:37:57', NULL),
(74, 'Máy ảnh lấy liền Fujifilm Instax Mini 90 + tặng kèm pack 1 film/10 kiểu', '<p>Thương hiệu<br />\r\nFUJIFILM<br />\r\nK&iacute;ch thước v&agrave; Trọng lượng: 113.4mm x 91.9mm x 57.2mm, 296g (kh&ocirc;ng bao gồm pin, d&acirc;y đeo v&agrave; phim)<br />\r\nBảo h&agrave;nh:&nbsp;&nbsp; &nbsp;Bảo h&agrave;nh 12 th&aacute;ng tại MAYANHVN<br />\r\nK&iacute;ch thước Film: 86mm x 54mm<br />\r\nK&iacute;ch thước h&igrave;nh ảnh: 62mm x 46mm<br />\r\nLens: Di chuyển v&agrave;o / ra ống k&iacute;nh loại, 2 th&agrave;nh phần, 2 yếu tố, f = 60mm, F = 12,7<br />\r\nViewfinder: Bất ảnh finder, 0.37x, với vị tr&iacute; mục ti&ecirc;u v&agrave; điều chỉnh sai cho chế độ macro<br />\r\nTập trung: Motor-driven chuyển mạch 3-range, 0.3m - &infin; (chế độ macro: 0,3m - 0,6m, chế độ b&igrave;nh thường: 0.6m - 3.0m, chế độ phong cảnh: 3.0m - &infin;)<br />\r\nNhả m&agrave;n trập: m&agrave;n trập điện tử, 1,8 - 1/400 gi&acirc;y. tốc độ m&agrave;n trập (chế độ macro: khẩu độ tự động cố định tại F22, chế độ Bulb: tối đa m&agrave;n trập 10 gi&acirc;y thời gian mở)<br />\r\nKiểm so&aacute;t phơi s&aacute;ng: tự động, LV5.0 - 15,5 (ISO800), s&aacute;ng-tối kiểm so&aacute;t &plusmn; 2 / 3EV, + 1EV<br />\r\nPhim ăn ra: tự động<br />\r\nFlash: Flash điện tử tự động (với chức năng điều chỉnh độ s&aacute;ng), buộc chế độ bắn (với chức năng điều chỉnh độ s&aacute;ng), đ&egrave;n flash tắt chế độ, chế độ giảm mắt đỏ<br />\r\nNguồn cung cấp: NP-45A .charge lithium-ion: 10 bao phim&nbsp;<br />\r\nC&aacute;c mặt h&agrave;ng k&egrave;m theo: d&acirc;y đeo vai, Bảo h&agrave;nh, NP-45A pin sạc, BC-45C Battery Charger<br />\r\nK&iacute;ch thước v&agrave; Trọng lượng: 113.4mm x 91.9mm x 57.2mm, 296g&nbsp;<br />\r\n#Fujifilmmini90 #mini90</p>', 'mayanh.jpg', 3000000, 11, 11, 0, 0, 11, 7, NULL, 1, '2021-03-02 02:05:23', '2021-03-02 02:05:23', NULL);
