(62, 'Máy Tính Xách Tay Huawei Matebook D15 (8GB/256GB) | Màn Hình HUAWEI Fullview | HUAWEI Share | Camera ẩn', '<p>Trả g&oacute;p 0%: https://shopee.vn/m/tra-gop-0-lai-suat<br />\r\n--------------------------------------------------------------------------------------------<br />\r\nM&aacute;y T&iacute;nh X&aacute;ch Tay Huawei Matebook D15 (8GB/256GB) | M&agrave;n H&igrave;nh HUAWEI Fullview | HUAWEI Share | Ph&iacute;m Nguồn Kết Hợp Bảo Mật V&acirc;n Tay | Camera ẩn | H&agrave;ng ph&acirc;n phối ch&iacute;nh h&atilde;ng&nbsp;</p>\r\n\r\n<p>Th&ocirc;ng số kỹ thuật chi tiết Huawei MateBook D15 R5 3500U 8GB/256GB/Win10 (Boh-WAQ9R)<br />\r\nBộ xử l&yacute;<br />\r\nC&ocirc;ng nghệ CPU&nbsp;&nbsp; &nbsp;AMD Ryzen 5<br />\r\nLoại CPU&nbsp;&nbsp; &nbsp;3500U<br />\r\nTốc độ CPU&nbsp;&nbsp; &nbsp;2.10 GHz<br />\r\nTốc độ tối đa&nbsp;&nbsp; &nbsp;3.7 GHz<br />\r\nBộ nhớ RAM, Ổ cứng<br />\r\nRAM&nbsp;&nbsp; &nbsp;8 GB<br />\r\nLoại RAM&nbsp;&nbsp; &nbsp;DDR4 (On board)<br />\r\nTốc độ Bus RAM&nbsp;&nbsp; &nbsp;2400 MHz<br />\r\nHỗ trợ RAM tối đa&nbsp;&nbsp; &nbsp;Kh&ocirc;ng hỗ trợ n&acirc;ng cấp<br />\r\nỔ cứng&nbsp;&nbsp; &nbsp;SSD 256GB NVMe PCIe<br />\r\nM&agrave;n h&igrave;nh<br />\r\nK&iacute;ch thước m&agrave;n h&igrave;nh&nbsp;&nbsp; &nbsp;15.6 inch<br />\r\nĐộ ph&acirc;n giải&nbsp;&nbsp; &nbsp;Full HD (1920 x 1080)<br />\r\nC&ocirc;ng nghệ m&agrave;n h&igrave;nh&nbsp;&nbsp; &nbsp;Tấm nền IPS<br />\r\nM&agrave;n h&igrave;nh cảm ứng&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\nĐồ họa v&agrave; &Acirc;m thanh<br />\r\nThiết kế card&nbsp;&nbsp; &nbsp;Card đồ họa t&iacute;ch hợp<br />\r\nCard đồ họa&nbsp;&nbsp; &nbsp;AMD Radeon Vega 8 Graphics<br />\r\nC&ocirc;ng nghệ &acirc;m thanh&nbsp;&nbsp; &nbsp;Dolby Audio<br />\r\nCổng kết nối &amp;amp; t&iacute;nh năng mở rộng<br />\r\nCổng giao tiếp&nbsp;&nbsp; &nbsp;2 x USB 2.0, HDMI, USB 3.0, USB Type-C<br />\r\nKết nối kh&ocirc;ng d&acirc;y&nbsp;&nbsp; &nbsp;Bluetooth v5.0, Wi-Fi 802.11 a/b/g/n/ac<br />\r\nKhe đọc thẻ nhớ&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\nỔ đĩa quang&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\nWebcam&nbsp;&nbsp; &nbsp;HD webcam<br />\r\nT&iacute;nh năng kh&aacute;c&nbsp;&nbsp; &nbsp;Webcam ẩn, Bảo mật v&acirc;n tay<br />\r\nĐ&egrave;n b&agrave;n ph&iacute;m&nbsp;&nbsp; &nbsp;Kh&ocirc;ng<br />\r\nPin &amp;amp; Adapter<br />\r\nLoại PIN&nbsp;&nbsp; &nbsp;PIN liền<br />\r\nModel Adapter&nbsp;&nbsp; &nbsp;HW-200325UPO<br />\r\nTh&ocirc;ng tin Pin&nbsp;&nbsp; &nbsp;Li-Ion 3 cell<br />\r\nHệ điều h&agrave;nh<br />\r\nHệ điều h&agrave;nh&nbsp;&nbsp; &nbsp;Windows 10 Home SL<br />\r\nK&iacute;ch thước &amp;amp; trọng lượng<br />\r\nK&iacute;ch thước&nbsp;&nbsp; &nbsp;D&agrave;i 357.8 mm - Rộng 229.9 mm - D&agrave;y 16.9 mm<br />\r\nTrọng lượng&nbsp;&nbsp; &nbsp;1.62 kg<br />\r\nChất liệu&nbsp;&nbsp; &nbsp;Vỏ kim loại nguy&ecirc;n khối<br />\r\nTh&ocirc;ng tin kh&aacute;c<br />\r\nThời điểm ra mắt&nbsp;&nbsp; &nbsp;2020<br />\r\nThiết kế sang trọng - đẳng cấp&nbsp;<br />\r\nHuawei MateBook D15 mang đến một thiết kế ho&agrave;n mĩ với vỏ kim loại nguy&ecirc;n khối, th&acirc;n m&aacute;y mỏng nhẹ tối ưu cho việc di chuyển. Với trọng lượng chỉ 1.62 kg - độ d&agrave;y 16.9 mm, Huawei MateBook c&oacute; thể đồng h&agrave;nh c&ugrave;ng bạn bất cứ l&uacute;c n&agrave;o, cũng như bất cứ nơi n&agrave;o bạn muốn.</p>\r\n\r\n<p>Hiệu năng l&iacute; tưởng cho c&ocirc;ng việc văn ph&ograve;ng v&agrave; giải tr&iacute;<br />\r\nHuawei MateBook D15 sử dụng con chip AMD Ryzen 5 gi&uacute;p tăng tốc v&agrave; tăng cường hiệu suất.&nbsp;</p>\r\n\r\n<p>RAM 8 GB gi&uacute;p đa nhiệm mượt m&agrave;, hạn chế t&igrave;nh trạng giật, lag m&aacute;y khi mở nhiều tab.</p>\r\n\r\n<p>Card đồ họa AMD Radeon Vega 8 Graphics đem đến chất lượng đồ họa tốt hơn, bạn c&oacute; thể chơi được c&aacute;c tựa game phổ biến hiện nay như LOL, FIFA ở cấu h&igrave;nh trung b&igrave;nh đến cao, Fortnite ở mức cấu h&igrave;nh thấp.</p>\r\n\r\n<p>Với cấu h&igrave;nh n&agrave;y, bạn c&oacute; thể l&agrave;m việc văn ph&ograve;ng, học tập, giải tr&iacute; cũng như thoải m&aacute;i s&aacute;ng tạo với c&aacute;c ứng dụng đồ họa như Photoshop, Ai,... hay dựng video đơn giản, chỉnh sửa video tr&ecirc;n Premiere.</p>\r\n\r\n<p>Tận hưởng m&agrave;n h&igrave;nh tr&agrave;n viền cho&aacute;ng ngợp<br />\r\nHuawei trang bị cho MateBook D15 m&agrave;n h&igrave;nh FullView 15.6 inch c&oacute; viền cực mỏng, cho tỉ lệ m&agrave;n h&igrave;nh so với th&acirc;n m&aacute;y đến 87% đem đến trải nghiệm nh&igrave;n cho&aacute;ng ngợp v&agrave; đ&atilde; mắt.&nbsp;</p>\r\n\r\n<p>M&agrave;n h&igrave;nh c&oacute; độ ph&acirc;n giải đạt chuẩn Full HD c&ugrave;ng c&ocirc;ng nghệ IPS cung cấp h&igrave;nh ảnh c&oacute; độ sắc n&eacute;t cao, m&agrave;u sắc trung thực v&agrave; độ tương phản tốt, đ&acirc;y cũng l&agrave; điều kiện để bạn l&agrave;m việc đồ họa hay chỉnh sửa h&igrave;nh ảnh được chuẩn x&aacute;c hơn về m&agrave;u sắc.</p>\r\n\r\n<p>M&agrave;n h&igrave;nh đạt chứng nhận TUV Rheinland giảm &aacute;nh s&aacute;ng xanh g&acirc;y hại cho mắt, bảo vệ thị gi&aacute;c của bạn trong thời gian d&agrave;i sử dụng.</p>\r\n\r\n<p>C&ocirc;ng nghệ Dolby Audio cho chất &acirc;m sống động c&ugrave;ng với khả năng giả lập &acirc;m thanh v&ograve;m cho người nghe cảm gi&aacute;c như đang h&ograve;a m&igrave;nh v&agrave;o trong thế giới &acirc;m nhạc.</p>\r\n\r\n<p>Huawei Share - Chia sẻ một chạm&nbsp;<br />\r\nTrao đổi th&ocirc;ng tin giữa điện thoại th&ocirc;ng minh v&agrave; laptop dễ d&agrave;ng hơn bao giờ hết với t&iacute;nh năng Huawei Share tr&ecirc;n MateBook D15.</p>\r\n\r\n<p>Khi kết nối 2 thiết bị, m&agrave;n h&igrave;nh điện thoại sẽ xuất hiện tr&ecirc;n m&aacute;y t&iacute;nh x&aacute;ch tay của bạn, cho ph&eacute;p bạn k&eacute;o thả c&aacute;c tệp tin giữa hai thiết bị v&agrave; chỉnh sửa tệp tin ngay tr&ecirc;n m&aacute;y t&iacute;nh trong khi nhắn tin với đồng nghiệp tr&ecirc;n điện thoại bằng c&ugrave;ng một bộ b&agrave;n ph&iacute;m v&agrave; chuột m&aacute;y t&iacute;nh.&nbsp;</p>\r\n\r\n<p>Camera ẩn đảm bảo t&iacute;nh ri&ecirc;ng tư cho người d&ugrave;ng<br />\r\nHuawei mang đến thiết kế camera cực k&igrave; s&aacute;ng tạo được đặt ẩn dưới b&agrave;n ph&iacute;m c&oacute; khả năng nhấn để bật mở v&agrave; nhấn th&ecirc;m một lần nữa để ẩn camera đi. T&iacute;nh năng n&agrave;y gi&uacute;p người d&ugrave;ng chủ động hơn trong việc kiểm so&aacute;t th&ocirc;ng tin, hạn chế bị đ&aacute;nh cắp h&igrave;nh ảnh v&agrave;o mục đ&iacute;ch xấu.</p>\r\n\r\n<p>Laptop tảng bị cảm biến v&acirc;n tay được t&iacute;ch hợp tr&ecirc;n n&uacute;t nguồn để bạn dễ d&agrave;ng đăng nhập chỉ bằng một thao t&aacute;c chạm, n&acirc;ng cao độ bảo mật hơn cho th&ocirc;ng tin tr&ecirc;n m&aacute;y.&nbsp;</p>\r\n\r\n<p>MateBook D15 c&oacute; đủ c&aacute;c cổng kết nối th&ocirc;ng dụng trong một th&acirc;n m&aacute;y mỏng nhẹ, kết nối dễ d&agrave;ng, chia sẻ dữ liệu nhanh ch&oacute;ng.&nbsp;</p>\r\n\r\n<p>MateBook D15 c&oacute; k&egrave;m theo bộ sạc USB Type-C tiện lợi, t&iacute;ch hợp khả năng sạc nhanh. M&aacute;y t&iacute;nh c&oacute; thể sạc l&ecirc;n 53% chỉ trong khoảng 30 ph&uacute;t (theo h&atilde;ng c&ocirc;ng bố) gi&uacute;p bạn kh&ocirc;ng lo gi&aacute;n đoạn c&ocirc;ng việc.</p>\r\n\r\n<p>Huawei MateBook D15 vừa c&oacute; cấu h&igrave;nh cực khỏe trong ph&acirc;n kh&uacute;c laptop văn ph&ograve;ng lại sở hữu vẻ ngo&agrave;i đẳng cấp, chắc chắn n&oacute; sẽ khiến bạn h&agrave;i l&ograve;ng ngay từ lần sử dụng đầu ti&ecirc;n.</p>\r\n\r\n<p>PHỤ KIỆN TRONG HỘP<br />\r\nPC x 1<br />\r\nBộ đổi nguồn HUAWEI USB-C AC Adapter x 1<br />\r\nC&aacute;p chuyển đổi nguồn (USB-C) x 1<br />\r\nHướng dẫn bắt đầu nhanh x 1<br />\r\n*C&oacute; thể thay đổi trong thị trường kh&aacute;c nhau. Li&ecirc;n hệ với k&ecirc;nh b&aacute;n h&agrave;ng địa phương để nhận danh s&aacute;ch chi tiết hơn.</p>\r\n\r\n<p>*Đối với điện thoại th&ocirc;ng minh, m&aacute;y t&iacute;nh bảng, laptop, đồng hồ, v&ograve;ng đeo th&ocirc;ng minh, tai nghe freebuds, SoundX:&nbsp;<br />\r\nBảo h&agrave;nh 12 th&aacute;ng&nbsp;<br />\r\nĐổi m&aacute;y trong 30 ng&agrave;y đầu&nbsp;<br />\r\nHỗ trợ vận chuyển miễn ph&iacute; hai chiều đối với sản phẩm đủ điều kiện bảo h&agrave;nh&nbsp;</p>', 'huawei_laptop_1.jpg', 14990000, 11, 11, 0, 0, 10, 5, NULL, 1, '2021-03-02 00:20:48', '2021-03-02 00:20:48', NULL),
