(65, 'Laptop Apple Macbook Pro 2020 13 inch With Touch Bar Core i5 1.4GHz 8GB 256GB - Chính hãng', '<p>:balloon:️ SẢN PHẨM MỚI 100%, NGUY&Ecirc;N SEAL - chưa qua sử dụng<br />\r\nballoon:️ Masta Shop bao test 10 ng&agrave;y 1 đổi 1 nếu c&oacute; m&aacute;y c&oacute; lỗi.<br />\r\n:balloon:️ Sản phẩm ch&iacute;nh h&atilde;ng Apple<br />\r\n:balloon:️ Bảo h&agrave;nh 1 năm ch&iacute;nh h&atilde;ng</p>\r\n\r\n<p>H&atilde;ng sản xuất &nbsp;&nbsp; &nbsp;Apple<br />\r\nK&iacute;ch thước &nbsp;&nbsp; &nbsp;1.56 x 30.41 x 21.24<br />\r\nTrọng lượng &nbsp;&nbsp; &nbsp;1.4 kg<br />\r\nLoại m&agrave;n h&igrave;nh &nbsp;&nbsp; &nbsp;LED-backlit display with IPS technology, độ s&aacute;ng 500 nits, chuẩn m&agrave;u Wide color (P3), c&ocirc;ng nghệ True Tone<br />\r\nK&iacute;ch thước m&agrave;n h&igrave;nh &nbsp;&nbsp; &nbsp;13.3 inches<br />\r\nĐộ ph&acirc;n giải m&agrave;n h&igrave;nh &nbsp;&nbsp; &nbsp;2560 x 1600 pixels<br />\r\nHệ điều h&agrave;nh &nbsp;&nbsp; &nbsp;MacOS<br />\r\nPhi&ecirc;n bản hệ điều h&agrave;nh &nbsp;&nbsp; &nbsp;macOS Catalina<br />\r\nCPU &nbsp;&nbsp; &nbsp;1.4GHz quad‑core 8th‑generation Intel Core i5, Turbo Boost up to 3.9GHz, with 128MB of eDRAM<br />\r\nVGA &nbsp;&nbsp; &nbsp;Intel Iris Plus Graphics 645<br />\r\nỔ cứng &nbsp;&nbsp; &nbsp;256GB SSD<br />\r\nRAM &nbsp;&nbsp; &nbsp;8GB of 2133MHz LPDDR3 onboard memory<br />\r\nWLAN &nbsp;&nbsp; &nbsp;802.11ac<br />\r\nBluetooth &nbsp;&nbsp; &nbsp;Bluetooth 5.0<br />\r\nCổng/Khe cắm &nbsp;&nbsp; &nbsp;Thunderbolt 3 (USB-C) x 2 support for: Charging DisplayPort Thunderbolt (up to 40Gb/s) USB 3.1 Gen 2 (up to 10Gb/s), 3.5mm headphone jack<br />\r\nT&iacute;nh năng kh&aacute;c &nbsp;&nbsp; &nbsp;720p FaceTime HD camera, Touch ID sensor, Touch Bar<br />\r\nPin &nbsp;&nbsp; &nbsp;Built‑in 58.2‑watt‑hour lithium‑polymer battery, 61W USB‑C Power Adapter</p>', 'mac_laptop_1.jpg', 31000000, 11, 11, 0, 0, 10, 10, NULL, 1, '2021-03-02 00:24:41', '2021-03-02 00:24:41', NULL),
