(67, 'Laptop cũ dell latitude e7250 i7 5600u ram 4gb ssd 128gb màn hình 12.5 inch nhỏ gọn 1.3 kg', '<p>Laptop Dell latitude E7250 ultrabook, d&ograve;ng laptop ultrabook si&ecirc;u mỏng, nhẹ độ bền thiết kế theo ti&ecirc;u chuẩn qu&acirc;n đội usa, t&iacute;nh di động cao th&iacute;ch hợp cho người hay di chuyển.<br />\r\nLoa bass cực &ecirc;m, &acirc;m thanh vượt trội so với c&aacute;c d&ograve;ng kh&aacute;c.<br />\r\nỔ ssd của laptop Dell truy xuất cực nhanh, khởi động win chỉ mấy v&agrave;i gi&acirc;y.<br />\r\nH&agrave;ng laptop x&aacute;ch tay thanh l&yacute; qu&acirc;n đội USA n&ecirc;n chất lượng khỏi phải b&agrave;n.<br />\r\n&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;&mdash;<br />\r\nCấu h&igrave;nh laptop cũ Dell latitude E7250:<br />\r\nCPU: Intel Core i7 Haswell 5600U<br />\r\nRam: 4GB ddr3<br />\r\nỔ cứng: SSD 128GB zin theo m&aacute;y, truy xuất cực nhanh<br />\r\nCard m&agrave;n h&igrave;nh: HD5500 1GB<br />\r\nM&agrave;n h&igrave;nh: 12.5 inch HD<br />\r\nSạc zin, Pin zin x&agrave;i 3h<br />\r\nC&acirc;n nặng: 1.3 kg<br />\r\nBảo H&agrave;nh 6 th&aacute;ng 1 đổi 1<br />\r\nT&igrave;nh trạng m&aacute;y mới 95%</p>', 'dell_laptop_1.jpg', 6999000, 11, 11, 0, 0, 10, 10, NULL, 1, '2021-03-02 00:27:10', '2021-03-02 00:27:10', NULL);

